INSERT INTO `evento` VALUES (193,2,'Desde el Silln','El unipersonal musical xito de Buenos Aires llega a Colombia Qu pasara si maana fuese el ltimo da de mi vida?\r\n\r\nEste interrogante existencial es el que toma a Ana, la protagonista, por completo y le dispara un sin fin de pensamientos, sentimientos y contradicciones. Ella es una chica ms de esta sociedad moderna, quien tras la sorpresiva muerte de su vecina, la atraviesa la realidad de que maana podra ser el ltimo da de su existencia y se empieza a preguntar, tal vez por primera vez, que est haciendo con su vida.','eventimg/8152724302.jpeg','Teatro Libre - Chapinero',0,'Bogot','','','CAMARA DE COMERCIO COLOMBO-ARGENTINA ','Una obra que llega al corazn del espectador ya que toca la nica verdad inexorable que todos compartimos en este mundo: Todos nos vamos a morir. Y que es lo que vamos a hacer mientras esta vida este ganando, momentneamente, la partida.',2,389,57,0,'PUB',2,'2014-05-02 11:36:16','','https://www.youtube.com/watch?v=DMvcBuv5Vmc',0,0,'2014-4-28 05:50:01'),(386,2,'Feria Internacional MBA','El QS World MBA Tour es la feria de programas MBA ms importante del mundo y trae muchas de las escuelas de negocio ms influyentes del mundo, adems brinda asesoramiento de expertos en la eleccin del programa MBA que mejor se adapta a tu perfil, procesos de admisin y elaboracin de tu CV.\r\n<br><br>Ms de 60 escuelas de negocio de Norteamrica, Europa, Asia y Latinoamrica estarn presentes con sus directores de admisin dispuestos a responder tus preguntas y despejar tus dudas con recomendaciones claves para que tu admisin transcurra exitosamente.','../eventimg/1520828716Feria Internacional MBA.jpg','Hotel NH Royal Metrotel, Cll 74 #13-27',2,'Bogot','https://www.facebook.com/Colfuturo','Colfuturo','QS World Grad School Tour','    ',7,319,57,1,'PUB',2,'2015-09-02 18:04:42','','https://www.youtube.com/watch?v=nOORhKaEoec',0,0,'2015-9-1 21:55:56'),(192,2,'47 Festival de la Leyenda Vallenata. ','La leyenda Vallenata','eventimg/829107051Afiche-47-Festival-de-la-Leyenda-Vallenata-en-Homenaje-a-Diomedes-Daz.jpg','Parque de la Leyenda Vallenata Consuelo',0,'Valledupar','','','FUNDACIN FESTIVAL DE LA LEYENDA VALLENATA','Homenaje a Diomedes Diaz',4,286,57,0,'DEL',2,'2015-05-28 17:03:06','','https://www.youtube.com/watch?v=VAAgTuoea6M',0,0,'2014-4-21 10:52:23'),(188,2,'Pet Run 5k','Pet Run, una carrera diferente enfocada a llevar un mensaje ambientalista con ingredientes recreativos y competitivos, busca generar un espacio de unin entre seres vivos de diferentes especies, con entretenimiento para toda la familia.\r\n\r\nEn cuanto a responsabilidad social, nuestro objetivo, concientizar todos los asistentes a nuestro evento sobre la tenencia responsable, para ello contaremos con el apoyo de diferentes fundaciones para lograrlo.\r\n\r\nA largo plazo, quisiramos construir un refugio para animales abandonados, en esta primera edicin, gran parte de los recursos, sern donados a fundaciones, todo con el nimo de seguir en la lucha de la proteccin de la flora y fauna, as mismo entregaremos el 1er. parque canino para Bogot.','eventimg/1407469421Dog.jpg','Parque Simn Bolvar',0,'Bogot','','','RIE ENTRETENIMIENTO LTDA ','Para participar en la carrera habr 3 circuitos:\r\n\r\n5K: Para profesionales, entrenadores o amateurs, constituidas: un participante (mayor 18 aos o menor entre 14 y 18 aos con autorizacin firmada por sus padres) y su perro (1 ao), que tengan la capacidad fsica de correr el trayecto.\r\n\r\n3K: Creada para parejas constituidas: un participante (mayor de 18 aos o menor con autorizacin) y su perro (mnimo con 6 meses), que deseen completar el recorrido caminando. Esta categora a diferencia de la 5K, principalmente recreativa y no competitiva.\r\n\r\n1K KIDS: Esta categora est abierta para equipos constituidos: dos personas y su perro, adulto de 18 aos o un menor entre 14 a 18 (autorizacin firmada); un nio de 4 a 14 aos de edad (autorizacin firmada) y su perro (mnimo con 6 meses), que deseen caminar o correr en familia. Esta categora a diferencia de la 5K, es principalmente recreativa y no competitiva.',3,403,57,0,'PUB',2,'2014-05-02 11:29:02','','',0,0,'2014-4-15 06:53:30'),(189,1,'Nicky Jam. Silver Night','NEW YORK SHOP celebra su VII ANIVERSARIO y te invita a vivir la SILVER NIGHT. una noche mgica en donde Bogot podr disfrutar de un espectacular concierto con una de las leyendas mas importantes del Reggaetn de todos los tiempos, nacido en Boston - Estados Unidos y radicado en la Isla del Encanto - Puerto Rico; NICKY JAM, con una trayectoria que comprende mas de 4 lbumes como solista y varios acompaamientos junto a otras estrellas del genero, es considerado uno de los artistas ms interesantes y con mayor prestigio dentro del panorama musical latino que existe en la actualidad musical.','eventimg/1892932076nICKY.jpg','Simona Cub',0,'Bogot','Nickyjampr','','JEFFERSON STEVEN MORALES','Acompaando esta noche mgica, podrs disfrutar de las mezclas en vivo del DJ MARIO ANDRETTI, uno de los mas importantes artistas de la escena dee jay en Colombia y Latino Amrica.\r\n\r\nUn mega evento que no te puedes perder.',1,183,57,0,'DEL',2,'2015-05-28 16:21:04','','https://www.youtube.com/watch?v=7T_09ueky2o',0,0,'2014-4-15 10:32:49'),(198,1,'Flisol Bogot 2015','Es el Festival Latinoamericano de Instalacin de Software Libre y actualmente es el evento de difusin de Software Libre ms grande en Latinoamrica. Su principal objetivo es promover el uso del software libre, dando a conocer al pblico en general su filosofa, alcances, avances y desarrollo. Para tal fin, las diversas comunidades locales organizan simultneamente eventos en los que se instala software libre y adems se ofrecen charlas, ponencias y talleres en torno a la filosofa del Software Libre en toda su gama de expresiones: artstica, acadmica, empresarial y social.','eventimg/1249429523flisol.png','Instituto Distrital para la Recreacin y',2,'Bogota','','','Comunidad de Software Libre de Bogot','',7,0,57,0,'DEL