m con 6,500ft / 2.000 metros de ascenso positovo (escalada), ambas rutas desafiarn a los participantes del CRM GFNY Colombia.','eventimg/907588678GMY.jpg','Calle 72 # 10 - 51  Of 501',2,'Bogota','gfnycolombia','GFNYCOL','CRM GFNY Colombia','',3,496,57,0,'PUB',2,NULL,'','',0,0,'2015-4-11 06:14:20'),(206,1,'HACER LA PAZ ES','El encuentro de jvenes HACER LA PAZ ES pretende dar respuesta a una pregunta fundamental Que significa educar y construir cultura de Paz? \r\nHACER LA PAZ no es reaccionar solo cuando los problemas nos afectan directamente. En Colombia no es tarea de unos pocos o solo de los mayores; mientras los jvenes se entregan a sonar y a usar la tecnologia como diversion en las redes sociales. HACER LA PAZ es aprovechar el impulso, la determinacion de grupos cada vez ms grandes de jvenes que sin diferencia de genero, raza, region o nivel educativo, han asumido hacer un aporte concreto y efectivo a LA PAZ del pas. La PAZ no es una firma ni un acuerdo entre dos grupos, es el ejercicio diario de la convivencia. Y como se logra? Convirtiendo los suenos y deseos en ideas y proyectos, trabajando con otros para que esas ideas y proyectos se conviertan en hechos reales que afecten positivamente a la comunidad.\r\nHACER LA PAZ ES es un nuevo espacio de experimentacion donde las ideas atrevidas y el conocimiento tecnologico de los jovenes se unen con las organizaciones que tienen la voluntad y el poder de ayudar a que los proyectos se hagan realidad.\r\nLa formula de trabajo es simple: \r\nJovenes + Tecnologia / Innovacion + Experimentacion.\r\nHACER LA PAZ ES, es el lugar donde las mentes jovenes pueden encontrar el CONOCIMIENTO Y APOYO para convertir sus IDEAS en ACCIONES PODEROSAS de CONVIVENCIA PACIFICA en cada esquina de Colombia.','eventimg/39854904hacerlapaz.png','Camara Comercio de Bogot Av el Dorado No 68D - 35',2,'Bogota','','','IxE = D + P','',6,362,57,0,'PUB',2,NULL,'','',0,0,'2015-4-11 06:38:42'),(207,1,'TALLER INTENSIVO DE SERIGRAFA CON SHUZ SHUZ','La se