 al Parque del 11 al 21 de Octubre de 2015.</i></b>\r\n<br><br>El Festival tiene por objetivo acercar el gnero lrico y la pera a toda la ciudadana, para lo cual han sido seleccionados espectculos de calidad, incluyendo la Jornada al Parque el da 11 de Octubre en el Parque de la 93 con programacin desde la 1:00PM.\r\nTodas las presentaciones artsticas sern abiertas al pblico y de entrada libre.\r\nEsperamos que se unan a esta celebracin donde ms de 15 presentaciones y 300 artistas harn de Bogot una fiesta de pera.\r\n<br><br>La gala de piano ser ofrecida por <b>Juan Sebastin Avendao, Ganador del Concurso Nacional de Canto en la&nbsp;Categora&nbsp;de Pianista.</b>&nbsp;Juan Sebastin naci en Bogot en 1993, ha tomado clases magistrales con Blanca Uribe, Ricardo Castro, Albert Guinovart, Valentina Lisitsa, Harold Martina y Hugues Leclre. <br><br>Ha participado en las ediciones 2012, 2013 y 2014 de festivales de msica clsica en Brasil.\r\nEn enero del 2013 fue el pianista invitado por la Orquesta Filarmnica de Jaragu do Sul para participar en la apertura del Festival de Msica de Santa Catarina. \r\nHa sido seleccionado pianista becario del Festival Internacional de Msica de Cartagena en las ediciones 2014 y 2015.','../eventimg/85717464XVIII Festival de pera al Parque - Gala de Piano.png','Foyer - Teatro Coln Bogot  Cll 10 No 5-32 ',2,'Bogot','https://www.facebook.com/orquestafilarmonica','filarmonibogota','Orquesta Filarmnica de Bogot','PREGUNTAS FRECUENTES\r\n> Existe restriccin de edad para los asistentes al evento?\r\nNo existe restriccin de ingreso.\r\n> El teatro cuenta con parqueadero?\r\nEl Teatro Coln tiene actualmente un convenio con el parqueadero Calle 12 FG, quienes ofrecen una tarifa reducida de $7.000 presentado la boleta del espectculo al momento de retirar el vehculo.  Esta tarifa aplica slo para pblico del Teatro Coln en la fecha y  hora indicada en la boleta.\r\n> Tengo que llevar mi tiquete impreso el da del evento?\r\nSi, para la entrada al teatro es n