erebrales, prtesis de cadera, problemas de columna, prtesis y mujeres embarazadas.',3,1308,57,0,'PUB',2,'2015-10-05 20:37:17','','https://www.youtube.com/watch?v=IoJexgoGsZQ',0,0,'2015-5-25 18:11:09'),(249,16,'Shakti Danza Arabe Bollywood - Antonina Canal ','Ganadoras del mundial Egipto 2014. Antonina Canal y 330 bailarinas en esecena de la Academia Prem Shakti en un espectacular viaje por las danzas arabes y de la India. Magia, belleza, sensualidad, arte y sabiduria oriental. Velos de Seda, Alas de Isis, Sables, Bollywood, Bhangra y Fusion.','eventimg/95812400Shakti Danza Arabe Bollywood.jpg','Teatro Colsubsidio',2,'Bogot','antonina.davila?fref=nf&pnref=story','AntoninaCanal','Antonina Canal Dvila ','Apertura de Puertas 07:00',2,316,57,0,'PUB',2,NULL,'','https://www.youtube.com/watch?v=HOjoa230woU',0,0,'2015-5-25 19:01:03'),(250,16,'Stand Up Comedy - Golden Voice','Despus del xito rotundo de las temporadas anteriores, a partir del ltimo martes de mayo comienza la tercera temporada del club de comedia Colombian Comedy Club en El Sitio Bar del Parque de la 93. Esta vez el pool de artistas del club de comedia compartir escenario con talentos de otras ciudades de Colombia y destacados comediantes venezolanos y mexicanos.','eventimg/271095227Stand Up Comedy - Golden Voice.jpg','El Sitio de Bar',2,'Bogot','pages/Colombian-Comedy-Club/1475485415998429','@jota_booking','Jorge Armando Prez ','Adems de fantsticos e hilarantes monlogos sobre temticas diversas, los comediantes alternarn su faceta de comedia con la de entrevistadores de personajes destacados de la farndula nacional como actores y cantantes, que sern invitados especiales cada 15 das. La idea de este espacio es resaltar lo mejor de estos famosos, explorando la parte alegre y divertida de cada uno, a travs de la actuacin, de la mmica, entre otros.\r\n\r\nUn Show nico en el que podrn disfrutar de la magia, la comedia y la msica desde el inicio.',2,347,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=xURIj8MyRco',0,0,'2015-5-25 21:29:09'),(376,16,'Reto Sony ActionCam','Te invitamos a que nos acompaes en el Reto Sony ActionCam, el cual consiste en una actividad de hiking en La Qubrada La Vieja en Bogot. No importa que no tengas una cmara Sony ActionCam, ya que a cada participante se le prestar una* durante el evento. Aquellos que lleguen entre los primeros 10 participaran en el sorteo de una ActionCam de Sony, para que no vuelvas a perderte ni un momento de tus actividades. Cupos Limitados.','../eventimg/472725987Reto Sony ActionCam.jpg','Quebrada La Vieja, Cl. 71 #1-45',2,'Bogot','https://www.facebook.com/ActionCamBySony','Actioncam','Sony','Sony Corporation, o comnmente referida como Sony, es una empresa multinacional japonesa con sede en KnanMinato, Tokio (Japn), y uno de los fabricantes lder mundial en la electrnica de consumo: audio y vdeo, computacin, fotografa, videojuegos, telefona mvil y productos profesionales.',3,227,57,1,'PUB',2,'2015-08-27 18:22:05','','https://www.youtube.com/watch?v=10D0EKVmh_g',0,0,'2015-8-27 18:08:20'),(251,16,'Sueo con Revlver','Sueo con Revlver de Lola Arias es parte de una triloga de la autora, que la directora Victoria Hernndez ha venido trabajando con Anglica Blandn y Mauro Mauad en escena. Es una mirada al futuro, un futuro cercano, sin agua, sin luz, con ciudades delimitadas por fronteras y con individuos cada vez ms solos. Qu pasa despus de que un hombre y una mujer se conocen en un bar y deciden pasar la noche juntos? De qu hablan? Cmo se conocen y se enredan en un repentino amor? Cmo un encuentro casual puede convertirse en un desencuentro? Estos dos seres, desequilibrados y dispuestos a todo por un momento de felicidad, son una confrontacin directa con preguntas que tal vez, deberamos hacernos ahora y no esperar a que el futuro nos las responda fatalmente.','eventimg/440673747Sueo con Revolver.jpg','Espacio Oden, Cra. 5 # 12C - 73',2,'Bogot','espacioodeon','@espacioodeon','Fundacin Teatro Oden','Julin, maestro de historia en un 