es actuaciones que logran un espectculo que se mantiene en llamas de principio a fin.',2,429,57,0,'PUB',2,NULL,'','https://www.youtube.com/watch?v=Y1H5uKy0tkY',0,0,'2015-5-26 10:18:58'),(253,16,'Un Cuento Soado','La Fundacin La Maldita Vanidad Teatro, se enorgullece de presentar su primer montaje infantil: Un cuento Soado. Una versin libre de los Cuentos 1*2*3*4 del autor francs Eugene Ionesco y bajo la direccin de Daniel Daza. Esta historia muestra la maravillosa relacin de una nia con su carioso padre, su disparatada madre y con su irreverente abuela; quienes con la representacin de sus sueos le cuentan a Abril como se imaginaban el mundo cuando ella naciera.','eventimg/1372196342Un cuento soado.jpg','Teatro Nacional Fanny Mikey, Cll 71 # 10-25',2,'Bogot','lacasadelteatronacional?fref=nf','CasaTeatroNal','Fundacin Teatro Nacional ','Una pieza que alimenta el imaginario infantil a travs de una esttica inspirada en los comics de los aos cincuenta, que adems ofrece un recorrido musical que va desde el currulao, hasta el contrapunteo llanero y que con situaciones cmicas divierte a grandes y chicos, rescatando la importancia de compartir y construir sueos en familia.\r\n\r\nEn Un Cuento soado, se puede llegar hasta el sol sin salir de casa y la luna sabe a meln.',2,300,57,0,'PUB',2,NULL,'','https://www.youtube.com/watch?v=FslSPVz3298',0,0,'2015-5-26 10:41:08'),(374,16,' La Compaia McDonalds en Colombia','Te esperamos en Corferias qu estar lleno de muchas de nuestras deliciosas comidas y descubrirs lo importante de pertenecer a nuestra organizacin y de ser nuestro cliente. www.mcdonalds.com.co','../eventimg/1357625154mcdonalds.png','Corferias, Carrera 37 No. 24 - 67 ',2,'Bogot','https://www.facebook.com/McDonaldsColombia','McDonaldsCol','Carlos Ustariz','    ',8,274,57,1,'PUB',2,'2015-08-27 16:27:13','','https://www.youtube.com/watch?v=mYlkW1piQY4',0,0,'2015-8-27 16:26:03'),(254,16,'Las Botas del To Manuel','Un humilde campesino, despus de un esfuerzo titnico, logra enviar a sus hijas a la ciudad para que estudien. El propsito, ingenuo, es que se conviertan en unas personas de bien. Una vez que las hijas se han integrado a la ciudad y especialmente al ambiente universitario, sienten vergenza de su origen, y ms concretamente de su padre. Ante sus nuevas amistades fingen ser otra cosa, pertenecer a una condicin social diferente por lo que ocultan la existencia de un padre tan humilde, tan insignificante. Una circunstancia inesperada y trgica para ellas, las obligar a enfrentar la verdad que tanto las abochorna. ','eventimg/570120440Las Botas del To Manuel.jpg','Teatro Nacional La Castellana',2,'Bogot','https://www.youtube.com/watch?v=edgh_lvx7Hg','fteatronacional','Fundacin Teatro Nacional ','Es una obra de tono casi buclico pero salpicada de humor negro y de profusas dosis de ternura. ',2,232,57,0,'PUB',2,NULL,'','https://www.youtube.com/watch?v=edgh_lvx7Hg',0,0,'2015-5-26 11:44:31'),(373,16,'Prueba Galletas Oreo','Te invitamos a probar las deliciosas galletas oreo en diferentes recetas y en su forma original, podrs conocer otras formas en las que sentirs una experiencia de sabores nica!!','../eventimg/133851047PRUEBA GALLETAS OREO.jpg','Hotel Dann Carlton ',2,'Bogot','https://www.facebook.com/HotelDannCarltonBogota?fref=nf','danncarltonbogo','Laura Durn','    ',5,245,57,1,'PUB',2,'2015-08-27 15:32:09','','https://www.youtube.com/watch?v=QL_7P2-JoTk',0,0,'2015-8-27 15:28:00'),(255,16,'Entretelones','En el primer acto, Un grupo de actores est montando la obra SIN NADA ENCIMA, una comedia de enredo de faldas. La obra que es producida por una actriz retirada, a su vez la estrella, es un verdadero desastre y est a unas pocas horas del estreno. El pblico presencia en carne viva el fallido ensayo general antes de salir a las tablas. \r\n\r\nEn el segundo acto, el escenario ha girado sorpresivamente y el pblico est expuesto a la trasescena mientras el grupo de actores presenta SIN NADA ENCIMA, algunos meses ms tarde en una funcin de matin para jubilados. Para ese momento la tensin entre los actores est en el peor punto, pero aun as la funcin debe continuar. \r\n\r\nEl tercer acto sucede muchos meses ms tarde cuando la gira de SIN NADA ENCIMA est llegando a su fin. La obra ya es un caos absoluto. Los problemas entre los artistas ya no tienen reversa, pero aun as la obra continua.... ','eventimg/1292564019Entretelones.jpg','Teatro Nacional La Castellana',2,'Bogot','pages/Teatro-Nacional-La-Castellana/234481779916864','fteatronacional','Fundacin Teatro Nacional ','Elenco:\r\nAlejandro Riao\r\nCarolina Cuervo\r\nNicols Montero\r\nConsuelo Luzardo\r\nChristian Ballesteros\r\nDiana Alfonso\r\nJulio Escalln\r\nPaula Estrada\r\nRicardo Leguizamo-Roca',2,466,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=ZzOcOVbtkdo',0,0,'2015-5-26 14:54:55'),(256,16,'Teatro Negro de Praga - Las Aventuras de Fausto','El Teatro Negro de Praga no necesita presentacin, basta decir que en esta oportunidad vuelve, con su obra maestra LAS AVENTURAS DE FAUSTO, aclamada en todo el mundo. Le garantizamos que una vez terminada la funcin usted nunca sabr: Si fue fantasa o realidad.','eventimg/1559267386Teatro Negro de Praga - Las Aventuras de Fausto.jpg','Teatro Libre de Chapinero ',2,'Bogot','fteatrolibre?fref=nf','teatrolibrebog','Juan Rodrguez Jimnez ','Edad mnima de ingreso 7 aos',2,304,57,0,'PUB',2,NULL,'','https://www.youtube.com/watch?v=GA2WyOJaStM',0,0,'2015-5-26 15:52:47'),(372,16,'Expo Coca Cola 2015','Coca Cola invita a todos sus clientes al lanzamiento de nuevos productos en corferias','../eventimg/937647383Coca Cola.jpg','Corferias - Cra. 37 #24-67',2,'Bogot','https://www.facebook.com/cocacolacolombia','CocaColaCol','Coca cola Colombia','    ',5,392,57,1,'PUB',2,'2015-08-26 21:30:31','','https://www.youtube.com/watch?v=pI6z4EqmAPM',0,0,'2015-8-26 21:28:21'),(257,16,'El Cascanueces - Acrobtico Sobre Hielo','\r\nDesde Rusia para todos los pblicos la versin sobre hielo de el Cascanueces estrenado en San Petersburgo en 