ienes un flash  y te gustara aprender a manejarlo como todo un(a) experto(a)? Esta es la oportunidad para aclarar muchas de tus dudas: Conversatorio con los maestros Carlos Andrs Cruz (SieteFotgrafos) y Wilson Castaeda (Cassa Importadores) quienes nos compartirn sus conocimientos sobre tcnicas de iluminacin STROBIST.','eventimg/1777819744Taller de Iluminacin STROBIST.jpg','Calle 70A # 11-48',2,'Bogot','7FOTOGRAFOS?fref=nf','@7fotografos','SieteFotgrafos - club de fotografa','En SieteFotgrafos (club de fotografa de Bogot), nos une la pasin por el arte de la fotografa, y hacemos de sta el mejor pretexto para hacer buenos amigos. Buscamos ser el punto de encuentro, formacin y reflexin para todos aquellos fotgrafos profesionales o aficionados que desean practicar esta disciplina.\r\n\r\nDe manera permanente, organizamos salidas fotogrficas, tertulias, exposiciones y talleres orientados a generar espacios de aprendizaje y entretenimiento cultural.',6,368,57,1,'PUB',2,'2015-05-30 08:38:33','','https://www.youtube.com/watch?v=7h4FVQvtbYk',0,0,'2015-5-30 08:35:03'),(262,2,' Flisol Bogot 2015','Es el Festival Latinoamericano de Instalacin de Software Libre y actualmente es el evento de difusin de Software Libre ms grande en Latinoamrica. Su principal objetivo es promover el uso del software libre, dando a conocer al pblico en general su filosofa, alcances, avances y desarrollo. Para tal fin, las diversas comunidades locales organizan simultneamente eventos en los que se instala software libre y adems se ofrecen charlas, ponencias y talleres en torno a la filosofa del Software Libre en toda su gama de expresiones: artstica, acadmica, empresarial y social.','eventimg/1608728635Flisol Bogot 2015.png','Instituto Distrital para la Recreacin y Deporte IDRD',2,'Bogot','FlisolBogota?fref=nf','flisol_bogota','Comunidad de Software Libre de Bogot','Preguntas frecuentes\r\n \r\nHay algn requisito de ID o lmite edad para asistir al evento?\r\nNo hay lmite de edad, pero todos deben llevar su documento de identidad y cernet de EPS vigente.\r\n \r\nQu opciones de transporte/aparcamiento tengo para llegar al evento?\r\nEl parqueadero est disponible (administrado por el IDRD, por favor consulte con esta entidad www.idrd.gov.co)\r\n \r\nEs transferible mi registro/entrada?\r\nNo no es trasterible, es una entrada por persona, todos deben registrarse.\r\n \r\nPuedo actualizar mi informacin de registro?\r\nNo, no puedes actualizarla\r\n \r\nDebo llevar mi entrada impresa al evento?\r\nSi, todos los asistentes deben llevar impresa su entrada',6,423,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=yWaBun_ceIA',0,0,'2015-5-30 08:52:29'),(263,2,' Bibliotic 2015','Bibliotic 2015 busca reunir a archivistas, biblioteclogos, documentalistas, gestores de informacin, comunicadores, ingenieros de sistemas, investigadores, docentes entre otros profesionales del sector, para intercambiar experiencias en la implementacin de tecnologas de la informacin y la comunicacin en sus bibliotecas, unidades de informacin, fondos documentales, archivos y colecciones.\r\n\r\nComo ya es costumbre, cada ao Bibliotic viene con una de las ofertas acadmicas ms completas sobre las tecnologas de la informacin y la comunicacin. Con el tema Mediacin Digital, esta sptima versin ofrecer ms de 10 talleres de capacitacin y una agenda acadmica sin igual en nuestro pas.','eventimg/1695988068Bibliotic 2015.jpg','Pontificia Universidad Javeriana',2,'Bogot','pages/Bibliotic/237394783124462','@Bibliotic2015','Bibliotic 2015','Luego de seis exitosas ediciones, Bibliotic 2015 abre sus puertas del 13 al 17 de julio en la Pontificia Universidad Javeriana. Un espacio para aprender y conocer las iniciativas locales e internacionales de implementacin de tecnologas de la informacin y la comunicacin en bibliotecas, museos, archivos y centros de informacin.',6,444,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=3i7Z6tyGnpk',0,0,'2015-5-30 09:35:27'),(371,16,'Startup Weekend Chia - Sabana Centro: Soluciones Innovadoras Para Las Empresas En La Regin.','Teniendo en cuenta el gran desarrollo empresarial en la regin Sabana Centro - Cundinamarca, junto al gran nmero de Universidades situadas en la regin, queremos presentar a ustedes un evento enfocado a buscar soluciones innovadoras a RETOS que las empresas estn requiriendo encontrar.\r\n<br><br>Mediante este evento queremos disminuir la distancia entre los empresarios y emperadores. Generando un ambiente prctico donde los emprendedores de las universidades logren desarrollar soluciones en equipos multidisciplinarios y de diferentes universidades, enfocados a los principales retos que enfrentan las empresas con operacin en la regin. <br><br>Si consideras que tienes las habilidades y competencias para generar soluciones innovadoras a los principales retos de las empresas con operacin en la regin, esta es tu oportunidad de aportar, modelar, desarrollar, trabajar y compartir tu experiencia en la definicin de los nuevos conceptos de empresas con oportunidad. <br><br><b><u>ALGUNOS DE LOS RETOS ESTARN ENFOCADOS A:</u></b> diseo de empaques biodegradables, desarrollo de software, diseo estrategias comerciales, diseo de soluciones ambientales para el uso de residuos de operacin, diseo de estrategias logsticas, modelos de aprovisionamiento local, desarrollo de aplicaciones tecnolgicas para dispositivos mviles,  aprovechamiento de empaque finales de productos, entre otros.\r\n\r\n<br><br><b><u>FAQS<br></u></b><br><b>Existen requisitos de identificacin o un lmite de edad para entrar en el evento?<br></b>Mayores de Edad, en El ltimo Ao de Estudios Universitarios, tcnicos o Tecnlogos. Estudiantes de pregrado, postgrado, especializaciones, etc. egresados Hasta 3 aos.<br><br><b>Qu puedo / no puedo traer al evento?<br></b>Debes Traer tu Propia carpa, Elementos de aseo prrafo dos noches y dos Das. Tu PC y Elementos de Apoyo para modelar soluciones de Negocios.<br><br><b>El registro / boleto&nbsp;es transferible?</b>\r\n&nbsp; <br>NO, LUEGO de Ser Seleccionado, no se podr Transferir una Ninguna otra persona.','../eventimg/1075204663Startup Weekend Chia.png','Universidad de La Sabana ( Sede Cha)',2,'Bogot','https://www.facebook.com/startupweekend?fref=ts','SWCol','Startup Weekend Chia - Sabana Centro','RECUERDA QUE EL PRESENTE REGISTRO ES CON EL FIN DE Validar SI TIENEN EL PERFIL PARA UNO DE LOS CUPOS AL SW - CHIA QUE SE EJECUTARA LOS DAS 18 AL 20 DE SEPTIEMBRE. A PARTIR DEL 11 DE SEPTIEMBRE ENVIAREMOS A SU CORREO LA CONFIRMACION DEL REGISTRO.',8,377,57,1,'PUB',2,'2015-08-24 16:31:35','','https://www.youtube.com/watch?v=bkV8yyUW67Q',0,0,'2015-8-24 16:18:45'),(264,1,'FORO LDERES Y EMPRENDEDORES EN LA U- FLEU','Considerado el evento de liderazgo estudiantil ms importante de Colombia; la cita anual de los jvenes destacados con dirigentes empresariales, polticos y sociales de nivel nacional e internacional. Es un espacio en donde ms de 1.000 jvenes se preparan para incidir de manera positiva en el futuro de Colombia.','eventimg/1871462129foro_lideres.jpg','Cmara de Comercio de Bogot  Av. el Dorado No. 68D-35',2,'Bogota','lideresyemprendedoresenlau','FLideresenlaU','','Desde hace ms de 10 aos es organizado en alianza con la Revista Semana.',8,492,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=DLhMEUNAjtk',0,0,'2015-5-30 10:02:14'),(271,2,'ElastixWorld 2015','What is ElastixWorld?\r\nElastixWorld was born as a project that brings together the most important actors in the world of telephony, voice over IP and unified communications.\r\nThis is the ideal place for end users, partners, resellers, integrators, manufacturers and developers to have the opportunity to share experiences, showcase new products, and open new business opportunities between the Latin American community and the world.\r\nAbout the Venue\r\nThe VoIP and Elastix community has grown exponentially in the last six years, covering all regions of the globe, with a potential of 100,000 integrators. One of the event goals is to allow