n \r\nDEBES SABER: PARA SEPARAR TU CUPO U OBTENER MS INFORMACIN: anamaria@organizmo.org\r\no llamando al 320 493 5732 \r\n \r\nPara reservar su cupo, consignar el valor del taller y y enviar una copia de la consignacion anamaria@organizmo.org ',6,372,57,1,'PUB',2,'2015-05-30 19:35:45','','https://www.youtube.com/watch?v=yfwyiLNQeJc',0,0,'2015-5-30 19:33:45'),(273,2,'First Thursday NXTP Labs','<b><u>First Thursday NXTP Labs Colombia!&nbsp;</u></b>Conecta, inspira y comparte experiencias entre emprendedores, inversionista, mentores, socios y aliados de NXTP Labs!<br><br>Te invitamos a nuestro <b>First Thursday BOGOT</b>,&nbsp;para que conversemos, intercambiemos experiencias y revisemos como entre todos podemos apoyarnos y seguir construyendo la red NXTP Labs!&nbsp;Como todos los meses, la comunidad de NXTP Labs de varias ciudades de LatAm se reune el primer jueves de cada mes en su evento \"First Thursday\" con el fin de mantenernos conectados, generar ms negocios dentro de la red y conocer nuevas personas.&nbsp;<br><br>Como host del&nbsp;First Thursday BOGOT&nbsp;<span>de octubre tendremos a&nbsp;<a href=\"https://www.linkedin.com/pub/carlos-felipe-gutierrez-camacho/55/203/b02\" target=\"\" rel=\"nofollow\">Carlos Gutirrez,</a>&nbsp;Country Manager en Colombia de&nbsp;<a href=\"https://www.formafina.com.co/\" target=\"\" rel=\"nofollow\">FormaFina</a>&nbsp;e inversionista a travs&nbsp;de lNVX, quien nos estar contando sobre cmo fue abrir las operaciones en el pas de una empresa con visin global y alto potencial y sobre su experiencia como inversionista.&nbsp;</span><br><br>Puedes invitar a las personas que quieras, siempre que consideres que pueden agregar valor y se registren a travs de este medio.<br><br><b><u>Recuerda que este es un espacio informal por lo que es vlido llegar un poco tarde o irse temprano.&nbsp;Segn lo acordado, cada persona que asiste cubre su consumo, le hemos pedido al restaurante precios especiales, as que el consumo mnimo es de COP $25.000 &nbsp;por persona, lo importante es que todos podamos asistir y compartir.</u></b><br><br>','eventimg/637574573First Thursday NXTP Labs.png','La Cesta Caf, Calle 81 # 8-70 ',2,'Bogot','https://www.facebook.com/NXTPlabs','NXTPLabs','NXTP Labs','EMPRENDEDORES Y SUS EMPLEADOS, INVERSIONISTAS, MENTORES Y ALIADOS DE LA RED NXTP LABS de todas las ediciones son bienvenidos!!!\r\n\r\nMuchas veces una cerveza con buena gente es ms productivo que unas horas de trabajo extra en la oficina!!!\r\n\r\nTe esperamos, no faltes! \r\nEquipo NXTP LABS',8,436,57,1,'PUB',2,'2015-09-23 12:30:27','','https://www.youtube.com/watch?v=ZO7T6keKQ_E',0,0,'2015-5-30 20:03:44'),(274,2,'I.E, Innovacin en Educacin VOL 1: La verdad del Bullying','IE, Innovacin en Educacin, es un evento que busca la colaboracin, el compartir y conectar a profesores, directivas y gestores de educacion primaria y secundaria de Bogot. A travs contenidos valiosos que quieren dar una nueva visin sobre temticas vitales en la educacion en Colombia, buscamos generar un discusin activa, positiva y construtiva alrededor de la innovacin en diferentes reas de la educacin.\r\n\r\nDesde un espacio abierto a inspiracin, propiciado por un grupo de jvenes convencidos que la mejor forma de construir un futuro est en trabajar de forma colectiva para la implementacin de nuevas iniciativas.','eventimg/317394347Innovacin en Educacin. La verdad del Bullying.png','Biblioteca Pblica Virgilio Barco',2,'Bogot','IE-Innovacion-En-Educacion','ie_bog','Projectora','En el Volumen 1, presentamos La verdad del Bullying o Matoneo, junto a tres conferencistas del sector educativo y de otros sectores que buscan dar herramientas a los educadores en esta problemtica. \r\n\r\nEl evento tambin habr intervenciones complementarias en Nuevos Modelos de Educacin y Marketing para Colegios.',6,415,57,1,'PUB',2,'2015-05-30 21:52:23','','https://www.youtube.com/watch?v=FOxZHi31eu8',0,0,'2015-5-30 21:49:58'),(476,16,'Luz, ciencia y magia - Fotografa publicitaria e iluminacin en estudio','Te esperamos para esta primera clase introductoria de lo que ser el <b><i>Workshop: Luz, ciencia y magia: fotografa publicitaria e iluminacin en estudio organizado por SieteFotgrafos</i></b> y dictado por el maestro <b>Juan Jos Carrillo.\r\n</b><br><br>Si Fotografiar es <i>\"escribir con luz\",</i>  el trabajo en estudio es la base que te permitir medir, entender, controlar y observar de forma disciplinada la luz y sus cualidades. <br><br>Mediante la ejecucin prctica de diversos ejercicios, en este Workshop aprenders los elementos tericos necesarios que te permitirn tomar decisiones fotogrficas conscientes a la hora de iluminar sobre diversas superficies, objetos y texturas.\r\n<br><br>Al finalizar este workshop, estars en capacidad de disear tus propias propuestas de iluminacin y adems tendrs un portafolio profesional que te ayudar a abrir puertas en este campo de la fotografa comercial.\r\nMs informacin sobre el taller completo en: <a href=\"http://sietefotografos.com/fotografia-publicitaria-e-iluminacion-en-estudio/\" target=\"\" rel=\"\">http://sietefotografos.com/fotografia-publicitaria-e-iluminacion-en-estudio/</a>','../eventimg/746102031Luz, ciencia y magia - Fotografa publicitaria e iluminacin en estudio.jpg','Casatinta, Tranv 17 # 45D - 61 ',2,'Bogot','https://www.facebook.com/7FOTOGRAFOS','7fotografos','SieteFotgrafos | escuela - club','    ',6,1117,57,1,'PUB',2,'2015-10-13 14:28:45','','https://www.youtube.com/watch?v=bDFRdTHPIqc',0,0,'2015-10-13 14:25:58'),(370,16,'Taller de comunicacin estratgica para empresas sociales - Comunicar el Hbrido','<b><span class=\"wysiwyg-color-blue\"><u>QU ES \"COMUNICAR EL HBRIDO\"\r\n</u></span></b><br><br>El taller busca transmitir el poder de la comunicacin en las empresas sociales. Pretende trabajar sobre las particularidades de la comunicacin en este tipo de empresas, los beneficios de su planificacin, y propone una metodologa para llevarla adelante de una manera estratgica.\r\n<br><br>La idea central es que los emprendimientos sociales desarrollen, o al menos comiencen a desarrollar, la planificacin de la comunicacin en su empresa social. <br><br><b><u>CMO FUNCIONA</u></b> <br><br>Taller de 6 horas, en dnde se  realizan dos partes: <br><b>a)</b> La primer parte terica<br><b>b) </b>Un bloque prctico, dnde se desarrollan los ejercicios de la caja de herramientas.<br><br><b>PARTE A&nbsp;<br></b><b>1)&nbsp;</b>Introduccin sobre la investigacin realizada en Latinoamrica y sus resultados. <br><b>2)</b> El poder de la comunicacin en las empresas sociales. Porqu comunicar? Qu comunicar? Para qu comunicar?. <br><b>3)</b> Cmo pensar la comunicacin en empresas sociales. Particularidades del hbrido y aspectos a tener en cuenta.\r\n<br><b>4)</b> Creacin de narrativa de marca. <br><b>5)</b> Anlisis de casos exitosos. Comunicacin hbrida interesante. <br><b>6)</b> Desarrollo de la metodologa y su caja de herramientas.\r\n<br><br><b>PARTE B</b>\r\n<br><b>7)</b> Realizacin de los ejercicios de la caja de herramientas: <br><blockquote><b>a)</b> Diagnstico<br><b>b)</b> Matriz de identidad<br><b>c)</b> Definicin y caracterizacin de pblicos objetivo<br><b>d)</b> Planificacin estratgica*\r\n\r\n(La cantidad de ejercicios que se realicen tendrn que ver con el tiempo que disponga el taller) </blockquote>','../eventimg/2004943582Taller de comunicacin estratgica para empresas sociales - Comunicar el Hbrido.png','Impact Hub Bogota, Calle 69 # 6 - 20 ',2,'Bogot','https://www.facebook.com/ImpactHubBogota?fref=ts','ImpactHubBogota','Impact Hub Bogot','DEBES SABER: El asistente puede pagar en efectivo y tarjeta dbito o crdito en el Impact Hub o haciendo consignacin bancaria en Bancolombia, cuenta de ahorros N 01389351250. Envia comprobante de pago al correo: bogota.administrativo@impacthub.net o rodrigo@animoanimo.com \r\n\r\nQUIN NOS ACOMPAA? Julieta Bossi y Rodrigo Romero',6,255,57,1,'PUB',2,'2015-08-24 13:35:44','','https://www.youtube.com/watch?v=0pEYIkzKZac',0,0,'2015-8-24 12:58:18'