,'2015-06-03 08:54:03','','https://www.youtube.com/watch?v=sI6uOqgak38',0,0,'2015-6-3 08:44:58'),(277,2,'Mummenschanz','En el universo sin palabras de Mummenschanz, lo ordinario se convierte extraordinario cuando materiales comunes, objetos cotidianos y formas abstractas llenas de color y forma como los famosos Mscaras de barro, Hombre Furtivo y Manos Gigantes adquieren vida. Mediante la creacin de una experiencia ldica y atractiva a travs del uso inventivo de la sombra, la luz, y la manipulacin creativa de objetos, Mummenschanz ofrece una visin atemporal de la condicin humana. El resultado trasciende las barreras culturales y estimula la imaginacin. Todo el programa de tteres y travesuras visuales se realiza sin msica ni sonido. ','eventimg/2039254170Mummenschanz.jpg','Teatro Coln',2,'Bogot','','mummenschanz','Asociacin Nacional de Msica Sinfnica ','El espectculo contar con clsicos favoritos del pblico, as como nuevas creaciones brillantes vistas por primera vez.',2,289,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=LUDt71uqBUU',0,0,'2015-6-30 23:00:26'),(278,2,'Accione Verde rbol por rbol Salvando El Planeta','Ya conoces a Accin Verde?\r\n\r\nSomos una organizacin que busca generar impactos positivos en el medio ambiente terrestre y marino, mediante acciones concretas como son la reforestacin protectora con especies nativas, creando zonas de amortiguacin para Reservas de la Bisfera en Colombia. \r\n\r\nHemos logrado sembrar ms de 150.000 rboles, gracias a las compras ciudadanas y empresariales de Acciones Verdes, dndole as ms vida a nuestro planeta para sta y futuras generaciones.\r\n\r\nTe invitamos a que formes parte de nuestra iniciativa adquiriendo y/o regalando Acciones Verdes: porque es innovador, porque cada rbol sembrado tiene una funcin especial, porque ayudas al planeta y a ti mismo.','eventimg/941360505planeta verde.png','Colombia',2,'Bogot','AccionVerdeColombia?fref=nf','AccionVerdeCol','Accin Verde','Cmo sabes dnde est tu rbol?\r\n\r\nPuedes saber dnde est plantado, la especie, el nmero de tu Accin Verde, georeferenciado y fotografiado individualmente, toda esta informacin reportada en nuestra pgina web www.accionverde.org.co, para garantizar que los cuidaremos a tu nombre y que puedes hacerle seguimiento.\r\n\r\nHacemos jornadas de siembra con empresas, y hacemos siembras especializadas para neutralizar emisiones de gases efecto invernadero, para que empresas, productos o eventos sean Carbono Neutro. Contctanos.',6,1139,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=44JbpKilbys',0,0,'2015-6-30 23:16:37'),(279,2,'Annie, La Huerfanita','Annie es una tierna y valiente huerfanita cuyo nico sueo es encontrar a sus padres. Rodeada de amiguitos inigualables, un millonario granduln de gran corazn y una amorosa asistente, emprender una gran aventura en donde la msica, el baile y la diversin sern el camino para encontrar su mayor anhelo y felicidad. Pero cuidado! La malvada y borrachina duea del orfanato junto a su hermano ladrn y su novia tonta, har hasta lo imposible para truncar los sueos de Annie, lo lograr? ','eventimg/1329426075Annie la huerfanita.png','Teatro Coln ',2,'Bogot','miteatrocolon?fref=nf','miteatrocolon','Asociacin Nacional de Msica Sinfnica ','Entrate en esta mgica obra musical en donde llorars de emocin, reirs a carcajadas, cantars y bailars al ritmo de Annie y sus amigos!',2,363,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=hGUlu6xVTHc',0,0,'2015-7-1 10:43:01'),(280,16,'OpenIDEO Meetup Bogot: Tecnologa Para Vidas Ms Saludables','Desarrollar y Prototipar Ideas\r\nEl Reto: \r\nCmo podemos utilizar la tecnologa para inspirar a todos los grupos socioeconmicos y multiculturales para llevar vidas ms saludables?\r\nEl prximo mircoles, 1o de julio, vamos a reunirnos para usar la metodologa de Human Centered Design de IDEO y iteracin rpida para prototipar tus ideas y acercarlas al usuario. En el primer Meetup trabajamos en la busqueda de nuevas ideas, y ahora vamos a tomar estas ideas (y otras nuevas) y profundizarlas a travs de prototipos. \r\n Si tienes una idea que quieres trabajar por favor llena este formulario: http://goo.gl/forms/aNeKCrc6ze\r\n Si no tienes una idea, no hay problema! Ven y puedes unirte a un equipo.','eventimg/1082664787OpenIDEO.jpg','Impact Hub, Cl. 69 #6-20, Bogot',2,'Bogot','groups/1660932244121682','OpenIDEO','Alex Alden','El Proceso del Reto: OpenIDEO aborda cada problema social a travs de un reto, este es un proceso colaborativo de tres a cinco meses que enfoca nuestra atencin en un tema y crea un espacio para los miembros de la comunidad para contribuir y colaborar. Esta metodologa es basada en Human Centered Design de IDEO.\r\nAprende ms en https://openideo.com/challenge/healthy-lives/ideas\r\n OpenIDEO Bogot Meetup rene a individuos en un tipo de taller experiencial que se llama meetups. En el Meetup la gente se conecta para profundizar las lluvias de ideas, sesiones de prototipado, y oportunidades de colaboracin.  \r\nPor favor antes de venir, cree un perfil de OpenIDEO: https://openideo.com/signup',6,375,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=wQn1AfpQzoU',0,0,'2015-7-1 15:29:11'),(281,16,'Debates en Paz - Muerte digna y prolongacin de la vida','La Secretara de Cultura, Recreacin y Deporte y la Red Capital de Bibliotecas Pblicas (Biblored), con el apoyo de la revista Arcadia, realizarn cada mes la serie Debates en Paz, es posible disentir, un nuevo espacio dedicado a los visitantes de la Biblioteca Pblica Virgilio Barco en el que se abordarn temas de fundamental relevancia para la vida cultural de Bogot.','eventimg/324811559Debates en Paz.jpg','Biblioteca Pblica Virgilio Barco',2,'Bogot','CulturaenBogota?fref=nf','CulturaenBta','Secretara Distrital de Cultura Recreacin y Deporte','Continuamos con esta serie de Debates en Paz el prximo domingo 5 de julio a las 10:00 a.m. con un tema controversial: Muerte digna y prolongacin de la vida.',6,277,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=3n7ah-qUNLM',0,0,'2015-7-1 15:33:46'),(282,16,'Planeacin Estratgica y los Sistemas de Calidad ISO 9001: 2015','A travs de esta CONFERENCIA GRATUITA, aprender cmo disear los Sistemas de Gestin de Calidad, Ambiente, Seguridad y Salud en el Trabajo de tal forma que le ayude a lograr la Visin de Negocio y los Objetivos Estratgicos de su organizacin.\r\nEsta conferencia est dirigida a profesionales, tcnicos, tecnlogos, gerentes y jefes en ingenieras, administracin, operaciones, servicio, gestin humana, finanzas y otras reas de la organizacin.','eventimg/798460865Sistemas de Calidad ISO 9001 2015.jpg','Hotel Bogota Astral, Calle 44 N 7-93 ',2,'Bogot','redgestionintegral?fref=nf','RedGestionInt','RGI - Red Gestin Integral','Telfonos de Contacto: 571 4837186, 571 4813942, 3156161346.',6,352,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=zo5li-dKfFc',0,0,'2015-7-1 15:46:19'),(283,16,'Fotografa para Viajeros [conversatorio]','Un taller diseado especialmente para aquellos quienes desean mezclar dos grandes pasiones: Hacer fotografa y recorrer el mundo. Si eres de esas personas que aman viajar y deseas mejorar la calidad de tus imgenes, este workshop es perfecto para ti. Desarrolla la habilidad de realizar fotos interesantes y atractivas, aprendiendo tcnicas desde la planificacin previa hasta la postproduccin y exhibicin de tu trabajo mediante ejercicios completamente prcticos. Prepara tus maletas y embrcate en esta experiencia!','eventimg/1872337694fotografa-para-viajeros-sietefotografos-web1.jpg','Casatinta, Transversal 17 # 45D - 61 ',2,'Bogot','7FOTOGRAFOS?fref=nf','7fotografos','SieteFotgrafos - club de fotografa','Para tomar este taller debers contar una cmara fotogrfica digital (DSLR - rflex de cualquier marca  iPhone 5 o superior), computador porttil con Lightroom y/o Photoshop. Presupuesto para imprimir y enmarcar una (1) copia de tu trabajo.\r\n\r\nINVERSIN: $875.000 (TALLER Y VIAJE INCLUIDOS)',6,277,57,1,'PUB',2,'2015-07-01 16:11:00','','https://www.youtube.com/watch?v=eGTWfw08WOk',0,0,'2015-7-1 16:05:50'),(284,16,'Encuentro de Semilleros de Investigacin UxTIC','Desde enREDo y la Red de Universidades UxTIC se invita a la comunidad acadmica a participar en el encuentro de Semilleros de Investigacin que se llevar a cabo en el marco del VII encuentro de bibliotecas en tecnologas de la informacin y la comunicacin Bibliotic 2015 del 13 al 17 de julio en la Pontificia Universidad Javeriana.\r\nMetodologa del encuentro\r\nEste encuentro de Semilleros TIC busca ser un punto de encuentro para los jvenes investigadores ofrecindoles la oportunidad de exponer sus trabajos en pblico y compartir e intercambiar opiniones con otros semilleros, utilizando el formato 2020 de los encuentros Pecha Kucha (trmino japons que imita el sonido de una conversacin), y el cual consiste en presentar el trabajo en 20 diapositivas donde cada una puede incluir imgenes estticas, animaciones o incluso vdeos, para ser proyectada durante 20 segundos, para un total de 6 minutos 40 segundos por participante.','eventimg/1830620564uxtic.png','Pontificia Universidad Javeriana, sede Bogot ',2,'Bogot','/groups/553042211427368/?fref=ts','UxTIC_','UxTIC','Este formato de exposicin dinmico obliga a los participantes a ser muy concretos y pertinentes permitiendo as mantener un nivel de inters y atencin alto del pblico. La idea es ofrecer a los semilleros de investigacin una tribuna para presentar sus trabajos en un formato corto, sencillo e informal que permite hacer co-working con el pblico y otros jvenes investigadores al mismo tiempo que promueve la investigacin y la innovacin en Colombia, con un espirito de colaboracin.',6,231,57,1,'PUB',2,NULL,'','',0,0,'2015-7-1 16:19:59'),(285,16,'I Simposio de Actualizacin Mdica: Arritmias Cardiacas','La Asociacin Colombiana Mdica estudiantil, dando cumplimiento a sus objetivos, especialmente en la lnea de educacin mdica realizar el I Simposio de Actualizacin Mdica: Arritmias Cardacas. Queremos invitar a toda la comunidad estudiantil del sector salud a que participe en ste evento realizado por estudiantes y para estudiantes. Tenemos el Honor de contar con la presencia de especialistas en el tema dispuestos a brindarnos todo su conocimiento. Estn pendientes, estaremos publicando ms informacin en estos das. ACOME tiene muchas sorpresas para los estudiantes de medicina de Colombia. ','eventimg/412238150ACOME.jpg','Universidad El Bosque, Auditorio Principal',2,'Bogot','acomeoficial','ACOMEOficial','Asociacin Colombiana Mdica Estudiantil -ACOME-','Dnde puedo ponerme en contacto con el organizador en caso de tener alguna pregunta?\r\nPueden enviar sus preguntas al siguiente correo:\r\narritmias.acome@gmail.com o bogota@acome.com.co\r\n Donde puedo pagar mi entrada?\r\nSolo se podr pagar el ingreso del evento, a los miembros autorizados por ACOME el da del evento en la entrada de la Universidad El Bosque.',6,359,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=Fgr7MVZCh1s',0,0,'2015-7-1 16:32:37'),(286,2,'VII Congreso Nacional de Lderes en Salu','La sptima versin del congreso nacional de lderes en salud, se celebrar los das 10 y 11 de Julio en la Sede principal de la Fundacin del rea ndina, en la ciudad de Bogot. El cual contendr pneles de tipo acadmico y de debate, con espacios de intervencin con el pblico asistente. Tambin se compartir un espacio de participacin democrtica para que los miembros de ACOME elijan su nueva Junta Nacional 2015-2016, la cual representar a los estudiantes de medicina de Colombia ante entidades de mbito nacional e internacional.\r\nLa temtica a desarrollar consta de:\r\n-Nuevos retos en formacin mdica y perfil del profesional de salud en el nuevo milenio\r\n-El profesional de salud y su compromiso social \r\n-Emprendimiento en salud\r\n-Taller de ideacin\r\n-tica profesional\r\n-Nueva generacin de lderes en salud\r\n-Liderazgo en salud\r\n-Construccin, compromiso y desarrollo de polticas en salud\r\n-Educacin de posgrado\r\n-Bullying en la jerarqua acadmica en profesionales de la salud\r\n-Enfermedad mental en el post conflicto. Un abordaje multidisciplinario\r\n-Equipo multidisciplinario de atencin primaria en salud como reto del nuevo milenio\r\n-La eutanasia como acto mdico para defender el derecho a morir dignamente.','eventimg/1701616252VII Congreso Nacional de Lderes en Salud.jpg','Fundacin del rea Andina, Carrera 14A N 70A-34 ',2,'Bogot','acomeoficial?fref=nf','ACOMEOficial','Asociacin Colombiana Mdica Estudiantil -ACOME-','Al final del evento, el da sbado se har lectura del resultado de votaciones, protocolo de posesin y entrega de cargos de junta directiva nacional y vocalas nacionales ACOME\r\nINSCRIPCIONES:\r\nLas consignaciones se realizan al nmero de cuenta de ACOME 001082870601 Cuenta Corriente en Davivienda (cada consignacin tiene un costo de $10.000).\r\nLuego de realizar su consignacin, enve foto, scanner o copia del recibo de pago a congresodelideres.acome@gmail.com con los datos de las personas que cancelaron su entrada, y recibir un correo de confirmacin.\r\nTodos los asistentes deberan llevar documento de identificacin, de lo contraro no se permitira el ingreso.\r\nLos Estudiantes de ciencias de la Salud. Deberan llevar carnet de la universidad a la que pertenecen.\r\nPara mayor informacin: \r\ncongresodelideres.acome@gmail.com - www.acome.com.co - 3168769598',6,433,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=Fgr7MVZCh1s',0,0,'2015-7-6 16:30:44'),(369,16,'Tercer encuentro Red Ole','<b><u>Qu son los talleres OLE?</u></b>\r\n<br><br>La Secretara de Educacin a travs de la Direccin de Educacin Preescolar y el Equipo de Oralidad, Lectura y Escritura han celebrado un contrato con la Universidad Nacional de Colombia, el cual presenta la propuesta titulada <i>Talleres OLE: ecosistemas comunicativos a lo largo de la vida escolar.</i> Este Proyecto se inscribe en la perspectiva de la relevancia del lenguaje como eje principal en el desarrollo de competencias para la vida, en tanto se convierte en el instrumento esencial para adquirir, construir, reconstruir y crear conocimiento, adems de explorar y definir respuestas y sentimientos para la formacin integral de la persona. Se promueve el uso de la oralidad, la lectura y la escritura para comprender y participar en el mundo.\r\n<br><br><b><u>Cul es el propsito de los talleres OLE?</u></b>\r\n<br><br>Los talleres OLE tienen un doble propsito. Por un lado, construir estrategias con los docentes para integrar la oralidad, la lectura y la escritura como elementos transversales al currculo, desde la perspectiva de la reorganizacin curricular y del desarrollo de los ciclos. Y por el otro, fortalecer la conformacin de redes de conocimiento que sean sostenibles. Las redes conformadas por comunidades de aprendizaje se rigen por la conviccin de que cuando los maestros comparten entre ellos sus mejores ideas y estrategias, los estudiantes son los principales beneficiarios de estas acciones (Lieberman y Wood, 2002).\r\n<br><br><b><u>Beneficios para docentes y estudiantes de los talleres OLE!<br></u></b> Adquirir elementos bsicos sobre cmo funciona el lenguaje para aprender y cmo aprovechar cada uno de los componentes (hablar, escuchar, leer y escribir) para fortalecer su prctica pedaggica. <br> Compartir estrategias y acciones diseadas para que la lectura, la escritura y la oralidad sean herramientas para el aprendizaje en cualquier dominio del saber y a cualquier edad. <br> Reconocer y reflexionar sobre las experiencias con otros colegas, mediante la conformacin de la red OLE.\r\n<br> Vivenciar cotidianamente prcticas donde la oralidad, la lectura y la escritura, sean consideradas componentes fundamentales en la construccin de saberes individuales y colectivos.\r\n<br> Reconocerse como sujetos con voz propia, participes de una realidad en la cual puede intervenir en beneficio de los intereses acadmicos y sociales.\r\n<br> Comprender las distintas formas de interaccin comunicativa que median en la construccin de conocimiento en cualquier dominio del saber.\r\n<br><br><b><u>Impacto de los talleres OLE!</u></b>\r\n<br><br> Por cada docente que participe en este proceso formativo, se cualificaran de 25 a 35 estudiantes, lo que garantizara una gran cobertura.\r\n<br> Se consolidar la red OLE en la cual los maestros y las maestras podrn participar con sus experiencias educativas, y construir conjuntamente procesos de incorporacin de la oralidad, la lectura y la escritura en sus prcticas.\r\n<br> Se construir transversalizalidad de prcticas de oralidad, lectura y escritura a lo largo del currculo en todos los ciclos.<br><br><b>NOTA:</b>&nbsp;Se entregar certificacin de asistencia y memorias va e-mail&nbsp;<br>','../eventimg/426709513Talleres OLE.jpg','Universidad Nacional',2,'Bogot','https://www.facebook.com/Educacionbogota','Educacionbogota','Universidad Nacional de Colombia y Secretara de Educacin','\"Cognicin y lenguaje en la infancia\" es un grupo de carcter interdisciplinario cuyo propsito es desarrollar investigacin, y proyectos de extensin y formacin respaldados en investigacin, en torno al desarrollo de la cognicin y del lenguaje, y en torno al aprendizaje ligado a estos campos.',6,877,57,1,'PUB',2,'2015-10-13 13:45:24','','',0,0,'2015-8-22 23:13:16'),(287,2,'Tour de Innovacin en el Centro de Innovacin Social de la ANSPE','El prximo jueves 16 de julio el anfitrin del Tour ser el Centro de Innovacin Social (CIS) de la ANSPE (Agencia Nacional para la Superacin de la Pobreza Extrema).\r\n\r\nEn esta parada del Tour conocers la iniciativa de Hilando, un proyecto que identifica y articula actores e iniciativas de innovacin social que mejoren la calidad de vida de las familias en situacin de pobreza extrema.\r\n\r\nParticipa en este espacio para conectarte con otros innovadores del sector pblico, privado y acadmico.','eventimg/472897185Tour de Innovacin en el Centro de Innovacin Social de la ANSPE.png','Centro de Innovacin Social de la ANSPE, Crr 13 No. 60-67',2,'Bogot','gobiernoenlinea?fref=nf',