jpg','Plaza de los Artesanos, Cra. 60 # 63-52',2,'Bogot','AltaConsejeriaTicBogota','ConsejeriaTIC','Alta Consejeria Distrital de TIC- Alcaldia de Bogot','Preguntas frecuentes\r\n Hay algn requisito de ID o lmite edad para asistir al evento?\r\nNo. Los menores de edad debern ser inscritos por un padre de familia o por un docente.\r\n \r\nQu opciones de transporte/aparcamiento tengo para llegar al evento?\r\nFavor consultar rutas de SITP por Plaza de Artesanos, Museo de los Nios, IDRD, Biblioteca Virgilio Barco.\r\n \r\nDnde puedo ponerme en contacto con el organizador en caso de tener alguna pregunta?\r\ngcabuya@alcaldiabogota.gov.co\r\n Hay fecha de cierre de convocatoria?\r\nS, cierra el 6 de julio del 2015 a las 23:00\r\n Hay posibilidades de inscribir un taller o exhibicin/exposicin despus de cierre de convocatoria?\r\nNo. Si embargo puede enviar un correo de solicitud de inscripcin extempornea al Bogot Robtica. Pero no se garantiza cupo, esto depende de si alagn expositor preinscrito cancela.\r\n Habr inscripcin para participar en los talleres de robtica?\r\nS, El 10 de julio se publicarn los talleres de robtica que sern ofrecidos por las comunidades y universidades en Bogot Robtica del 13 al 15 de agosto en Plaza de los Artesanos. Favor visitar el portal tic.bogota.gov.co.\r\nHabr inscripcin para visitantes a las Exhibiciones/Exposiciones de Bogot Robtica?\r\nS, se publicar un formulario de inscripcin de visitantes a Bogot Robtica (grupos de Colegios/Instituciones, grupos familiares).  \r\nHabr una publicacin de la lista de las Exhibiciones o Exposiciones de Bogot Robtica 2015?\r\nS. El 13 de julio se publicarn los nombres de los expositores en Bogot Robtica. Favor visitar el portal tic.bogota.gov.co.',4,572,57,1,'PUB',2,'2015-07-06 19:44:26','','https://www.youtube.com/watch?v=19HMIp1_XxE',0,0,'2015-7-6 19:43:21'),(290,2,'Seedstars Bogota','Seedstars Mundial regresa a Bogot! Invita a los 12 mejores startups para lanzar frente a jurado local e internacional. Us