tube.com/watch?v=cMvTDqha6Io',0,0,'2015-7-7 18:16:44'),(296,2,'Startup Weekend Bogota Womens','Startup Weekend son eventos de 54 horas diseados para proporcionar educacin vivencial de alta calidad para emprendedores tcnicos y no tcnicos. Comienza el viernes por la tarde con la presentacin de ideas de negocio y formacin de equipos, continuando con lluvia de ideas, desarrollo de un modelo de negocio, creacin de un prototipo bsico y la generacin de informacin que valide la existencia de una oportunidad de negocio, as como el tamao de la oportunidad. Startup Weekends culmina el domingo por la noche con presentaciones y demostraciones finales de los equipos. Los Participantes aprenden a crear startups durante el evento, teniendo la oportunidad de colaborar con individuos con mentalidades similares en un ambiente simulado, libre de riesgo. Los equipos accedern a charlas y retroalimentacin de expertos en diferentes disciplinas y recibirn retroalimentacin valiosa alrededor de sus proyectos, por emprendedores y expertos de su comunidad local. El fin de semana est centrado en la accin, innovacin y educacin. Puede ser que ests buscando retroalimentacin sobre tu idea, desarrollar habilidades especficas, conocer un co-fundador, formar un equipo que te ayude a ejecutar tu proyecto o simplemente aprender, Startup Weekend es el entorno ideal para probar y realizar los primeros pasos rumbo al lanzamiento de tu propia startup. ','eventimg/1848718963StartupWeekendBogotaWomens.jpg','Impact Hub Bogota, Calle 69 # 6-20 ',2,'Bogot','startupweekend?fref=nf','StartupWeekend','UP Global','Poltica de Reembolso:  No se realizar reembolso alguno dentro de los ltimos 7 das antes del evento. Lamentamos los inconvenientes que esto pueda generar. Si requieres un reembolso, por favor solictalo enviando un correo a mxtickets@startupweekend.org con la siguiente informacin:\r\nNombre completo, Datos de contacto (correo y nmero de telfono con lada), Detalles del evento, Direccin de correo electrnico con que te registraste.',6,416,57,1,'PUB',2,'2015-07-07 19:00:44','','https://www.youtube.com/watch?v=6ceKbm-N8jQ',0,0,'2015-7-7 18:48:54'),(368,16,'Cuarto encuentro Red Ole','<b><u>Qu son los Talleres OLE?</u></b>\r\n<br><br>La Secretara de Educacin a travs de la Direccin de Educacin Preescolar y el Equipo de Oralidad, Lectura y Escritura han celebrado un contrato con la Universidad Nacional de Colombia, el cual presenta la propuesta titulada <i>Talleres OLE: ecosistemas comunicativos a lo largo de la vida escolar.</i> Este Proyecto se inscribe en la perspectiva de la relevancia del lenguaje como eje principal en el desarrollo de competencias para la vida, en tanto se convierte en el instrumento esencial para adquirir, construir, reconstruir y crear conocimiento, adems de explorar y definir respuestas y sentimientos para la formacin integral de la persona. Se promueve el uso de la oralidad, la lectura y la escritura para comprender y participar en el mundo.\r\n<br><br><b><u>Cul es el propsito de los Talleres OLE?</u></b>\r\n<br><br>Los talleres OLE tienen un doble propsito. Por un lado, construir estrategias con los docentes para integrar la oralidad, la lectura y la escritura como elementos transversales al currculo, desde la perspectiva de la reorganizacin curricular y del desarrollo de los ciclos. Y por el otro, fortalecer la conformacin de redes de conocimiento que sean sostenibles. Las redes conformadas por comunidades de aprendizaje se rigen por la conviccin de que cuando los maestros comparten entre ellos sus mejores ideas y estrategias, los estudiantes son los principales beneficiarios de estas acciones (Lieberman y Wood, 2002).\r\n<br><br><b><u>Beneficios para docentes y estudiantes de los Talleres OLE!</u></b>\r\n<br><br> Adquirir elementos bsicos sobre cmo funciona el lenguaje para aprender y cmo aprovechar cada uno de los componentes (hablar, escuchar, leer y escribir) para fortalecer su prctica pedaggica. <br> Compartir estrategias y acciones diseadas para que la lectura, la escritura y la oralidad sean herramientas para el aprendizaje en cualquier dominio del saber y a cualquier edad. <br> Reconocer y reflexionar sobre las experiencias con otros colegas, mediante la conformacin de la red OLE.\r\n<br> Vivenciar cotidianamente prcticas donde la oralidad, la lectura y la escritura, sean consideradas componentes fundamentales en la construccin de saberes individuales y colectivos.\r\n<br> Reconocerse como sujetos con voz propia, participes de una realidad en la cual puede intervenir en beneficio de los intereses acadmicos y sociales.\r\n<br> Comprender las distintas formas de interaccin comunicativa que median en la construccin de conocimiento en cualquier dominio del saber.\r\n<br><br><b><u>Impacto de los Talleres OLE!</u></b>\r\n<br><br> Por cada docente que participe en este proceso formativo, se cualificaran de 25 a 35 estudiantes, lo que garantizara una gran cobertura.\r\n<br> Se consolidar la red OLE en la cual los maestros y las maestras podrn participar con sus experiencias educativas, y construir conjuntamente procesos de incorporacin de la oralidad, la lectura y la escritura en sus prcticas.\r\n<br> Se construir transversalizalidad de prcticas de oralidad, lectura y escritura a lo largo del currculo en todos los ciclos.','../eventimg/1820859810Talleres OLE.jpg','Universidad Nacional',2,'Bogot','https://www.facebook.com/Educacionbogota','Educacionbogota','Universidad Nacional de Colombia y Secretara de Educacin','NOTA: Se entregar certificacin de asistencia y memorias va e-mail ',6,687,57,1,'PUB',2,'2015-10-13 14:05:47','','',0,0,'2015-8-22 22:37:17'),(297,2,'Los secretos de la gestin del conocimiento de alto rendimiento','Este seminario revela los secretos detrs de Alto Rendimiento KM - principios clave que le ayudarn a crear valor para su organizacin. Al final del curso los participantes se han introducido a: El contexto de negocios 2020, 7 Principios de Alto Rendimiento KM (qu son, por qu son importantes y cmo trabajar con ellos), El ','eventimg/828314785The secrets of high performance Knowledge Management.png','Indianapolis',2,'Bogot','','KMskunkworks','K3-Cubed Ltd. David Griffiths','Modelos basados en la evidencia de galardonada investigacin y la prctica llevada a cabo por David, complementado por otros modelos basados en la evidencia de la prctica. El seminario implicar altos niveles de participacin de los alumnos. Todo el contenido se encuentra en un contexto del mundo real y se aplica contra los problemas del mundo real. El curso tambin utilizar ejemplos de casos de diversas industrias para contextualizar las herramientas / marcos en discusin.',6,303,57,1,'PUB',2,NULL,'','',0,0,'2015-7-7 19:37:36'),(298,16,'Curso de Adquisicin, Manejo de Data de Campo e Interpretacin de Niveles de Fludos y Cartas Din','Objetivo del curso: Presentar a los analistas de produccin y optimizacin con sistemas de bombeo mecnico, utilizando las tcnicas ms novedosas de la industria en adquisicin e interpretacin de cartas dinagrficas. Adems de implementar el sistema Analizador de pozos y los equipos Echometer que incluyen: Dispositivos acsticos, Sensores de presin, Celda dinamomtrica tipo herradura ','eventimg/359089204Curso de Fludos y Cartas Dinagrficas.png','UPC Global: Colombia, Crr 13A # 89 - 53, Oficina 303',2,'Bogot','UPCGlobal?fref=nf','UPCGlobal','UPC Global','Cada participante deber llevar un computador personal para el uso del software TWM (Total Well Management) y TAM (Total Asset Monitor) de manera de incrementar las capacidades de los participantes para: Analizar los problemas operacionales en pozos con sistemas de levantamiento por bombeo mecnico, Identificar los pozos candidatos a incremento de la produccin, Recomendar las acciones correctivas que incrementen la eficiencia del sistema de levantamiento y disminuyan los costos operativos. \r\nActualizar los conocimientos y aplicaciones del sistema de adquisicin de data y las oportunidades de incluirlo como herramienta de dia