in e interpretacin de cartas dinagrficas. Adems de implementar el sistema Analizador de pozos y los equipos Echometer que incluyen:<ul><li>Dispositivos acsticos</li><li>Sensores de presin</li><li>Celda dinamomtrica tipo herradura \"HT\"</li><li>Transductor de barra pulida \"PRT\"</li><li>Nueva Tecnologa Inalmbrica</li></ul>Cada participante deber llevar un computador personal para el uso del software TWM (Total Well Management) y TAM (Total Asset Monitor) de manera de incrementar las capacidades de los participantes para:&nbsp;<ol><li>Analizar los problemas operacionales en pozos con sistemas de levantamiento por bombeo mecnico,&nbsp;</li><li>Identificar los pozos candidatos a incremento de la produccin,</li><li>Recomendar las acciones correctivas que incrementen la eficiencia del sistema de levantamiento y disminuyan los costos operativos.&nbsp;</li><li>Actualizar los conocimientos y aplicaciones del sistema de adquisicin de data y las oportunidades de incluirlo como herramienta de diagnstico en sus actividades de monitoreo de pozos e identificacin de fallas.</li></ol><div>*&nbsp;Nota: Cada participante deber traer su laptop.&nbsp;</div>','eventimg/226141480Curso de Fludos y Cartas Dinagrficas.png','UPC Global: Colombia, Crr 13A # 89 - 53, Oficina 303',2,'Bogot','https://www.facebook.com/UPCGlobal','UPCGlobal','UPC Global','Empresa lder en consultora que da soluciones estratgicas en rea de levantamiento artificial. Estamos dedicados en el suministro de software, hardware y capacitacin para analizar y optimizar el rendimiento de pozos de petrleo y gas. La lnea de productos UPC tambin se extiende a barras pulidas, abrazaderas, preventivos de reventones (BOP), y prensaestopas.',6,403,57,1,'PUB',2,'2015-09-21 16:58:35','','https://www.youtube.com/watch?v=BXMnAtefpV0',0,0,'2015-7-8 21:52:20'),(367,16,'Panel Prospectiva Fase III PMTIC','El PMTIC Bogot llevar a cabo el da lunes 24 de agosto un Panel de Prospectiva donde se realizar un anlisis de los desafos e impactos propuestos en los Talleres de la Fase II y la posible estrategia para para su cumplimiento a futuro; en bsqueda de fomentar el desarrollo en la ciudad con el uso de las TIC y convertir a Bogot en una verdadera ciudad inteligente. <br><br>El Panel se desarrollar en dos jornadas, enfocadas cada una tres ejes temticos, en la maana del lunes 24 de agosto iniciando a las 8:00 a.m. y terminando a las 12:00 m. se hablar de los ejes temticos TIC, Ambiente y Servicios, y en la tarde con un horario de 2:00 p.m. a 6:00 p.m. los ejes temticos de Seguridad, Interaccin Gobierno  Ciudadana y Desarrollo Econmico. <br><br>Esperamos nos acompaes en la construccin colectiva de la Bogot del futuro.','../eventimg/534667813Plan-Maestro-Bogot.png','Pontificia Universidad Javeriana ',2,'Bogot','https://www.facebook.com/AlcaldiaDeBogota?fref=ts','Bogota_DC','Alcalda Mayor de Bogot / Pontificia Universidad Javerian','Convenio de asociacin entre la Alcalda Mayor de Bogot D.C. y la Pontificia Universidad Javeriana para aunar esfuerzos en la formulacin y estructuracin del Plan Maestro de Tecnologas de Informacin y Comunicaciones (TIC) de Bogot Distrito Capital',6,223,57,1,'PUB',2,'2015-08-22 19:07:20','','https://www.youtube.com/watch?v=N0_PjqFh7DA',0,0,'2015-8-22 17:55:33'),(301,16,'Curso de Analisis PVT para Petroleo de Baja Volatilidad','Las instrucciones a impartir corresponden a un Curso Basico - Intermedio, donde se le proporcionar a los participantes los conocimientos fundamentales de las Propiedades de los Hidrocarburos (Analisis PVT), abarcando las definiciones basicas de dichas propiedades, comportamiento de fases, caracterizacion, muestreo y analisis de pruebas PVT de baja volatilidad en el laboratorio, uso de correlaciones empiricas programadas, resultados y validacion de pruebas PVT. <br><br><b>Objetivo:</b> Suministrar a los Participantes los aspectos teoricos y practicos del analisis de presion, volumen y temperatura (PVT) de los fluidos del yacimiento. Presentando las tecnicas de evaluacion que permitiran al participante determinar las propiedades de los fluidos a partir de los datos de laboratorio. Todo esto con la finalidad de obtener y manejar informacion fundamental para la Generacion del Modelo de Yacimiento, Calculo de Reservas, Calculos Analiticos y Numericos, Control y Seguimientos del Comportamiento del Yacimientos, lo que propicia la Maxima Produccion de Hidrocarburos. <br><br><b>Dirigido a:&nbsp;</b><span>Ingenieros de yacimiento de mediana experiencia, personal tecnico, ingenieros afines (otras disciplinas tecnicas) que se desempenen en departamentos responsables de la exploracion, explotacion y produccion de Hidrocarburos que requieran dominio sobre el los procesos de caracterizacion termodinamica de los yacimientos de petroleo. Adicionalmente, personal&nbsp;involucrado con la captacion de muestras y propuesta tecnica para la contratacion de dichos analisis.&nbsp;</span><br>','eventimg/772767767AnlisisPVTparaPetrleodeBajaVolatilidad.jpg','UPC Global: Colombia, Crr 13A # 89 - 53, Oficina 303',2,'Bogot','https://www.facebook.com/UPCGlobal','UPCGlobal','UPC Global','Dirigido A\r\nIngenieros de yacimiento de mediana experiencia, personal tecnico, ingenieros afines (otras disciplinas tecnicas) que se desempenen en departamentos responsables de la exploracion, explotacion y produccion de Hidrocarburos que requieran dominio sobre el los procesos de caracterizacion termodinamica de los yacimientos de petroleo. Adicionalmente personal involucrado con la captacion de muestras y propuesta tecnica para la contratacion de dichos analisis. ',6,803,57,1,'PUB',2,'2015-09-22 12:39:31','','https://www.youtube.com/watch?v=BXMnAtefpV0',0,0,'2015-7-8 22:05:27'),(302,16,'Aprende sobre la Aceleradora Agora','Agora est en busca de emprendedores motivados liderando compaas de alto crecimiento que intencionalmente crean impacto social y/o medioambiental en Colombia. Acompanos en las oficinas de Socialab y aprende acerca de la Aceleradora Agora. Luego, qud