izar al mximo el tiempo empleado para poder conseguir los mejores resultados. Pensando en ello hemos ideado un taller en el que aprenders: Aplicabilidad y oportunidades del uso de Facebook, Twitter, Youtube, Google+, Distinguir entre lo que se desea y lo que se puede realizar en redes sociales. Conocer la audiencia de la marca y cmo vara la comunicacin dependiendo de estos factores. Definirs las redes a utilizar, creando contenido y publicando en las redes de tu propio negocio o marca.','eventimg/50980081Social Media.jpg','1/4Tech Make, Crr 50 # 79 - 71, Piso 4',2,'Bogot','uncuartotech?fref=nf','UnCuartoTech','1/4Tech Maker Space','Pre-requisitos: No tiene. Dirigido a: Todos quienes tengan el deseo de aprovechar las herramientas a su alcance (redes sociales) para optimizar sus ventas y crecer sus bases de datos. ',6,380,57,1,'PUB',2,'2015-07-13 14:54:28','','https://www.youtube.com/watch?v=q1HLfrHAsAI',0,0,'2015-7-13 14:13:43'),(362,16,'Al Arte Libre Skating 2015','Es\r\nun festival lleno de adrenalina, arte, deporte, msica, teatro y una selecta\r\ngastronoma! Disfruta con nosotros un da lleno de actividades para SKATERS (Skatepark\r\n&amp; Tubos y Premios) y para el pblico en general un da empapado de cultura\r\ny actividades de diversin en familia, con parceros o en pareja. <br><span><br>Comparte con nosotros una gran variedad de shows circenses y cuenteros, aprecia las\r\nobras de artistas locales emergentes y disfruta un da lleno de una gran\r\nvariedad de msica y cultura en un ambiente vibrante nunca antes visto en\r\nBogot.</span>','eventimg/393350286Al Arte Libre Skating 2015.jpg','Cra. 6a #118-3 ',2,'Bogot','https://www.facebook.com/alartelibreusaquen/timeline','','David Ruiz','www.alartelibre.org',4,183,57,1,'PUB',2,'2015-08-22 16:35:54','','',0,0,'2015-8-22 16:34:15'),(305,16,'Talle de impresin 3D para nios: Crea tu personaje con piezas impresas en 3D','En este taller los nios aprendern las principios de la impresin 3D y podrn llevarse a casa un recuerdo creado por ellos mismos. Se explicara el proceso de impresion 3D con la ayuda de un video, que al finalizar es discutido con los ninos para repasar el alcance y aplicaciones de esta tecnica de fabricacion, el movimiento maker, hazlo tu mismo etc. Tambien se expondra el funcionamiento de una impresora 3D al vivo, la cual fabricara piezas extras para el juego, momento que se aprovecha para que los ninos hagan preguntas y comentarios. Que aprendern! Funcionamiento y proceso de impresion 3D. Alcances, aplicaciones y limitaciones de esta tecnica de fabricacion digital. Desarrollo y estado del movimiento Maker - DIY, beneficios del trabajo colaborativo e interdisciplinario. Creacion y personalizacion de un personaje con piezas impresas en 3D y materiales maleables. Beneficios de la personalizacion de objetos, del trabajo en grupo, etc.','eventimg/39263090TechMakerSpace.png','1/4Tech Maker, Crr 50 # 79 - 71 Piso 4',2,'Bogot','uncuartotech?fref=nf','UnCuartoTech','1/4Tech Maker Space','Pre-requisitos: No tiene. Dirigido a: Nios de 9 a 12 aos. (con acompaamiento de sus padres) Duracin: 3 horas. Ten en cuenta que si la fecha que seleccionaste no lleno el cupo mnimo, ser cancelado y reservaremos tu cupo automticamente para la siguiente fecha.',6,312,57,1,'PUB',2,'2015-07-13 14:50:18','','https://www.youtube.com/watch?v=q1HLfrHAsAI',0,0,'2015-7-13 14:48:51'),(306,16,'Como cambiar el mundo? Una introduccin prctica al emprendimiento social.','Quieres cambiar el mundo? Participa del Bootcamp de Emprendimiento con impacto social, un taller intensivo que te permitir aprender de forma prctica cmo desarrollar proyectos y emprendimientos con impacto social. Paso a paso.\r\nAtrvete a emprender! Objetivo: El objetivo principal es que los participantes realizan su potencial creativo para la creacin de soluciones valiosas a los problemas que ven en su mundo. Que los participantes se empoderan a tomar accin como Agentes de Cambio. Con este objetivo les introducimos a una metodologa cual gua 