bio y cooperacin multilateral entre sus miembros, con el fin de elevar la calidad y pertinencia de la gestin institucional y responder favorablemente a las necesidades de la sociedad colombiana.&nbsp;','eventimg/452042105uxtic.png','Universidad Sergio Arboleda - Observatorio Astronmico ',2,'Bogot','https://www.facebook.com/usergioarboleda','USergioArboleda','UxTIC','UxTIC: Red de universidades para fomento de la investigacin en tecnologas de la informacin y la comunicacin.',6,250,57,1,'PUB',2,'2015-08-22 13:34:03','','https://www.youtube.com/watch?v=FiiZCGv-5vM',0,0,'2015-8-22 13:28:54'),(308,16,'Ciclopaseo Represa del Sisga','A un espectacular recorrido por las montaas andinas en el que bordearemos el espejo de agua de la represa del Sisga, pedaleando por los campos, nos internaremos en los bosques de pino, los campos lecheros y disfrutaremos del aroma del bosque de eucaliptoRecorrido: 27 km aprox\r\nNivel: Principiantes (para personas que regularmente montan bici). Duracin aproximada: 3.5 horas. Incluye: * Induccin, * Acompaamiento de Guas en bici durante todo el recorrido, *Asistencia mecnica y de primeros auxilios, * Pliza de seguro y * Refrigerio. No incluye: Transporte, Alimentacin, Bicicleta y Otra clase de servicios no descritos.','eventimg/185642450ciclopaseos escape.jpg','Represa del Sisga, Chocont, Cundinamarca',2,'Bogot','escapeco.co','escapecolombia','escape - 317 6576933','IInformacin: info@escapeco.co No olvides hacer valida tu reserva. Como? Consignacin/ Transferencia bancaria: Banco de Bogot; Cta. Corriente: 038603445. A nombre de: escape ecoturismo y deportes de aventura SAS. Pago a domicilio? Llmanos, por un costo adicional podemos enviar un mensajero en bici. *Aplica condiciones y restricciones. Como llego a lugar? \r\nUna vez hagas tu reserva te enviaremos informacin para llegar al punto de encuentro. Que tipo de bici necesito para este escape? De preferencia bicicleta tipo de montaa, o que puedas usar en terreno destapado, pero sobre todo  EN BUEN ESTADO, (frenos, cambios, llantas, cadenilla, sillin). Si necesitas revisin de tu bicicleta, ponte en contacto con nosotros, ya que nuestros aliados de Soul bike tienen un descuento para ti en el alistamiento de tu bicicleta. *Aplica restricciones y condiciones. Que debo llevar? Una vez te registres nos contactaremos contigo para darte los detalles. Que incluye el refrigerio? Sandwich o emparedado + Jugo + barra energetica o fruta.',3,679,57,1,'PUB',2,'2015-07-13 18:29:00','','https://www.youtube.com/watch?v=YAiQRETWl-g',0,0,'2015-7-13 18:25:55'),(309,16,'La Gestin del Conocimiento del Programa de Certificacin de Excelencia','En un futuro prximo un cambio generacional en puestos de alta direccin amenazar la estabilidad de las organizaciones de hoy. Bajo esta evidencia:\r\n- Cmo mantener o mejorar la ventaja competitiva? - Cmo se puede proteger y desarrollar el valor de la empresa? Para entender la complejidad del entorno actual y el cambio generacional, las fuerzas de la realidad para dar forma al futuro. Es necesario adaptar el marco conceptual y nuevas herramientas para visualizar la realidad y las tendencias con el fin de anticiparse a los cambios del entorno y de los mercados, para centrarse, innovacin, tomar mejores decisiones y resolver problemas rpidamente. Las principales dificultades conocidas en los procesos de planificacin estratgica se utilizan para estar en la implementacin de los planes. La metodologa premiada  y desarrollada por David Griffiths doctorado. -UK, Cierra la brecha al ofrecer una visin avanzada y proactiva para la aplicacin del Plan Estratgico, basado en la Gestin del Conocimiento.','eventimg/184270229THE KNOWLEDGE MANAGEMENT EXCELLENCE CERTIFICATION PROGRAMME.png','Cl. 113 #7-80 ',2,'Bogot','pages/KMplanet/343391042396190?fref=nf','KMplanet','CESOFT COLOMBIA','En este programa, ofrecemos servicios de consultora especializados para empresas privadas, pblicas, organizaciones mixtas, educativas y de organizaciones no gubernamentales y el