, que realiza\r\nprogramas enmarcados en la difusin del patrimonio musical colombiano en las\r\nnuevas generaciones. Conformada por nios y jvenes entre los 6 y 16 aos,\r\nquienes reciben su formacin a nivel vocal, coreogrfico, dramtica y didctica\r\nsobre las msicas tradicionales colombianas, la agrupacin ha podido presentar\r\nsu labor en los ms exigentes escenarios en Medelln, Bogot, Ibagu, Bucaramanga,\r\nNeiva, Armenia y mltiples municipios antioqueos. A nivel internacional han\r\npresentado su trabajo en Austria y en Estados Unidos y preparan nuevamente su\r\ngira en Europa en septiembre de 2015 participando en festivales internacionales\r\nde folklor y conciertos protocolarios representando la cultura musical\r\ncolombiana.<o:p></o:p></p>','eventimg/1516564819Colombia Canta y Encanta.jpg','Teatro Coln',2,'Bogot','pages/Colombia-Canta-y-Encanta/57770884314?fref=nf','miteatrocolon','Asociacin Nacional de Msica Sinfnica ','En sta obra musical los nios paisas invitan al pblico familiar a recorrer el Pas Cafetero a travs de su msica tradicional para encontrar un secreto inimaginable. Esta historia llena de alegra, suspenso y emocin, exalta nuestro patrimonio musical y lo lleva a un lenguaje para ser disfrutado por todos quienes llevan en su corazn su alma de nios.',2,365,57,1,'PUB',2,'2015-07-28 15:50:20','','https://www.youtube.com/watch?v=V9V8mmPr2II',0,0,'2015-7-28 15:48:58'),(358,16,'Chaskij, Ensamble de Jazz (COLOMBIA)','Los hermanos Daniel (contrabajo) y Santiago de\r\nMendoza (batera), en compaa de Juan Ignacio Arbaiza (saxofn y flauta\r\ntraversa), crearon en 2012 Chaskij, un ensamble de jazz latinoamericano.\r\nChaskij es un tro de improvisacin y experimentacin que rene sonidos\r\ntradicionales de Colombia y Per. En este concierto interpretarn repertorio\r\npropio, as como interpretaciones vivas, frescas y expresivas, que les\r\nbrindarn a los oyentes una experiencia nica..','eventimg/1291263769Chaskij, Ensamble de Jazz (COLOMBIA).jpg','Biblioteca Luis ngel Arango',2,'Bogot','https://www.facebook.com/pages/Biblioteca-Luis-%C3%81ngel-Arango/219211484932852','ConciertosBR','Chaskij, Ensamble de Jazz ','',1,248,57,1,'PUB',2,'2015-08-21 17:11:06','','https://www.youtube.com/watch?v=D-iHnTaG8fY',0,0,'2015-8-21 17:10:20'),(317,16,'Gepaj / Hilos Mgicos','Las\r\nraces de esta historia se encuentran tanto en la tradicin oral de la costa\r\nnorte colombiana como en la leyenda europea de <b><i>El Violn Mgico.</i></b> <br><br>En ambos\r\ncasos se habla del hechizo que la msica puede generar en quien la escucha.\r\nAqu <b><i>Gepaj</i></b> invita a vivir una aventura fantstica en medio de manglares,\r\ncon un ogro, un simptico duende, un castillo, caimanes amaestrados y algo ms.\r\nPara entrar en la aventura slo basta emprender el viaje con el abuelo Mak y\r\nConcho el pescador, buscando con ellos la legendaria Flor del Agua. <br><br>Si en el\r\ncamino escuchamos su msica alegre y contagiosa no hay que contenerse,\r\nsimplemente es... <b><i>Gepaj!</i></b>','eventimg/1304980629Hilos-Magicos.jpg','Teatro Coln',2,'Bogot','https://www.facebook.com/miteatrocolon','miteatrocolon','Asociacin Nacional de Msica Sinfnica ','',2,568,57,1,'PUB',2,'2015-10-05 17:27:00','','https://www.youtube.com/watch?v=yflC4U_eJt8',0,0,'2015-7-28 16:49:45'),(462,16,'HANSEL Y GRETEL','La bruja mala del bosque ha decidido hacer un plan con la madrastra de Hnsel y Gretel por la mala situacin que estn viviendo en el reino, le propone que ella le de los nios a cambio de comida, joyas, belleza y trucos para que se vuelva una bruja, la madrastra acepta y tiene que convencer al padre de ellos para que los abandone en el bosque, una vez abandonados Hnsel y Gretel conocen un Troll que les habla de la importancia de la familia y les dice que tienen que recuperar a su padre, ellos siguen su camino y se encuentran con una casa de dulces en la mitad del bosque,  donde son engaados por la bruja mala que se hace pasar por anciana y les promete cuidarlos y darles comida. <br><br>A Hansel lo encierra en una jaula y a Gretel la vuelve su esclava, hasta que despus de darle mucha comida decide comrselo pero Hnsel y Gretel se vengan engandola y quemndola en el horno, quedando libres y apoderndose de todas las riquezas de la bruja, vuelven a encontrarse con su padre quien decide ir a buscarlos al bosque porque la madrastra ha muerto por el trato que hizo con la bruja.<br><br><b><i>Una historia que nos ensea a ser valientes, la unin, el amor y la importancia de la familia</i></b>','../eventimg/1514851517HANSEL Y GRETEL.jpg','Teatro Santa Fe',2,'Bogot','https://www.facebook.com/miteatrocolon','miteatrocolon','ARTES Y ESPECTACULOS PRODUCCIONES SAS ','20% Dcto con El Tiempo . Max 2 boletas.',2,878,57,1,'PUB',2,'2015-10-05 17:42:24','','https://www.youtube.com/watch?v=sDM440hMCnk',0,0,'2015-10-5 17:40:47'),(318,16,'XVI Encuentro Nacional de Astronoma','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">La\r\nRed de Astronoma de Colombia RAC realizar su XVI Encuentro anual en las\r\ninstalaciones del Planetario de Bogot en el marco de la celebracin del Ao\r\nInternacional de la Luz 2015.<o:p></o:p></span></p><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">La\r\nAgenda que incluye conferencias, ponencias, posters, exhibiciones, shows en el\r\nDomo del Planetario, recorrido por el Museo del Espacio y eventos culturales. Como\r\ninvitado internacional contamos con la presencia del astrofsico Valerio\r\nRibeiro de la Radboud University de Nijmegen, Holanda.<o:p></o:p></span></p><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\