ea de la citogentica para el anlisis de variantes de numero de copia relacionadas a enfermedades constitucionales o cncer. As mismo, los perfiles de expresin cada vez son ms utilizados para entender subtipos de cncer as como los perfiles genticos relacionados a respuesta a frmacos.&nbsp;<br><br><span><span><span><b>Dr. Pablo Sagaribay,</b> Microarray Team Leader, Fullerton Laboratory, Mission Hospital, Ashville, North Carolina</span><br></span><span><span><span><b>Dr. Alfredo Hidalgo,</b> Head of the Cancer Genomics Laboratory, National Institute of Genomic Medicine,&nbsp;</span>Mxico</span><br></span><span><span><b>Dr. Mariano Guardado,</b> Investigador Hospital General de Mxico y Director de Microarreglos Laboratorio Huella Gnica, Mxico DF</span><br></span><span><b>Laura Uribe, </b>Reproductive Health Marketing Manager, Affymetrix, Inc</span></span>','eventimg/298544657Microarreglos y sus aplicaciones en la clnica.jpg','Hotel Dann Carlton, Cra. 15 #103-60',2,'Bogot','https://www.facebook.com/affymetrix?fref=ts','Affymetrix','Affymetrix','',6,310,57,1,'PUB',2,'2015-08-18 21:11:24','','https://www.youtube.com/watch?v=QMAeAU4tEGo',0,0,'2015-8-18 10:12:17'),(355,16,'Alfredo Gutirrez Sinfnico','<span>En\r\nun maravilloso formato que se ha puesto de moda en todos los gneros, esta vez\r\nel vallenato se viste de gala y nos trae a un cono, un juglar del vallenato,\r\nel tres veces Rey Del Festival de la Leyenda Vallenata, el maestro Alfredo Gutirrez,\r\npara vestirlo de gala, con maravillosos arreglos clsicos, a cargo de La\r\nOrquesta Sinfnica de Bogot, bajo la direccin del maestro Zbigniew Zajac. Los\r\nespectadores se deleitarn con majestuosas melodas de ste gran exponente del\r\nvallenato. Acompaado de una gran orquesta, clsicos como Anhelos, La negra,\r\nOjos indios, La muerte de Abel Antonio, entre muchos otros, de su extenso\r\nrepertorio, encendern los nimos del recinto para engalanar la noche.<br><br></span>El\r\nmaestro Alfredo Gutirrez se ha caracterizado por ser una artista innovador me\r\nencanta poder compartir este don que tengo de la ejecucin para lograr hacer la\r\nmultiplicidad de tonos y precisin de los ritmos que produzco con mi veloz\r\ndigitacin. El trabajar al lado del director artstico Zbigniew Zajac y la\r\nFosbo sinfnica aparte de ser un honor es un aprendizaje en mi largo camino.\r\nSoy un artista emprico, y ellos tienen una gran escuela, sin embargo, la comunicacin\r\nque hemos tenido desde hace dos meses que venimos preparando los temas, ha sido\r\nimpecable, los arreglos van sujetos a mi direccin sin perder el formato al que\r\niremos dirigidos, agrego el artista.<br>','eventimg/1729907532Alfredo Gutirrez Sinfnico.jpg','Teatro Jorge Eliecer Gaitan',2,'Bogot','https://www.facebook.com/teatrojorgeeliecergaitan?fref=ts','TeatroJEGaitan','Arte y Cultura Producciones SAS','Alfredo Gutirrez ya le haba hecho unos coqueteos al gnero clsico hace algunos aos cuando realiz el lbum VIOLINES VALLENATOS. Igual que otra clase de trabajos discogrficos en los que fusion su msica con ritmos como soca o calypso , rancheras , y cuerdas al lado del desaparecido Too Fuentes, en el lbum CUERDAS VALLENATAS, incluso segn sus propias palabras  existe un lbum en versin chill out con mi msica.',1,269,57,1,'PUB',2,'2015-08-21 15:16:01','','https://www.youtube.com/watch?v=Vdu6eTWfAlI',0,0,'2015-8-21 15:13:05'),(349,16,'Seminario Gratuito: Tres secretos para alcanzar tranquilidad financiera.','<div>En el seminario gratuito \"Tres secretos &nbsp;para alcanzar la tranquilidad financiera\" puede aprender directamente de Andrs Morales, fundador de Ikenga (plataforma mvil que le ayuda a las personas a definir y alcanzar sus metas financieras):</div>&nbsp;<ul><li>Las 3 habilidades que lo llevaron a alcanzar la libertad financiera antes de cumplir 35 aos y cmo puede USTED&nbsp;desarrollarlas desde YA (si no es ahora que empieza a mejorar su vida financiera, cundo?</li><li>Cmo definir metas que le ayuden a avanzar financieramente y como Ikenga le ayuda da a da a lograrlas.</li><li>Cmo reducir sus gastos SIN SACRIFICAR SU CALIDAD DE VIDA.</li><li>Cmo identificar los paradigmas que no le estn permitiendo avanzar financieramente al ritmo que usted quisiera y qu proceso seguir para cambiarlos.</li><li>Tips de cmo manejan el dinero las personas ms prsperas financieramente y cmo puede comenzar usted a manejarlo de la misma forma.</li><li>Cmo rodearse de personas que le ayuden a mejorar su situacin financiera (crear el contexto financiero correcto).</li><li>Cmo puede implementar este conocimiento INMEDIATAMENTE para comenzar a lograr resultados y avanzar ms rpidamente hacia sus metas financieras.</li></ul>','eventimg/1087418768Tres secretos para alcanzar la tranquilidad financiera.png','Hotel Blue Suites, Calle 93 # 17 - 48',2,'Bogot','https://www.facebook.com/ikengaapp?fref=ts','ikenga_col','Andrs Morales','Andrs Morales, es co-fundador de Ikenga. A hoy es un exitoso empresario, tiene 3 empresas, entre ellas una cadena de 7 restaurantes de una de las franquicias de comida ms grandes del mundo, disfruta de tranquilidad y libertad financiera (los ingresos provenientes de sus inversiones pagan sus gastos y puede dedicarse a hacer lo que ms disfruta: ensear finanzas personales). ',6,478,57,1,'PUB',2,'2015-08-18 21:15:14','','https://www.youtube.com/watch?v=gTbLCDqwV9o',0,0,'2015-8-18 11:25:08'),(350,16,'Pensar la Luz: Taller de iluminacin Strobist ','Despus de una exitosa primera versin de este workshop, lanzamos nuevamente esta&nbsp;segunda oportunidad para quienes desean aprender y experimentar con esta tcnica de iluminacin.&nbsp;El trmino&nbsp;<b><i>\"Strobist\"</i></b>&nbsp;hace referencia a las tcnicas de iluminacin con flash electrnico porttil y su uso \"fuera de la cmara\". El propsito de este taller es el de ensear a usar los equipos y explorar las posibilidades de iluminacin que ofrece esta tcnica aplicadas al retrato.&nbsp;<span><span>Te gustara hacerte a un flash de mano y an no sabes cual es el adecuado? O ya tienes un flash &nbsp;y te gustara aprender a manejarlo como todo un(a) experto(a)? <br><br><b>PENSAR LA LUZ:</b> Un&nbsp;conversatorio&nbsp;de entrada libre organizado por&nbsp;</span><a href=\"http://sietefotografos.com/\" target=\"\" rel=\"nofollow\">SieteFotgrafos</a>&nbsp;para todos aquellos quienes desean iniciarse en esta tcnica y desean aclarar muchas de sus dudas.</span>','eventimg/852751312Taller de Iluminacin STROBIST.jpg','Casatinta, Transversal 17 # 45D - 61 Barrio Palermo',2,'Bogot','https://www.facebook.com/7FOTOGRAFOS?fref=ts','7fotografos','SieteFotgrafos - club de fotografa','',6,286,57,1,'PUB',2,'2015-08-18 21:22:49','','https://www.youtube.com/watch?v=eGTWfw08WOk',0,0,'2015-8-18 12:08:51'),(336,16,'Los 30 aos Der Conde Der Gucharo','Diversin y risas!!                                        <code></code>','eventimg/890257658Los 30 aos Der Conde Der Gucharo.jpg','Aguapanelas Internacional',2,'Bogot','AguapanelasInternacional?fref=ts','AguapanelasInt',' Aguacate INK','Edad mnima de ingreso 18 aos',2,319,57,1,'PUB',2,NULL,'','https://www.youtube.com/watch?v=hdxKnhq6RzI',0,0,'2015-8-4 15:10:48'),(356,16,'Anne Paco Triphase, Ensamble de Jazz (Francia)','<b><u>Msica\r\ny msicos de Latinoamrica y el mundo.</u></b><br><span><br>En\r\n2005, la baterista Anne Paco conoci al pianista Leonardo Montana y al\r\ncontrabajista Joan Eche-Puig. Desde entonces, la conversacin no se ha detenido\r\ny el dilogo entre amigos se ha convertido en composiciones a seis manos y en\r\ninterpretaciones que parecen conversaciones donde uno termina la frase del otro\r\ny donde solo hay espacio para la armona y la diversin de hacer msica en\r\ntro, quizs uno de los formatos ms exquisitos de la historia del jazz.</span>','eventimg/1526088292Anne Paco Triphase, Ensamble de Jazz (Francia).jpg','Biblioteca Luis ngel Arango,',2,'Bogot','https://www.facebook.com/pages/Biblioteca-Luis-%C3%81ngel-Arango/219211484932852','ConciertosBR','Anne Paco Triphase','Los conciertos de Ann