s que les pasan a los dems.\r\n<br><br><b><u>EL COMEDIANTE\r\n<br></u></b><br>Ricardo Quevedo comenz a hacer comedia sin saberlo, creyendo que haca cuentera, y por eso todos los `cuenteros` de Bogot coincidan en que era un muy mal cuentero. Comediante con un estilo propio que a fuerza de la honestidad de sus creaciones se ha ganado los aplausos y el reconocimiento del pblico. <br><br>Particip en el Festival del Humor del canal Caracol, integrante del elenco permanente de Comediantes de la Noche de RCN Televisin, particip en programa Stand Up sin Fronteras de Comedy Central Latinoamrica , realiz ms de 1.000 funciones de su show No tiene ms sencillo? en Colombia, Ecuador, Nicaragua y Estados Unidos; incursion en el cine como actor cmico en las pelculas Nos vamos pal mundial y Se nos arm la Gorda.','../eventimg/1949256096QUE VIVA LA ENVIDIA!.jpg','Teatro Leonardus',2,'Bogot','https://www.facebook.com/ricardoquevedocomediante','cejaspobladas','Llenando Salas S.A.S',' 50% para estudiantes y tercera edad los viernes 8:00 p.m. y sbados 6:00 p.m.  solo aplican en la taquilla del Teatro Leonardus .   ',2,1113,57,1,'PUB',2,'2015-10-06 13:43:51','','https://www.youtube.com/watch?v=0qqcBYhenbc',0,0,'2015-10-6 13:41:32'),(353,16,'Alexnder Numpaque, Violonchelo','                    <span style=\"<code\">\r\n                </span><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Alexnder\r\nNumpaque ha actuado como violonchelista principal en la Orquesta Sinfnica del\r\nConservatorio Universidad Nacional y la Orquesta Sinfnica de Bogot. Es\r\nsolista del Conjunto de Msica Antigua de la Universidad Nacional e integrante\r\nde la Orquesta Filarmnica Joven de Colombia. Su concierto estar lleno de\r\ncontrastes, no slo de periodos histricos, sino de timbres y emociones; un\r\nrecital ideal para apreciar todas las virtudes sonoras del