con buen\r\nagarre, arns de escalada, casco de escalada, guantes, mosquetones de\r\nseguridad, ocho descendedor. La velocidad del descenso es controlada\r\ndirectamente por quien lo prctica en el momento. Sin embargo, existir siempre\r\nuna persona en tierra (Belay) quien controle la cuerda en el momento necesario\r\no en caso de una emergencia.</span>                    <code></code>\r\n                ','eventimg/251036883Torrentismo.jpg','Cascada La Juna, Choachi',2,'Bogot','bungeejumpingbogota','bogotabungee','Bogot Bungee','edad mnima 14 aos \r\npeso mnimo 45 kg max 95\r\n\r\nDEBEN HACER LA RESERVA \r\nreservasbogotabungee@hotmail, indicando la cantidad de boletas que compraron esto es para todos los planes cel: 311 263 01 10 - 317 878 7823',3,1120,57,1,'PUB',2,'2015-07-29 23:47:47','','https://www.youtube.com/watch?v=zb3hTTVemHg',0,0,'2015-7-29 23:40:30'),(329,16,'Ese tal Show NO Existe!','                                                            <p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Despus\r\ndel xito del show \"Esto No Es Ficcin\" llega el segundo trabajo de\r\nFreddy Beltrn llamado \"Ese Tal Show No Existe\". \"Un da me\r\npidieron que hablara de Colombia, me quede viendo el mapa y no ms la forma del\r\nmismo, me pareci rarsima\"...<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">As\r\nempieza el show, una mirada al pas en la que se intenta resolver muchas\r\npreguntas, entre ellas: Se han dado cuenta que ahora todos son\r\n\"Presuntos\"?, Al pas le falta motivacin?, Qu es eso de la\r\n\"Casa por crcel?, Cul es el remedio para los corruptos?; Estas y otras\r\npreguntas sern resueltas en este stand-up comedy de temas tragedy.<o:p></o:p></span></p>\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Pretende\r\nhacer una crtica social a travs del humor, una mirada en 85 minutos sobre el\r\npas y cosas qu, o no se han dado cuenta, o no las quiere decir.<o:p></o:p></span></p>','eventimg/2124518858Ese tal Show NO Existe!.jpg','Teatro Santa Fe, Centro',2,'Bogot','events/990625527643772/','FreddyComedianT','Artes y Espectculos Producciones SAS','Edad mnima de ingreso 18 aos',2,541,57,1,'PUB',2,'2015-07-30 16:07:39','','https://www.youtube.com/watch?v=CwQ3TCloxj8',0,0,'2015-7-30 16:07:08'),(330,16,'FE?','                                        \r\n                <p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Catolicismo,\r\nchamanismo, cristianismo, esoterismo, agnosticismo, veganismo, e incluso\r\natesmo, son algunos de los mltiples ismos del collage que quermoslo o no,\r\nconforman nuestra fe de hoy en da. Una fe que no se decide por ninguna\r\ndoctrina en exclusiva, y que a la vez cree alternadamente en todas, segn\r\nnuestra conveniencia o desesperacin. Creemos en la fuerza de Jesucristo, pero\r\nconsultamos brujas para una ayudita extra. Somos ateos, pero oramos en secreto\r\npor si las moscas. Adoramos a los animales, pero para acentuar nuestro odio a\r\nlos dems. Nos las damos de escpticos, pero secretamente esperamos la seal\r\ndivina. Presumimos de una fe a toda prueba, pero nos aterra el azar. Siete\r\nescenas nos ayudarn a burlarnos de este bricolaje en donde la incertidumbre es\r\nla gran conclusin, pues fe y duda son amigas inseparables, y nosotros, su\r\ncampo de batalla permanente.<o:p></o:p></span></p>','eventimg/1982327741FE.jpg','Casa E, Centro',2,'Bogot','CasaEoficial','CasaE_',' Corporacin Ensamble Latino','Actuacin: Diana Jaramillo, Reina Snchez.\r\nDramaturgia y direccin: Pedro Miguel Rozo\r\nAsistencia tcnica: Jonathan Villamil\r\nDireccin de Arte: Leandro Mussi\r\nVestuario: Anglica Maldonado\r\nDiseo de imagen: Diego Sierra',2,187,57,1,'PUB',2,'2015-07-31 08:36:54','','',0,0,'2015-7-31 08:22:19'),(331,16,'Quin se Quiere Ir? De George Harris','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Tomar\r\nun avin e irse hacia cualquier destino se ha vuelto una solucin para aquellos\r\nque ven complicada la vida en nuestros pases.<o:p></o:p></span></p><p><span style=\"font-family: Tahoma, sans-serif; font-size: 12pt; line-height: normal; text-align: justify; background-color: initial;\">Bajo\r\nesta premisa un joven latinoamericano decide abrirse campo en USA, sin darse\r\ncuenta que empezara a formar parte de un universo nunca antes explorado: ser\r\ninmigrante. George Harris nos narra las ventajas y bemoles de vivir en\r\nVenezuela con su Stand Up Comedy que busca satirizar y resaltar las razones que\r\ntenemos para regresar. Quin Se Quiere Ir? es un homenaje para todos los\r\nvalientes que se van de sus pases, para aquellos que siguen luchando en el\r\ndestino escogido y para los no menos valientes que deciden regresar.</span><span style=\"font-size:12.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p><br></o:p></span><span style=\"font-family: Tahoma, sans-serif; font-size: 12pt; line-height: normal; text-align: justify; background-color: initial;\"><br></span></p><p><span style=\"font-family: Tahoma, sans-serif; font-size: 12pt; line-height: normal; text-align: justify; background-color: initial;\">Esta\r\npieza fue estrenada en el ao 2005 en Madrid, Espaa para luego llevarla a\r\nVenezuela con el nimo de reflejar la situacin que estn viviendo los pases\r\nlatinoamericanos. Ha sido presentado con gran xito en Espaa, Venezuela,\r\nMiami, NY, Houston, Atlanta, Orlando, Bogot y Panam entre otras.</span></p>','eventimg/1344804471Quin se Quiere Ir De George Harris.jpg','Teatro Astor Plaza',2,'Bogot','elgeorgeharris','ElGeorgeHarris','Aguacate Ink','Lo pueden ver en vivo con El Show de George Harris a travs de su canal de humor www.elgeorgeharris.com todos los jueves 10PM. Todos los lunes el mismo show tambin es transmitido por TV Venezuela para todos los Estados Unidos.',2,271,57,1,'PUB',2,'2015-07-31 10:36:47','','https://www.youtube.com/watch?v=7Ho1fiwLz3U',0,0,'2015-7-31 10:33:35'),(332,16,'Con M de Magia','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">La\r\nnueva franja en La Comedia Teatro que tendr los ms sorprendentes y divertidos\r\nespectculos de magia todos los martes del ao. Con una programacin especial,\r\ntodos los asistentes sern testigos de los milagros que ocurren en las manos de\r\nlos ms importantes artistas del ilusionismo en la actualidad. Cada mes habr\r\nun espectculo diferente para sorprender a toda la familia.</span></p>','eventimg/401366422Con M de Magia.jpg','La Comedia Teatro',2,'Bogot','lacomediateatro','LaComediaCo','Juan lvarez Magia S.A.S','Magnficos Martes llenos de ilusionismo para toda la familia! ',2,368,57,1,'PUB',2,'2015-07-31 12:34:51','','https://www.youtube.com/watch?v=m__5v3EVzX0',0,0,'2015-7-31 12:33:56'),(333,16,'Cartas de Sangre','                                        <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Es\r\nuna obra de teatro de terror representada por la Compaa Teatro Vivo de\r\nColombia en la Casa Teatro de Bogot, es una itinerancia contenida por una\r\nantigua casa del barrio Palermo, el pblico asume diferentes roles dentro de la\r\npropuesta y es quien define el final de la obra, por esta razn decimos que en\r\nnuestros montajes teatrales el PBLICO ES EL PROTAGONISTA.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><strong><u><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">SINOPSIS:</span></u></strong><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"> En la crnica roja\r\nse anuncia que un extrao cadver fue encontrado desmembrado a las afueras de\r\nla ciudad y mantiene en alerta a las autoridades, pues completa un ciclo\r\ndantesco de muertes que aterra a los bogotanos. La maldad camina por las\r\ncalles. (NOMBRE DE PROTAGONISTAS DEL PBLICO DE LA HISTORIA 3) afamado\r\nperiodista investiga sobre estos hechos y encontr que una visita a una\r\ncntrica casona pueda ser fundamental para hallar respuestas al misterio.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">En\r\nesa casona funcionaba un viejo inquilinato en la que dos familias se enfrentan\r\na muerte por poseerla, sin saber que en el siniestro stano de la casa se\r\nesconde algo o alguien que no es humano. En ese stano hace diez aos BRGIDA\r\ncometi un crimen insidioso que marc a sus habitantes, mat en extraas\r\ncircunstancias a una de sus hermanas. Desde entonces nadie se haba atrevido a\r\nabrir ese lugar por miedo. Cuando las puertas de ese lugar estn abiertas no\r\nslo el pasado regresar buscando redencin en la muerte, la maldad encarnada\r\ncaminar por los pasillos dejando a su paso un mensaje escrito en cartas de\r\nsangre.<o:p></o:p></span></p>','eventimg/1034652661Cartas de Sangre.jpg','Casa Teatro de Bogot',2,'Bogot','pages/Casa-Teatro-de-Bogot/307881735961677?fref=ts','CasaTeatroBog','Grupo Taller Social S.A.S','Todos los Viernes y sbados 7:00 p.m.',2,345,57,1,'PUB',2,'2015-07-31 14:08:04','','https://www.youtube.com/watch?v=vAMO6kyjgOI',0,0,'2015-7-31 14:06:45'),(334,16,'Cllate y Escribe: Andrea Guzmn & Jimmy Vsquez','                    \r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\">Ha vivido el drama de sentirse menos que su pareja\r\nporque supera sus talentos o tal vez lleva ms plata a la casa, pero se aman y\r\nde alguna manera buscan soportarse? Si no lo ha vivido seguro se le hace\r\nconocida la historia o le recuerda alguna parecida con sus amigos o familiares.\r\nEntonces no deje de ver la nueva comedia semntica Cllate y escribe, que llega\r\nal Teatro Nacional Fanny Mikey y le sacar sus mejores carcajadas. Imperdible!<o:p></o:p></p>','eventimg/515135079Cllate y Escribe Andrea Guzmn y Jimmy Vsquez.jpg','Teatro Nacional Fanny Mikey',2,'Bogot','lacasadelteatronacional?fref=nf','fteatronacional','Fundacin Teatro Nacional','Edad mnima de ingreso 12 aos',2,241,57,1,'PUB',2,'2015-07-31 16:22:46','','https://www.youtube.com/watch?v=BqDrRnjgGXk',0,0,'2015-7-31 16:22:24'),(352,16,'A qu le llamamos paz?','<span class=\"wysiwyg-color-blue\">El cuarto debate, que tendr lugar en la Biblioteca Virgilio Barco el domingo 6 de septiembre a las 10 de la maana, girar en torno a uno de los temas ms importantes de la agenda nacional: La paz. En esta ocasin, la discusin se centrara en preguntas como A qu le llamamos paz? Para conseguir la paz se necesita perdn, reconciliacin, olvido, memoria, justicia, venganza? Qu es perdonable y qu es imperdonable? Sobre qu bases ticas y morales opera la justicia? Cmo no alentar la impunidad histrica y el olvido? Cm</span>o garantiza la justicia que haya verdad?','eventimg/1907839795A que le llamamos Paz.jpg','Biblioteca Pblica Virgilio Barco',2,'Bogot','https://www.facebook.com/CulturaenBogota?fref=ts','CulturaenBta','Secretara Distrital de Cultura Recreacin y Deporte','Preguntas frecuentes\r\nEl evento tiene algn costo?\r\nNo, todos los debates son gratuitos.\r\n \r\nHay algn lmite edad para asistir al evento?\r\nNo hay lmite de edad\r\n \r\nDnde puedo ponerme en contacto con el organizador en caso de tener alguna pregunta?\r\nSi tiene alguna pregunta escrbanos a comunicaciones@scrd.gov.co\r\n \r\nEs transferible mi registro/entrada?\r\nSi es transferible\r\n \r\nDebo llevar mi entrada impresa al evento?\r\nSi debe llevar su entrada impresa. ',6,216,57,1,'PUB',2,'2015-08-18 21:37:47','','https://www.youtube.com/watch?v=Bvt9Gdm-SXg',0,0,'2015-8-18 13:24:11'),(335,16,'Boleros para un Actor','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Jorge Cao, un seor\r\nactor, un seor cantante. Un espectculo lleno de boleros, amor, pasin. Y\r\nentonces result que el actor cubano Jorge Cao era tambin cantante. Y de los\r\nbuenos. Su voz suena espesa, amable, bella, profunda,<o:p></o:p></span></p><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Esa voz arranca a\r\ncantar y repasa las lneas romnticas de Mi ayer, uno de esos boleros que\r\nastilla corazones, escrito por el cubano ico Rojas, uno de los grandes\r\ncompositores de Cuba: Ayer encontr la felicidad, ayer fuiste de mi nada ms y\r\nhoy t sers quin me dir muy quedo amor, yo a ti tambin te quiero...<o:p></o:p></span></p>','eventimg/74048832Boleros para un Actor.jpg','Auditorio las Bethlemitas',2,'Bogot','pages/Jorge-Cao/177987786197?fref=nf','JorgeCao2','Corporacin Artstica En Escena','Edad mnima de ingreso 14 aos',2,256,57,1,'PUB',2,'2015-07-31 17:52:12','','https://www.youtube.com/watch?v=zc3nfaQ0YA8',0,0,'2015-7-31 17:51:20'),(473,16,'SER MUJER ES COSA PA MACHOS','<b><i>Ser Mujer es cosa Pa Machos ,la comedia de las comedias. Esta obra recrea con muchsimo humor las diversas facetas del universo femenino, pero vividas, experimentadas, sentidas y sufridas, por un hombre.\r\n</i></b><br><br><u><b>El Experimentar:</b></u> los tacones, la celulitis, la depilacin, el Sndrome Premenstrual, la prdida de la virginidad, el embarazo, etc., porquela nica forma de comprender a las mujeres es meterse en su universo.\r\n<br><br><b><u>Disfrute una hora y 20 minutos del mundo femenino:</u></b> historias y reflexiones sobre sexo, maternidad, pareja y mucho ms, en un completo divertimento a cargo de un slo actor.\r\n\r\n<br><br><b><u>La Obra se divide en 3 actos:</u></b>\r\n\r\nLas mujeres se entusiasman con cualquier cosa y despus.se casan con El.\r\nLa prdida de la Virginidad le duele ms a los paps que a Uno.\r\nUno puede olvidar uno mala noche.pero No al Culpable.','../eventimg/634951794SER MUJER ES COSA PA MACHOS.jpg','Teatro Bernardo Romero',2,'Bogot','https://www.facebook.com/TEATROBRL','TeatroBRL','CARLOS QUIROGA','FICHA TCNICA\r\nMonlogo interpretado por Carlos Quiroga\r\nDiseo de Vestuario: Hernn Zajar\r\nDramaturgia y Direccin General: Carlos Quiroga    ',2,930,57,1,'PUB',2,'2015-10-06 19:23:42','','https://www.youtube.com/watch?v=9kMUWRdoOzo',0,0,'2015-10-6 19:21:23'),(338,16,'Las Aventuras de Tom Sawyer','                    \r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Pensando\r\nen uno de nuestro ms valioso pblico: los nios y nias, regresa esta vez a\r\nlas tablas del Teatro Nacional Fanny Mikey Las aventuras de Tom Sawyer, una\r\nobra familiar, escrita por Mark Twain, basada en la imaginacin de este\r\npequeo, quien tiene una mente llena de magia y fantasa. Aqu todos los\r\nespectadores podrn ser testigos de cmo cada bsqueda de Tom se convierte en\r\nun encuentro con el amor, la disciplina, la amistad, la imaginacin, y a la vez\r\npermite poder dejar ver aquella picarda y valenta que lo caracterizan. La\r\nobra ocurre en un pueblo alejado de la modernidad, de los juegos para nios\r\nactuales y de la tecnologa, para presentar alternativas diferentes y muy\r\ndivertidas para que los nios sueen y jueguen.<o:p></o:p></span></p>','eventimg/1573417773Las Aventuras de Tom Sawyer.jpg','Teatro Nacional Fanny Mikey',2,'Bogot','TeatroNacionalFannyMikey','fteatronacional','Fundacin Teatro Nacional','Las aventuras de Tom Sawyer nos invita a hacer parte de una puesta en escena llena de fantasa y humor, que permitir a los nios y a sus familias reencontrarse con su imaginario, poder inventar grandes historias con sus amigos y creer en un universo mgico, donde sin importar el lugar, siempre habr oportunidad para jugar y ser un hroe. Todas las travesuras del pequeo y valiente Tom Sawyer nos harn creer y afirmar que de la mano de la amistad, la familia, el perdn y el amor es posible llevar una vida en armona, sin nunca olvidarnos que podremos conocer nuevos mundos por medio de nuestras ilusiones y que nuestro nico reto es dejarlas volar.',2,265,57,1,'PUB',2,'2015-08-05 13:35:52','','https://www.youtube.com/watch?v=T5yI_blC0m4',0,0,'2015-8-5 13:35:00'),(339,16,'Cosi Fan Tutte de W.A. Mozart','                    <p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Se trata de una\r\nsimptica comedia de enredos donde dos hermanas cambian de amantes sin saberlo,\r\nya que regresan disfrazados para probar una apuesta que hacen con el viejo\r\nfilsofo Don Alfonso que les apuesta que no hay mujer fiel, si se les da la\r\noportunidad dejan de serlo. En Colombia se estren en 1984 y regresa por\r\nprimera vez al Teatro Coln desde esas 6 funciones bogotanas y la funcin que\r\nse hizo en el Teatro Municipal de Cali.<o:p></o:p></span></p>\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">La puesta en escena\r\nestar a cargo de Gianpaolo Corti, asistente de Giorgio Strehler en la clebre\r\nproduccin del Piccolo de Milano, ltima puesta en escena operstica del gran\r\nmaestro italiano antes de morir.<o:p></o:p></span></p>','eventimg/1159104096CosiFanTuttedeW.A.Mozart.jpg','Fundacin Camarn del Carmen',2,'Bogot','miteatrocolon?fref=nf','miteatrocolon','Teatro Coln','Para nuestras funciones en el Teatro Coln tendremos un elenco prcticamente colombiano con todos nuestros grandes cantantes que triunfan en el exterior: Juanita Lascarro como Fiordiligi, Alejandro Escobar (Ferrando), Juan Fernando Gutirrez (Guglielmo), Valeriano Lanchas (Don Alfonso) y Karolyn Rossero (Despina), acompaando a una de las mejores Dorabellas de la actualidad: Paola Gardina que viene de interpretar el rol en la Scala de Milano y en el Teatro Real de Madrid. Todos bajo la direccin de Hillary Griffiths dirigiendo la Orquesta Sinfnica de Colombia.',2,271,57,1,'PUB',2,'2015-08-05 14:03:28','','https://www.youtube.com/watch?v=mixf13coXLA',0,0,'2015-8-5 14:01:24'),(340,16,'De Cantina en Cantina','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Llega\r\nun show imperdible y lleno de sentimiento y emocin con Majida Issa, Diana\r\nHoyos, Yolanda Rayo y Aida Morales.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Ana\r\n(Majida Issa/Diana Hoyos), Fernanda (Yolanda Rayo) y Roco (Aida Morales) son\r\ntres mujeres que trabajan de meseras en \"La Cantina\". Un lugar donde\r\nlos hombres van a desahogar sus penas y sus amores. Una maana cuando todo\r\npareca estar normal y mientras organizaban lo que haba quedado de la noche\r\nanterior, Fernanda descubre que detrs de la barra hay un hombre muerto. De\r\ninmediato nos vemos sumergidos en un recorrido musical por el tiempo y la vida\r\nde cada una de ellas. Una serie de divertidas situaciones que saltan entre la\r\ncomedia y el drama amoroso al ritmo de rancheras, msica popular y msica de\r\nplancha. Quin lo mat?, Qu pas la noche anterior?, Por qu?<o:p></o:p></span></p>','eventimg/1704687990De Cantina en Cantina.jpg','Teatro Nacional La Castellana',2,'Bogot','teatronacional.co','fteatronacional','Fundacin Teatro Nacional','Toda la tragedia empieza, una vez descubren al muerto, pues es all donde inicia un viaje en el que cada una de las mujeres cuenta su propia historia de vida, quienes son ellas, qu hacen en ese lugar, porque cada una de ellas piensa que una o la otra fue la culpable de la muerte del dueo de la cantina; salen a la luz sus dolores personales presentes y pasados a travs de un lenguaje musical a ritmo de rancheras, msica popular y msica de plancha.',2,382,57,1,'PUB',2,'2015-08-05 14:37:34','','https://www.youtube.com/watch?v=rOKFQQ0r73w',0,0,'2015-8-5 14:34:36'),(341,16,'De la Cuna a la Jungla','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">T\r\nde Teatro y Centro Cultural OLD MUTUAL programan al colectivo musical TU\r\nROCKCITO con su concierto De La Cuna a La Jungla una divertida obra musical\r\nplena de sonidos e imgenes atractivas creadas por los juegos corporales, las\r\ncanciones para moverse y saltar, sonidos del cuerpo para armar orquestas y la\r\nespontaneidad de los padres y sus hijos al intercambiar los ritmos de la ldica\r\ny la imaginacin.<o:p></o:p></span></p>\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">DE\r\nLA CUNA A LA JUNGLA es el concierto para los ms pequeos del colectivo TU\r\nROCKCITO, proyecto de msica infantil que trabaja en torno a espacios nicos\r\npara la familia, proponiendo juegos musicales como un lugar indiscutible para\r\nel desarrollo y el disfrute durante la primera infancia. DE LA CUNA A LA JUNGLA\r\npropone la msica para ser felices, adems es la mejor excusa para que padres e\r\nhijos se encuentren y disfruten de un momento especial. Canciones para cantar,\r\nrer, jugar y hacer cosquillas son la especialidad durante el show.<o:p></o:p></span></p>','eventimg/2119343733De la Cuna a la Jungla.jpg','Auditorio Centro Cultural Old Mutual',2,'Bogot','','','Fundacin T de Teatro','El concierto De la Cuna a la Jungla lleg a ms de 30.000 nios durante el 2014 y aproximadamente 60.000 personas desde el 2012. Ha recorrido la ciudad de Bogot y el ancho y largo del territorio Colombiano en diversos formatos. ',2,298,57,1,'PUB',2,'2015-08-05 17:03:08','','https://www.youtube.com/watch?v=W8ypyMFEovc',0,0,'2015-8-5 17:01:22'),(342,2,'Descrate con la Azcarate','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">basado\r\nen la cruda y divertida realidad. Con su caracterstica fluidez y humor negro,\r\nLa Azcrate logra captar la atencin del pblico convirtindose en un espejo\r\na travs del cual hombres y mujeres pueden verse reflejados. Ninguna relacin\r\nde pareja es igual a otra, existen leyes y acuerdos individuales. Sin embargo,\r\nas queramos negarlo solemos caer en situaciones comunes que han sido la\r\nmateria prima de esta obra.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Los\r\ncelos, la constante bsqueda de pareja, las frustraciones, el matrimonio, los\r\nex, la luna de miel, las suegras, la convivencia, el sexo y la infidelidad son\r\nalgunos de los temas que Alejandra toca desde una perspectiva femenina ms no\r\nfeminista, ya que los abarca con una ptica graciosa y equitativa entre\r\ngneros. Polmica, controvertida, rpida, divertida y franca tal como su\r\nprotagonista, son las caractersticas centrales de este show.<o:p></o:p></span></p>','eventimg/176050981Descrate con la Azcarate.jpg','Auditorio las Bethlemitas',2,'Bogot','pages/Alejandra-Azcarate/416069278486159?fref=nf','LAAZCARATE','Corporacin Artstica En Escena','Es una invitacin a rerse de las desgracias emocionales y a gozarse los errores cometidos. El resultado ser lograr en corto tiempo unas abdominales marcadas por las carcajadas y el riesgo de: \r\n1) Echar a su pareja actual o evitar conseguir otra\r\n2) Lograr perfeccionar sus tcticas para mentir\r\n3) Convencerse de que la vida es una obra de teatro',2,377,57,1,'PUB',2,'2015-08-06 16:04:29','','https://www.youtube.com/watch?v=iSV3DGPI0Bo',0,0,'2015-8-6 16:01:10'),(343,2,'Festival de Msica Barroca','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">El\r\nFestival Internacional de Msica Sacra de Bogot y el Teatro Jorge Elicer\r\nGaitn traen a Colombia a Capilla de Sol, uno de los grupos ms representativos\r\nde msica barroca latinoamericana quienes interpretarn piezas musicales que\r\nse&nbsp; ejecutaban en las iglesias de las\r\nmisiones jesuticas de Moxos y Chiquitos en&nbsp;\r\nel este boliviano y villancicos de Juan de Araujo, Maestro de Capilla de\r\nla Catedral de Sucre.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Capilla\r\ndel Sol se presentar en el Teatro Jorge Eliecer Gaitan el proximo 3 de\r\nOctubre.&nbsp; Ser con el repertorio A\r\ncantar todo gargero,&nbsp; una seleccin de\r\nvillancicos de Juan de Araujo, uno de los msicos ms importantes que vivieron\r\nen Sudamrica en el siglo XVII.nos enorgullece que el Barroco Americano,\r\nnuestro repertorio, llegue a teatros tan importantes como el Gaitn de\r\nprestigio internacional, dndole una difusin y un prestigio social que hace\r\naos no tena seala Ramiro Albino, director del conjunto, quien, adems, ha\r\nescrito dos textos sobre El villancico americano en la poca de Juan de Araujo\r\nque invitamos a leer en este artculo.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Capilla\r\ndel Sol (Conjunto Residente del Museo Isaac Fernndez Blanco, Buenos Aires)\r\nest integrado por&nbsp; Adriana Sansone y\r\nSilvina Sadoly, Sopranos, Vernica Canaves, alto, Matas Tomasett, Tenor,\r\nRamiro Albino, flauta, Eduardo Rodrguez, bajn, Evar Cativiela, vihuela de\r\nmano, Federico Ciancio, clave y rgano, Ramiro Albino, direccin musical, Leila\r\nMakarius y Jorge Cometti, coordinacin artstica.<o:p></o:p></span></p>','eventimg/2143898832Festival de Msica Barroca.jpg','Teatro Jorge Eliecer Gaitan',2,'Bogot','teatrojorgeeliecergaitan?fref=nf','TeatroJEGaitan','Instituto Distrital de las Artes - IDARTES','La msica sacra en Bolivia en el Siglo XVIII: de las grandes Catedrales a las pequeas Iglesias Misionales\r\n\r\nCapilla del Sol (Argentina)\r\nRAMIRO ALBINO, direccin musical\r\nJORGE COMETTI direccin artstica',2,461,57,1,'PUB',2,'2015-08-06 16:37:19','','https://www.youtube.com/watch?v=len9oqpdEqc',0,0,'2015-8-6 16:34:37'),(351,16,'El Da Ms Lab','<b>Squadra\r\nGroup y el I+ED Lab</b> unen fuerzas para estructurar en Colombia un modelo de\r\ninnovacin que ampliar el campo de accin e impacto de ideas que por falta de\r\nestrategias para su desarrollo no progresan.<br><br>El\r\nevento de lanzamiento <b><u>EL DA MS LAB</u></b> ofrece la oportunidad a todos los\r\nasistentes de ver proyectos, prototipos y productos que solucionan de manera\r\ncontundente y creativa necesidades de empresas e instituciones de todos los\r\nsectores. \r\n\r\n&nbsp;\r\n\r\n<br><br><b><u>PROGRAMACIN\r\nEL DA MAS LAB:</u>&nbsp;<br><br>GENERAL / 10:00 AM - 4:00 PM <br>Pblico:</b>\r\nEstudiantes, creativos y personas amantes de la innovacin.\r\n\r\nActividades:\r\nDesarrollo del Concurso Creativo, workshops con expertos del I+ED Lab y muestra\r\nde prototipos de marcas como BMW.&nbsp;<br><b>Requisitos:</b>\r\nInscripcin completa en nuestro formulario (Datos obligatorios:\r\nNombre - Correo - Celular)\r\n<br><br><b>Workshops:&nbsp;</b>Efmero -&nbsp;El\r\naire no es Efmero.\r\n\r\n<br><b>Domstico:&nbsp;</b>La\r\nflexibilidad de los objetos, de las necesidades del siglo.\r\n\r\n<br><b>Food\r\nDesign:</b> \r\n\r\nDiseo\r\nal paladar para comunicar.<br><br><b><u>VIP / 6:00 pm - 12:00 pm\r\n\r\nPblico:</u></b>\r\nEmpresarios y representantes de instituciones o empresas industriales,\r\nproductoras y manufactureras.\r\n\r\n<br><b>Actividades:\r\n</b>Presentacin de modelo de negocio, coctel y Showroom prototipos desarrollados\r\npor el I+ED Lab para grandes marcas. <br>\r\n\r\n<span><b>Requisitos:</b>\r\nInscripcin completa en nuestro formulario (Datos obligatorios:\r\nNombre - Correo - Celular - Empresa)</span>','eventimg/1343573061IED Barcelona - I+EDLab - Squadra Group.jpg','Maloka, Carrera 68D # 24A - 51 ',2,'Bogot','https://www.facebook.com/squadracolombia','SquadraGroup','IED Barcelona - I+EDLab - Squadra Group','Squadra Group es una compaa colombiana de alcance internacional que desarrolla su labor en 3 lneas que entregan soluciones en:\r\nSquadra Design Lab. \r\nSquadra Habitat. \r\nSquadra Conocimiento.\r\nSquadra Group da solucin integral basados en Diseo 360 a retos en innovacin, arquitectura, construccin, marketing y comunicacin estratgica.',8,248,57,1,'PUB',2,'2015-08-18 21:30:04','','https://www.youtube.com/watch?v=KJeZsvyRVrc',0,0,'2015-8-18 12:43:17'),(344,2,'Fiesta de Verano con mucho Stand-Up Comedy','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">En\r\neste mes de vientos, cometas y verano, la casa del STAND-UP COMEDY en Colombia,\r\nMatildelina Bar, quiere festejar y para eso hemos convocado a dos de las ms\r\nimportantes comediantes de Colombia a ser protagonistas de nuestra FIESTA DE\r\nVERANO 2015. Ellos sern los encargados de ponerle ambiente y calor a esta\r\nnoche con lo mejor de su comedia.<o:p></o:p></span></p><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Ricardo\r\nQuevedo e Ivn Marn una vez ms juntos, desde la televisin, teatros y clubs\r\nde comedia, han logrado hacer que sus shows sean de los ms queridos,\r\ndivertidos y apetecidos por los colombianos; imposible perderse esta combinacin\r\nfuertemente divertida. As que preprense y alisten la quijada porque la risa\r\nque se les viene la podra descuadrar.<o:p></o:p></span></p>','eventimg/853265727Fiesta de Verano.jpg','Matildelina, Calle 81 # 11-34',2,'Bogot','vallenatohouse?fref=nf','Matildelinabar','Hugo Armando Devia Gmez I.D.','Edad mnima de ingreso 18 aos',2,549,57,1,'PUB',2,'2015-08-06 17:11:11','','https://www.youtube.com/watch?v=db-e4jxczEg',0,0,'2015-8-6 17:09:19'),(354,16,'Alexnder Pastrana, Piano Jazz','Alexnder\r\nPastrana har un recorrido por algunas de las obras ms reconocidas en la\r\nhistoria del jazz. Obras de Bill Evans, John Coltrane, Thelonious Monk, Miles\r\nDavis y Oscar Peterson, entre otros compositores, brindarn al pblico la\r\nposibilidad de conocer la manera como Pastrana reinterpreta el legado de un\r\ngnero nacido en el siglo XX.','eventimg/828315901AlexnderPastrana,PianoJazz.jpg','Biblioteca Luis ngel Arango,',2,'Bogot','https://www.facebook.com/pages/Biblioteca-Luis-%C3%81ngel-Arango/219211484932852','ConciertosBR','Alexnder Pastrana','',1,250,57,1,'PUB',2,'2015-08-21 12:54:49','','https://www.youtube.com/watch?v=QbRegB3imB8',0,0,'2015-8-21 12:47:28'),(345,2,'Granujas','                    <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Un\r\ndivertido montaje teatral por episodios que se robar toda su atencin. Escrita\r\ny dirigida por el reconocido dramaturgo Santiago Merchant, e interpretada por\r\nun elenco de lujo, llega a las tablas del Teatro Nacional La Castellana, la\r\nobra ganadora del Premio Fanny Mikey 2012: Granujas, una arriesgada y\r\ndivertida puesta en escena al estilo del cine negro y del cmic, que logra\r\nmezclar recursos cinematogrficos y televisivos sobre las tablas. As, entre\r\nficcin, suspenso y comedia se desarrolla una historia de pillos que planean el\r\nrobo ms importante de sus vidas, sin imaginarse que se les va a convertir en\r\nla peor de sus aventuras, y en la que el espectador por momentos tendr la idea\r\nde estar al mismo tiempo entre el teatro y una sala de cine.<o:p></o:p></span></p><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\"><o:p>&nbsp;</o:p></span>\r\n\r\n\r\n\r\n\r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">Bayo\r\ny Fif, son dos hermanos que quieren hacer la misin ms grande de sus vidas:\r\nRobar un banco para darse unas largas vacaciones. Lo que ignoran, es que tras\r\nese dinero se estn moviendo los ms truculentos planes de todos los bandidos\r\nde medio pelo de la ciudad: Joe Pesci, Pappi De Prato y por supuesto Ekaterina,\r\nla dama fatal del bajo mundo. Todos, sin querer, se encontrarn en el dilema\r\nms absurdo y peligroso de sus vidas. Desearan nunca haberse encontrado.<o:p></o:p></span></p>','eventimg/1000127851Granujas.jpg','Teatro Nacional La Castellana',2,'Bogot','pages/Teatro-Nacional-La-Castellana/234481779916864','fteatronacional','Fundacin Teatro Nacional','Edad mnima de ingreso 16 aos',2,334,57,1,'PUB',2,'2015-08-06 17:47:38','','https://www.youtube.com/watch?v=5M-xZRUlU_s',0,0,'2015-8-6 17:44:05'),(346,2,'Hipnotzate de la Risa','                    \r\n                <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;\">El\r\nS