 of Global Sales, Sangoma Technologies</li></ul>','../eventimg/1274905529Sogo.jpg','Centro Empresarial y Recreativo EL CUBO',2,'Bogot','https://www.facebook.com/Sangoma','Sangoma','Sangoma Technologies','    ',6,264,57,1,'PUB',2,'2015-09-22 11:07:48','','https://www.youtube.com/watch?v=lLlqH1KDd7w',0,0,'2015-9-22 10:47:40'),(427,16,'El fenomeno Dron: usos, riesgos y reglamentacin','A nivel mundial, las aeronaves no tripuladas (UAVs, RPAs, ARTs o Drones) han incrementado su participacin en mltiples industrias y nichos de mercado. En Colombia, crece la comunidad de profesionales y aficionados que emplean drones en ausencia de una normatividad legal sobre su uso comercial.\r\n<br><br>Recientemente se publico la primera circular oficial al respecto, que con el argumento jurdico de ofrecer un contexto de seguridad a los ciudadanos por medio de una estricta regulacin, impide el libre ejercicio de esta actividad. Esto ha generado una evidente inconformidad de parte de los propietarios de estas maquinas voladoras, quienes reclaman una reglamentacin incluyente y flexible, que no obstaculice el aprovechamiento de esta tecnologa.\r\n<br><br>Entonces, <b><i>qu son finalmente estas divertidas mquinas?\r\n\r\nPara que sirven? cual es el impacto de sus distintas aplicaciones en la sociedad?\r\n\r\nCules son los riesgos en que incurren los pilotos?</i></b>\r\n\r\n<br><br>Vamos a resolver estas y otras preguntas en el primer encuentro de Caf Numrique Bogot. <br><br><b><i>Acompaenos!</i></b>','../eventimg/1765095949El fenomeno Dron.jpg','HackBo, Cll 44 N 8 - 50 Of. 201 ',2,'Bogot','https://www.facebook.com/Caf%C3%A9-Num%C3%A9rique-Bogota-613096225497308/timelin','CafeNBogota','Caf Numrique Bogota','Caf Numrique Bogot es una comunidad que se construye en torno a las nuevas tecnologas en espacios de reunin conviviales. En Caf Numrique Bogot organizamos eventos de apropiacin de tecnologas de la informacin, la ciencia y la innovacin en ambientes informales y descomplicados como en un Caf