 el balanceo de las unidades, diagnstico de la condicin de la bomba, cargas en la unidad de superficie, esfuerzos en la sarta de cabillas, torque impuesto sobre la caja de engranaje, enfocando los resultados hacia una eficiencia mayor del sistema y los menores gastos en equipos instalados y consumo de energa por cada barril de petrleo producido.\r\n<br><br><b>Dirigido A:</b>\r\nEst dirigido al personal de Ingeniera, tcnicos de campos, supervisores y  operadores de produccin y personal que est involucrado en el desarrollo y prcticas de tecnologas en simulacin y diseo de sistemas de bombeo mecnico utilizando el Software de Theta Oilfield Services.\r\n<br><br><b>Contenido Programtico:</b>\r\n<br><ul><li>Bomba de Subsuelo</li><li>Principios Dinamomtricos&nbsp;</li><li>Anlisis Diagnstico</li><li>Integracin de las herramientas de Adquisicin de Datos de Campo y Software&nbsp;</li><li>Especializado de Diseo y Diagnstico&nbsp;</li><li>Experto\r\nDiseo de Sistemas de Bombeo Mecnico&nbsp;</li><li>Anlisis Kinemtico de las Unidades de Bombeo&nbsp;</li><li>Diseo de Cabillas de cero RODSTAR&nbsp;</li><li>Ejemplos Prcticos&nbsp;</li><li>XTOOLS&nbsp;</li><li>Proceso de Siete Pasos de Optimizacin</li></ul>','../eventimg/920747806Curso de Simulacin de Produccin para Bombeo Mecnico.png','UPC Global, Carrera 13A # 89 - 53',2,'Bogot','https://www.facebook.com/UPCGlobal','UPCGlobal','UPC Global','Empresa lder en consultora que da soluciones estratgicas en rea de levantamiento artificial. Estamos dedicados en el suministro de software, hardware y capacitacin para analizar y optimizar el rendimiento de pozos de petrleo y gas. La lnea de productos UPC tambin se extiende a barras pulidas, abrazaderas, preventivos de reventones (BOP), y prensaestopas.',6,972,57,1,'PUB',2,'2015-09-22 15:54:40','','https://www.youtube.com/watch?v=BXMnAtefpV0',0,0,'2015-9-22 15:42:20'),(432,16,' Curso de Mediciones Acsticas y Dinamomtricas','<b>Objetivo:</b>\r\nPresentar a los analistas de produccin y optimizacin con sistemas de bombeo mecnico, utilizando las tcnicas ms novedosas de la industria.\r\n<br><br>El Dr. Podio presenta el Analizador de Pozos de Echometer de una manera ms avanzada en cuanto a sus aplicaciones, equipo y software para llevar acabo las mediciones acsticas y dinamomtricas con el uso del software TWM y el nuevo TAM para equipos inalmbricos.<br><br><b><u>Temas:</u></b><br><ul><li>Aplicaciones del Analizador de Pozos</li><li>Software utilizado con el Analizador de Pozos</li><li>Total Well Management (TWM)</li><li>Total Asset Monitor (TAM)&nbsp;</li><li>Equipo de medicin Echometer&nbsp;</li><li>Configuracin para el estudio del pozo&nbsp;</li><li>Mediciones dinamomtricas</li><li>Anlisis dinamomtrico&nbsp;</li><li>Medicin acstica del nivel de fluido&nbsp;</li><li>Programa para registros acsticos de nivel y clculo de presiones dentro del pozo&nbsp;</li><li>Prcticas de campo seguras&nbsp;</li><li>Interpretacin de resultados (Procedimientos)&nbsp;</li><li>Programa de mantenimiento preventivo</li></ul>','../eventimg/408489468Curso de Mediciones Acsticas y Dinamomtricas.jpg','UPC Global, Carrera 13A # 89 - 53',2,'Bogot','https://www.facebook.com/UPCGlobal','UPCGlobal','UPC Global','Empresa lder en consultora que da soluciones estratgicas en rea de levantamiento artificial. Estamos dedicados en el suministro de software, hardware y capacitacin para analizar y optimizar el rendimiento de pozos de petrleo y gas. La lnea de productos UPC tambin se extiende a barras pulidas, abrazaderas, preventivos de reventones (BOP), y prensaestopas.',6,870,57,1,'PUB',2,'2015-09-22 16:28:34','','https://www.youtube.com/watch?v=BXMnAtefpV0',0,0,'2015-9-22 16:22:17'),(433,16,'Going Global de Canad para las empresas colombianas','En este Workshop usted podr  optar a una reunin  cara a cara con nuestros expertos para discutir y exponer su caso.\r\n<br><br><b>Agenda Workshop  (Language: English)<br></b><ul><li>Entender los beneficios de establecer su negocio en Canad y Prince Edward Isl