do el Telfono propuesta ganadora de la Beca de circulacin de pera al Parque de la Orquesta Filarmnica de Bogot y realizada por la fundacin FOSBO trata la vida de Poncho, un empleado de la empresa de telfonos, quien instala una lnea telefnica en el Teatro Municipal. \r\nJunto a Rosita, encargada de la limpieza del teatro, contarn historias y hablarn sobre los elementos esenciales de la pera en un juego de actividades y roles con el pblico incluyendo reconocidas arias y temas musicales.','../eventimg/339268563Teatro Libre Chapinero.png','Teatro Libre Chapinero ',2,'Bogot','https://www.facebook.com/orquestafilarmonica','filarmonibogota','Orquesta Filarmnica de Bogot','PREGUNTAS FRECUENTES\r\n> Existe restriccin de edad para los asistentes al evento?\r\nLa restriccin de edad mnimo es de 7 aos.\r\n> El teatro cuenta con parqueadero?\r\nEl teatro cuenta con dos alianzas con parqueaderos cercanos, el costo de parqueadero es de $8000 a $ 12000 por funcin.\r\n> Tengo que llevar mi tiquete impreso el da del evento?\r\nSi, para la entrada al teatro es necesario llevar impreso su tiquete de registro.\r\n> Cmo puedo contactarme en caso de tener preguntas adicionales?\r\nPuede contactarse con la oficina de Msica Acadmica de la Orquesta Filarmnica de Bogot al (571) 288 99 88 Ext 105-106 o a los correos jtorres@ofb.gov.co / rromero@ofb.gov.co',4,867,57,1,'PUB',2,'2015-09-24 11:58:52','','https://www.youtube.com/watch?v=NYq2bl6BQgM',0,0,'2015-9-24 10:47:02'),(437,16,'XVIII Festival de pera al Parque - Canto Lrico e Historia','<b><i>La Orquesta Filarmnica de Bogot realizar este ao el XVIII Festival de pera al Parque del 11 al 21 de Octubre de 2015.\r\n</i></b><br><br>El Festival tiene por objetivo acercar el gnero lrico y la pera a toda la ciudadana, para lo cual han sido seleccionados espectculos de calidad, incluyendo la Jornada al Parque el da 11 de Octubre en el Parque de la 93 con programacin desde la 1:00 P.M.\r\nTodas las presentaciones artsticas sern abiertas al pblico y de entrada libre.\r\nEsperamos que se unan a esta celebracin donde ms de 15 presentaciones y 300 artistas harn de Bogot una fiesta de pera.\r\n<br><br>La propuesta realizada en asocio con la Universidad Pedaggica Nacional hace un recorrido histrico y estilstico a travs de la historia del canto lrico incluyendo obras de Handel, Mozart, Beethoven y Rossini conjugados con una propuesta didctica que ilustra al pblico las caractersticas del repertorio y su importancia en el marco histrico y musical.','../eventimg/954040744Museo Nacional.png','Museo Nacional',2,'Bogot','https://www.facebook.com/orquestafilarmonica','filarmonibogota','Orquesta Filarmnica de Bogot','PREGUNTAS FRECUENTES\r\n> Existe restriccin de edad para los asistentes al evento?\r\nNo existe restriccin de ingreso.\r\n> El teatro cuenta con parqueadero?\r\nEl teatro no cuenta con parqueaderos,pero existen parqueaderos de servicio pblico en las calles aledaas. Cll 27 entrecarrera 6ta y 7ma, Cll 28 entre carrera 5ta y 7ma y Cll 29 entre carrera 5ta y 6ta.\r\n> Tengo que llevar mi tiquete impreso el da del evento?\r\nSi, para la entrada al teatro es necesario llevar impreso su tiquete de registro.\r\n> Cmo puedo contactarme en caso de tener preguntas adicionales?\r\nPuede contactarse con la oficina de Msica Acadmica de la Orquesta Filarmnica de Bogot al (571) 288 99 88 Ext 105-106 o a los correos jtorres@ofb.gov.co / rromero@ofb.gov.co',1,815,57,1,'PUB',2,'2015-09-24 11:33:30','','https://www.youtube.com/watch?v=NYq2bl6BQgM',0,0,'2015-9-24 11:25:07'),(438,16,'XVIII Festival de pera al Parque - Hansel und Gretel','<b><i>La Orquesta Filarmnica de Bogot realizar este ao el XVIII Festival de pera al Parque del 11 al 21 de Octubre de 2015.\r\n</i></b><br><br>El Festival tiene por objetivo acercar el gnero lrico y la pera a toda la ciudadana, para lo cual han sido seleccionados espectculos de calidad, incluyendo la Jornada al Parque el da 11 de Octubre en el Parque de la 93 con programacin desde la 1:00 P.M.\r\nTodas las presentaciones artsticas sern abiertas al pblico y de entrada libre.\r\nEsperamos que se unan a esta celebracin donde ms de 15 presentaciones y 300 artistas harn de Bogot una fiesta de pera.\r\n<br><br>Hansel und Gretel, de Engelbert Humperdinck, propuesta producida por la Universidad Central es una de las peras alemanas ms importantes de finales del siglo XIX y una de las preferidas en cuanto a temtica infantil y familiar.\r\nCombina un lenguaje musical cercano a Strauss, Wagner y Mahler con la fantasa infantil del cuento de los hermanos Grimm.','../eventimg/955649421Fundacin Gilberto Alzate Avendao.png','Fundacin Gilberto Alzate Avendao',2,'Bogot','https://www.facebook.com/orquestafilarmonica','filarmonibogota','Orquesta Filarmnica de Bogot',' PREGUNTAS FRECUENTES\r\n> Existe restriccin de edad para los asistentes al evento?\r\nLa restriccin de edad mnimo es de 7 aos.\r\n> El teatro cuenta con parqueadero?\r\nEl teatro no cuenta con parqueadero\r\n> Tengo que llevar mi tiquete impreso el da del evento?\r\nSi, para la entrada al teatro es necesario llevar impreso su tiquete de registro.\r\n> Cmo puedo contactarme en caso de tener preguntas adicionales?\r\nPuede contactarse con la oficina de Msica Acadmica de la Orquesta Filarmnica de Bogot al (571) 288 99 88 Ext 105-106 o a los correos jtorres@ofb.gov.co / rromero@ofb.gov.co   ',1,744,57,1,'PUB',2,'2015-09-24 12:14:21','','https://www.youtube.com/watch?v=NYq2bl6BQgM',0,0,'2015-9-24 12:12:23'),(439,16,'XVIII Festival de pera al Parque - El Sello de Dos Siglos B. Virgilio Barco','<b><i>La Orquesta Filarmnica de Bogot realizar este ao el XVIII Festival de pera al Parque del 11 al 21 de Octubre de 2015.\r\n</i></b><br><br>El Festival tiene por objetivo acercar el gnero lrico y la pera a toda la ciudadana, para lo cual han sido seleccionados espectculos de calidad, incluyendo la Jornada al Parque el da 11 de Octubre en el Parque de la 93 con programacin desde la 1:00 PM.\r\nTodas las presentaciones artsticas sern abiertas al pblico y de entrada libre.\r\nEsperamos que se unan a esta celebracin donde ms de 15 presentaciones y 300 artistas harn de Bogot una fiesta de pera.\r\n<br><br>El Sello de dos Siglos propuesta de la Universidad Javeriana es una gala de pera en la que se interpretarn arias y ensambles de obras de los siglos XVIII y XIX. \r\nLa gala se desarrollar a manera de concierto didctico con la participacin del musiclogo Luis Gabriel Mesa Martnez, quien contextualizar las obras del repertorio a interpretar. \r\nAlgunos de los compositores que se incluyen en el programa son Hndel, Cimarosa, Mozart, Rossini, Berlioz y Delibes, entre otros.','../eventimg/1085278821Parque Pblico Virgilio Barco.png','Parque Pblico Virgilio Barco ',2,'Bogot','https://www.facebook.com/orquestafilarmonica','filarmonibogota','Orquesta Filarmnica de Bogot','PREGUNTAS FRECUENTES\r\n> Existe restriccin de edad para los asistentes al evento?\r\nNo existe restriccin de ingreso.\r\n> El teatro cuenta con parqueadero?\r\nLa biblioteca cuenta con servicio de parqueadero pblico durante toda la jornada de servicio. El costo del servicio es de $ 8000.\r\n> Tengo que llevar mi tiquete impreso el da del evento?\r\nSi, para la entrada al teatro es necesario llevar impreso su tiquete de registro.\r\n> Cmo puedo contactarme en caso de tener preguntas adicionales?\r\nPuede contactarse con la oficina de Msica Acadmica de la Orquesta Filarmnica de Bogot al (571) 288 99 88 Ext 105-106 o a los correos jtorres@ofb.gov.co / rromero@ofb.gov.co',4,938,57,1,'PUB',2,'2015-09-24 14:44:56','','https://www.youtube.com/watch?v=NYq2bl6BQgM',0,0,'2015-9-24 14:43:12'),(440,16,'XVIII Festival de pera al Parque - La Flauta Mgica','<b><i>La Orquesta Filarmnica de Bogot realizar este ao el XVIII Festival de pera al Parque del 11 al 21 de Octubre de 2015.\r\n</i></b><br><br>El Festival tiene por objetivo acercar el gnero lrico y la pera a toda la ciudadana, para lo cual han sido seleccionados espectculos de calidad, incluyendo la Jornada al Parque el da 11 de Octubre en el Parque de la 93 con programacin desde la 1:00 PM.\r\nTodas las presentaciones artsticas sern abiertas al pblico y de entrada libre.\r\nEsperamos que se unan a esta celebracin donde ms de 15 presentaciones y 300 artistas harn de Bogot una fiesta de pera.\r\n<br><br>La propuesta ganadora de la Beca de Circulacin pera al Parque realizada por la Orquesta Filarmnica de Bogot en asocio con la Universidad del norte de Barranquilla y la Compaia Estable es un viaje fantstico lleno de misterio. Personajes de diferentes mundos se cruzan sobre el escenario para encontrarse a s mismos a travs de una bsqueda comn: la bsqueda de la trascendencia espiritual a travs del amor. <br><br>Es un viaje mstico que se abre a la aventura y a la diversin, razn por la cual est pera de Mozart ha gozado de enorme popularidad.','../eventimg/1975716373Teatro Mayor Julio Mario Santo Domingo.png','Teatro Mayor Julio Mario Santo Domingo',2,'Bogot','https://www.facebook.com/orquestafilarmonica','filarmonibogota','Orquesta Filarmnica de Bogot','PREGUNTAS FRECUENTES\r\n> Existe restriccin de edad para los asistentes al evento?\r\nNo existe restriccin de ingreso.\r\n> El teatro cuenta con parqueadero?\r\nEl Centro Cultural Biblioteca Pblica Julio Mario Santo Domingo tiene un parqueadero con cupo para 340 vehculos y 140 bicicletas. La tarifa establecida para los automviles por funcin es de $7.000 y se puede cancelar antes de entrar al espectculo, en el intermedio o a la salida.\r\n> Tengo que llevar mi tiquete impreso el da del evento?\r\nSi, para la entrada al teatro es necesario llevar impreso su tiquete de registro.\r\n> Cmo puedo contactarme en caso de tener preguntas adicionales?\r\nPuede contactarse con la oficina de Msica Acadmica de la Orquesta Filarmnica de Bogot al (571) 288 99 88 Ext 105-106 o a los correos jtorres@ofb.gov.co / rromero@ofb.gov.co',1,840,57,1,'PUB',2,'2015-09-24 15:00:14','','https://www.youtube.com/watch?v=NYq2bl6BQgM',0,0,'2015-9-24 14: