e show lleno del mejor humor negro, que invita a la resistencia desde la risa. Imperdible!\r\n<br><br>Diego Mateus es ese tipo de ser misterioso que puede llegar a intimidar si se lo cruza a media noche por una desierta calle bogotana, sin embargo no es ms que una pose de supervivencia. Es uno de los comediantes ms enrgicos y honestos de la escena colombiana, quien a partir de la conversacin con su audiencia, genera un discurso lleno de reflexiones punzantes e ideas directas sobre la humanidad. Con la particular agudeza en su discurso y su brillante capacidad para improvisar lneas de humor en sus espectculos, Diego nos lleva con este nuevo show a travs de un viaje lleno de sinceridad y desobediencia para hablar de la educacin, el consumo, la moral y otro sin fin de temas que merecen ser abordados SIN ANESTESIA.\r\n<br><br>Esta obra podra definirse como la filosofa de vida de Mateus, importaculismo ctrico en el universo de la calle, del barrio y lo cotidiano. Con una banda sonora de puro rock y un diseo cuidado en el vestuario y la escenografa, llega a la sala del Teatro Nacional Fanny Mikey, a las Noches de Stand Up de los martes y mircoles, porque va acorde con la lnea de humor, dice lo que se le antoja, y tiene un discurso lleno de interesantes reflexiones que todos hemos pensado alguna vez, pero no nos atrevemos a decir, o por lo menos no en pblico.','../eventimg/879277628SIN ANESTESIA Con Diego Matheus.jpg','Teatro Nacional Fanny Mikey',2,'Bogot','https://www.facebook.com/diegomatteus','diegomatteus','FUNDACION TEATRO NACIONAL ','Ficha tcnica:\r\nDirector y dramaturgo: Diego Mateus\r\nDirectora de arte: Maddalena Zanardi\r\nIluminacin: Daniel Caldern / DECA\r\nVestuario: Maddalena Zanardi\r\nMsica: Danny Jones\r\nCortinas y audios: Felix Riao\r\nProductor de campo: David Martinez\r\nProductor ejecutivo: Daniel Caldern\r\nComediante: Diego Mateus    ',2,222,57,1,'PUB',2,'2015-10-06 17:22:21','','https://www.youtube.com/watch?v=Y0JrgQiImDc',0,0,'2015-10-6 17:18:18