u opciones de transporte/aparcamiento tengo para llegar al evento?</b>\r\nEn Seal Colombia no hay parqueadero para externos. Puede dejar el carro en la calle de al frente, pero es bajo su responsabilidad. \r\n<br><br><b>El nombre del registro/entrada no coincide con el asistente. Hay algn problema?</b>\r\nSlo decir que va al Vivelab Bogot.','../eventimg/2080747376somos idesas.jpg','Vivelab Bogot, Cra 45 # 57b-05',2,'Bogot','https://www.youtube.com/watch?v=TMQuAwURJB4','BogotaAbierta','Vivelab Bogot','Equipo de Bogot Abierta.   ',8,987,57,1,'PUB',2,'2015-10-13 15:31:13','','https://www.youtube.com/watch?v=TMQuAwURJB4',0,0,'2015-10-13 15:29:01'),(479,16,'Decisiones estratgicas para un estreno cinematogrfico','<b><u>Conversatorio:&nbsp;Decisiones estratgicas para un estreno cinematogrfico<br></u></b><br><i>5 Puntos claves para la distribucin y marketing de una pelcula\r\n</i><br><br>En el marco de la semana de los encuentros presenciales de la Convocatoria del Fondo para el Desarrollo cinematogrfico <b>FDC -2015</b> invitamos a cuatro expertos en mercadeo y distribucin cinematogrfica para conversar sobre los puntos claves y el panorama actual en el rea.\r\n<br><ul><li>Qu se debe tener en cuenta a la hora de crear las estrategias de mercadeo? </li></ul><ul><li>Cmo han evolucionado las herramientas y cmo aprovecharlas? </li></ul>Este conversatorio brindar un espacio para discutir sobre el papel del marketing, la importancia de pensar en el pblico y los aspectos fundamentales para el desarrollo de una buena campaa promocional.\r\n \r\n<br><br><b><i>Entrada libre y gratuita</i></b>','../eventimg/399084757Proimgenes Colombia.jpg','Cinemateca Distrital, Cra 7 # 22 - 79',2,'Bogot','https://www.facebook.com/tengounapelicula','Tengounapeli','Proimgenes Colombia','    ',6,1099,57,1,'PUB',2,'2015-10-23 15:25:57','','https://www.youtube.com/watch?v=nVL-ltdWeKY',0,0,'2015-10-23 15:12:37'),(480,16,'Evernote Meetup en Colombia - Sesin 1','<b><i>Estamos felices de anunciar que Evernote estar en Colombia por primera vez! <br></i></b><br>Nuestro equipo de Evernote viajar desde Silicon Valley a Bogot para celebrar grandes noticias junto con nuestros usuarios del pas.\r\n<br><br>Los invitamos a acompaarnos en el primer Evernote Meetup en Bogot el da jueves, 29 de octubre a las 5 pm en Impact Hub. Durante este evento de celebracin les compartiremos diferentes tips de productividad para que puedan sacarle el mximo provecho a nuestra herramienta en su da a da personal y profesional. <br><br>Tambin contaremos con la presencia de un invitado especial quien nos compartir cmo usa Evernote en su vida profesional. \r\n\r\nAs que no se pierdan de este gran evento, donde podrn conocer a nuestro Gerente General para Amrica Latina, Luis Samra, y al resto del equipo de Amrica Latina.\r\n<br><br>Tambin estaremos sorteando algunos regalos de Evernote a los participantes del evento.\r\n<br><br><b>Los esperamos!</b>','../eventimg/583307634Evernote Meetup en Colombia - Sesin 1.png','mpact Hub, Calle 69 # 6 - 20',2,'Bogot','https://www.facebook.com/evernoteAL/','Evernote_latam','Evernote Amrica Latina','Evernote, la aplicacin mvil lder en productividad, ayuda al mundo a recordar todo a travs de sus aplicaciones y servicios que permiten al usuario capturar, encontrar e interactuar con sus memorias. Evernote cuenta con ms de 150 millones de usuarios a nivel global y ms de 15 millones de usuarios en Amrica Latina. La herramienta est disponible en todas las plataformas de computadoras, web, mviles y tablets. Para obtener ms informacin acerca de Evernote, por favor visita nuestro website.    ',8,1061,57,1,'PUB',2,'2015-10-23 15:52:28','','https://www.youtube.com/watch?v=kEra9zR6Cf8',0,0,'2015-10-23 15:48:12'),(481,16,'Qu es ser un ciudadano digital?','<b><u>III Semana del Libro y la Lectura en Digital de la Biblioteca Nacional de Colombia</u></b>\r\n<br><br><b>Software libre, plataformas de creacin colectiva, datos abiertos enlazados:</b> las nuevas tecnologas de la informa