oco tiempo, ella se convirti en una hermosa mujer llamada Claudia de Colombia.\r\nLa artista transforma la letra de cada cancin en un sentimiento; estas caractersticas son su sello personal y esencia como artista. Han pasado 40 aos desde ese da, en que la tierna Claudia de Colombia dio paso a primera cantante internacional que tuvo el pas, pero su belleza y talento siguen intactos, como si el tiempo no hubiera pasado, como s sus canciones an estuvieran en la radio. Regresa a Cali para deleitarnos con temas que la catapultaron como Ro Badillo y Cuando voy por la calle. Y canciones nuevas pegajosas y llamativas (Mentiras blancas). Julio Snchez Cristo bautiz la obra: Toda una vida con Claudia de Colombia Fue la cantante ms internacional que tuvimos en los aos 70. Eran los tiempos en que la voz lo era casi todo. No haban llegado los videos y las pequeas pelculas que hoy se montan alrededor de una sola cancin.\r\n</div>','../eventimg/1169361146clao.gif','Teatro Jorge Isaacs, Cali',2,'Cal ','','','http://vive.tuboleta.com/shows/show.aspx?sh=CLAUDIAC16','Edad mnima de ingreso 18 aos\r\nLos precios de Preventa son hasta el da 06 de Febrero de 2017, y precio full desde el da 07 de Febrero de 2017.\r\n',1,192,57,1,'PUB',2,'2017-01-26 22:25:21','','',0,0,'2017-1-26 22:06:23'),(505,1,'El hombre reina y la mujer gobierna por Luz Estrada ','Protagonizada por Luz Estrada ganadora del Premio India Catalina 2016 como Mejor Actriz Antagnica por su papel como Sonia Monsalve en Las Hermanitas Calle y premiada en 2012 como Mejor Monlogo por el Instituto Distrital de las Artes de Bogot, es una comedia que ha conquistado al pblico de Bogot, Medelln, Barranquilla y Miami. \r\n\r\nEsta disparatada historia de la humanidad, es una particular y divertida reflexin acerca del poder que han tenido los mal medidos encantos femeninos desde el paraso terrenal hasta nuestros das y nos demuestra que las mujeres, sin hacer mucho alboroto, han tomado algunas de las decisiones ms importantes de nuestra 