na de las bandas ms importantes del rock llega a Colombia en el momento cumbre de su carrera. La cita con el poder de Korn ser en la Carpa Corferias el 17 de abril, y Bogot ser testigo de una noche que estallar con caracterstico sonido en vivo lleno de energa y poder. \r\n\r\nLa banda californiana visita Colombia en el marco de la gira de promocin de su ms reciente lanzamiento de The serenity of suffering, su nuevo lbum, nmero 12 de su trayectoria y una muestra clara de la reinvencin del rock pesado en toda su expresin. Hasta la fecha, Korn ha vendido ms de 60 millones de lbumes en todo el mundo y han obtenido siete nominaciones a los premios Grammy, de los cuales han Ganado dos. \r\n\r\n\"Rotting In Vain\", primer sencillo promocional de esta nueva placa discogrfica, alcanz el cuarto puesto del ranking en las radios del formato Active Rock en Estados Unidos y mantiene la cuarta posicin del ranking de Temas Rock de Billboard por 13 semanas consecutivas. \"Insane\" y \"A Different World\" (junto a Corey Taylor de Slipknot) fueron otras canciones que Korn haba lanzado las ltimas semanas para adelantar su regreso discogrfico. \r\n\r\nEste lbum ubica a Korn en el mejor momento de su carrera y a sus miembros, Jonathan Davis (vocal), James Munky Shaffer (guitarra), Reginald Fieldy Arvizu (bajo), Brian Head Welch (guitarra) y Ray Luzier (batera) en una maquina emocional que libera toda su ira explorando su lado ms oscuro y sus emociones ms fuertes, transformndolas en canciones.','../eventimg/1283225725Korn_635_635_s_c1.jpg','Gran Carpa Amricas - CORFERIAS',2,'Bogot ','','','','    Edad mnima de ingreso 18 aos\r\n',1,318,57,1,'PUB',2,'2017-01-30 21:18:45','','',0,0,'2017-1-30 21:09:24'),(513,1,'Guaco ','Guaco no se detiene:\r\nva contigo con msica, video, arte y cine\r\n\r\nEl pasado 30 de septiembre La Sper Banda de Venezuela present nueva cancin, videoclip y un triler cinematogrfico como un adelanto a lo que sern sus grandes producciones este 2017\r\n\r\nLa cancin Lgrimas