antes del panorama musical de los ltimos aos, y uno de los artistas ms queridos y admirados de habla hispana y visita nuestro pas iniciando una imparable etapa musical y en el mejor momento de su carrera con el lanzamiento de: Qutate las gafas. Este es el octavo trabajo discogrfico del artista espaol, producido en su totalidad por l mismo y compuesto por once temas con una faceta y composicin ms dulce, este disco incorpora ritmos latinos en algunas de sus canciones y denota una clara madurez musical e interpretativa que ha tenido una gran acogida entre su pblico, siendo Quitate las Gafas el disco ms vendido de las pasadas navidades en Espaa. \r\n\r\nMelendi se abre a nuevas sonoridades, con un disco que reivindica como motor de cambio el conocimiento, adems, presenta la primera colaboracin de su carrera con, \"Mi mayor fortuna\", junto al grupo colombiano ChocQuibTown.\r\nMelendi transmite sentimientos y situaciones cotidianas, entre personas de todas las generaciones, logrando con ello una extraordinaria conexin con su pblico. ','../eventimg/1369271976Melendi.jpg','Royal Center',2,'Bogot','','','PRISA MSICA AMRICA S.A.S','Edad mnima de ingreso 14 aos',1,201,57,1,'PUB',2,'2017-01-30 22:13:31','','',0,0,'2017-1-30 22:13:02'),(515,1,'Concierto Carnaval Puerta de Oro ','Para celebrar el carnaval con los grandes\r\n- Carlos Vives\r\n- Silvestre Dangond\r\n- Nicky Jam','../eventimg/1105680385carlosvives.png','Centro de Convenciones Puerta de Oro',2,'Barranquilla','','','ELEVA GROUP S.A.S','Edad mnima de ingreso 18 aos\r\n',1,196,57,1,'PUB',2,'2017-01-31 23:40:41','','',0,0,'2017-1-31 23:34:11'),(516,1,'La fbrica de la felicidad ','Fbrica de la felicidad es un programa de liderazgo para integrar cuerpo, mente y emocin en cada actividad que realices. Es un seminario vivencial, con tcnicas de alto impacto donde eres t el protagonista\r\n\r\nTe llevamos a despertar, reencontrar y conectar nuevamente con todo el poder que llevas dentro. Pondrs a prueba las creencias limitantes que hasta ahora no han permitido que consigas los resultados que quieres para tu vida\r\n\r\nCaminaras sobre brasa y tambin sobre vidrio entre otras ms actividades donde experimentaras que TODO LO QUE NECESITAS ESTA DENTRO DE TI.\r\n Contar con Conferencistas Internacionales y Nacionales\r\nConferenciante Internacional\r\n	Juan Paulo Pinochet A. \r\nPresidente ejecutivo H3 Coaching\r\nCoach Life\r\n\r\nConferenciantes nacionales\r\n	Alejandro Ortiz\r\n	David Mario\r\n	Jurani Bautista\r\n	Katherine Herrera\r\n	Paula Idarraga\r\n	Tatiana Macias\r\n	Wilson Vsquez\r\n\r\n\r\nES TU TIEMPO, ES TU MOMENTO DE IR POR RESULTADOS EXTRAORDINARIOS. ES AHORA\r\n','../eventimg/553556879la fabrica de la felicidad.jpg','Centro Social de Agentes y Patrulleros',2,'Bogot ','','','ESCUELA REINGENIERIA VIDA S.A.S','Seminario Incluye: \r\n\r\n	Material de apoyo\r\n	Zona de hidratacin\r\n	Almuerzo',6,176,57,1,'PUB',2,'2017-01-31 23:58:23','','',0,0,'2017-1-31 23:57:52'),(517,1,'Dos mujeres sin camino ','La primera con su dulzura, su carisma y su caracterstica sonrisa nos presentara su Stand Comedy <b>NO NAC PARA SUFRIR,</b> en donde sin rodeos ni tapujos<b> Yaneth Waldman</b> se atreve a decir las mentiras y las verdades que cualquier otra mujer escondera.\r\n\r\nUn monlogo con muchas voces. Entre risa y llanto una profunda y conmovedora confesin. NO NAC PARA SUFRIR... la prueba perfecta de que en la vida se sufre tanto como se goza.\r\n\r\nLas carcajadas estarn aseguradas con la mujer de la risa ms conocida del pas.\r\n\r\nTmelo como un manual para descubrir a un esposo infiel, o como una gua imperfecta para lidiar con los hijos adolescentes.\r\nQuiz sea la clave para sobreponerse a los malos negocios del (ex)marido, o simplemente el curso para tolerar el mal gusto de la amante<br>La segunda con su humor negro los espectadores podrn disfrutar de un espectculo de la cruda y divertida realidad con<b> Alejandra Azcarate&nbsp;</b>.\r\nLos celos, la constante bsqueda de pareja, las frustraciones, el matrimonio, los ex, la luna de miel, las suegras, la convivencia el sexo y la infidelidad, son algunos de los temas que Alejandra toca desde una perspectiva femenina ms no feminista, ya polmica, controvertida, rpida, divertida y franca como su protagonista son las caractersticas centrales de este show.','../eventimg/1169331356dosmujeres.jpg','Auditorio las Bethlemitas',2,'Bogot','','','CORPORACION ARTISTICA EN ESCENA http://vive.tuboleta.com/sho','Edad mnima de ingreso 14 aos \r\n',2,154,57,1,'PUB',2,'2017-02-01 12:35:56','','',0,0,'2017-2-1 12:30:54'),(518,1,'16 Cumbre Mundial de Premios Nobel de Paz Bogot 2017','La Cumbre Mundial de Premios Nobel de Paz es reconocida internacionalmente como el evento anual ms importante en el campo de construccin de la paz, reuniendo laureados del Premio Nobel de Paz, lderes de alto perfil, organizaciones, estudiantes y docentes universitarios de todo el mundo desde 1999. \r\nEn los ltimos 14 aos, las Cumbres Mundiales de Premios Nobel de Paz han sido honradas con la participacin de numerosos galardonados con el Premio Nobel de Paz y organizaciones de Premios Nobel de Paz, incluyendo a: Mijal Gorbachov, Su Santidad el Dali Lama, Shimon Peres, scar Arias Snchez, Lech Wasa, Jimmy Carter, Jos Ramos-Horta, Dr. Shirin Ebadi, Lord David Trimble, John Hume, Kim Dae Yung y otros lderes mundiales reconocidos.\r\n\r\nLa Cumbre tiene lugar anualmente en diferentes ciudades en todo el mundo en cooperacin con las ciudades participantes y el apoyo de varias fundaciones y organizaciones de Premios Nobel de Paz.\r\n\r\nLa Cumbre es la conversacin y la plataforma ms importante del mundo en el campo de la construccin de paz, la reconciliacin y su relacin con el desarrollo. La Cumbre se ha realizado desde 1999 en ciudades emblemticas para la paz mundial (Pars: Declaracin de Derechos Humanos; Berln: Reunificacin Alemana; Hiroshima: Desarme Nuclear; entre otras). En esta oportunidad, Bogot fue elegida y ser la sede mundial de este importante dilogo universal.\r\n\r\nLa eleccin de Bogot como ciudad sede es producto del liderazgo de la Cmara de Comercio de Bogot, en representacin del empresariado de la ciudad y la regin y es tambin una manifestacin de la sociedad civil, que busca avanzar en la reflexin sobre los retos de la construccin de paz y plantear escenarios de accin desde el sector privado a largo plazo.\r\n\r\nDurante la Cumbre, esperamos la visita de cerca de 20 laureados con el Premio Nobel de Paz y varios lderes mundiales, de los cuales aprenderemos e intercambiaremos experiencias sobre la construccin de paz y la reconciliacin. Adicionalmente, luego de la Cumbre, Bogot ser declarada Ciudad de la Paz y pondremos en marcha proyectos e iniciativas que los laureados y sus organizaciones acompaarn y asesorarn. \r\n\r\nEn el marco de la Cumbre, entregaremos dos reconocimientos a figuras mundiales que hayan aportado a la construccin de paz. En cumbres anteriores, han recibido estos reconocimientos personajes como, Bernardo Bertolucci, George Clooney, Bob Geldoff, Bono, Sean Penn, entre otros.','../eventimg/1136445913nobelpaz.png','Corferias',2,'Bogot ','','','http://www.bogota-nobelpeacesummit.com/index.php/es/','Para el ingreso estarn habilitadas: la entrada de la Avenida La Esperanza con carrera 40 y la entrada principal de Corferias Carrera 37 nro. 24-67.\r\n- Pueden ingresar nicamente las personas que se registraron previamente, presentando el documento de identidad para validar el registro. \r\n- No se admitir el ingreso de menores de 14 aos de edad.\r\n',6,137,57,1,'PUB',2,'2017-02-01 21:34:12','','https://www.youtube.com/watch?v=OCFPdeRjRYk',0,0,'2017-2-1 21:13:41'),(519,1,'INSPIRA Un festival diferente ','Tomate un tiempo para respirar con lo mejor de la Msica nacional.  El festival Inspira es un evento anual en el que se llevaran a cabo varias actividades y habrn muchas sorpresas.\r\nEste ao disfrutaras de lo mejor de: Mike Bahia, Alkilados, Martina la Peligrosa y Sebastian Yatra.\r\nUn espec