es humanos?... Es antinatural que un hombre este enamorado de su esposa?... Interrogantes como estos, son los que Engendros pretende develar.\r\n\r\nTIPS\r\nSi no es el amor, qu carajos es lo que mantiene unidas a las parejas?\r\nUna computadora puede resultar ms humana que los humanos?\r\nRealmente es posible mantener eternamente engaada a la pareja?\r\nQu demonios hace un heterosexual en la Marcha Gay?','../eventimg/1450073129engendros-1200x600.jpg','Auditorio ABC - Calle  104 #17-20',2,'Bogot ','','','GRUPO ALTAVISTA INC','    Edad mnima de ingreso 14 aos \r\n',2,261,57,1,'PUB',2,'2017-02-02 20:53:17','','',0,0,'2017-2-2 20:52:28'),(523,1,'Silvestre Dangond - Bogot','Silvestre Dangond llega a Bogot con su Gente Valiente World Tour.','../eventimg/1824727010silvestre_dangond.jpg','Centro de Eventos Autopista Norte',2,'Bogot ','','','Stage S.A.S','Edad Mnima: 18 Aos\r\nPreventa hasta el 4 de Marzo\r\n',1,338,57,1,'PUB',2,'2017-02-09 00:09:34','','',0,0,'2017-2-2 21:49:04'),(524,1,'MORAT EN SAN VALENTIN','Andan diciendo por la calle que este San Valentn todos los enamorados de Morat podrn cantar junto a ellos y algunos invitados todas esas canciones que les llegan al alma.\r\n\r\nNo queremos que ningn enamorado sin importar su edad se pierda esta ocasin tan especial, por eso mismo contaremos con dos presentaciones.','../eventimg/1446496493morat.jpg','Centro Cultural Gimnasio Moderno',2,'Bogot ','','','MELIPA SAS - SERGIO RODRIGUEZ','    Edad mnima de ingreso 14 aos \r\n',1,147,57,1,'PUB',2,'2017-02-02 23:06:07','','',0,0,'2017-2-2 23:03:01'),(525,1,'Soy Luna - Concierto Barranquilla','<b>Soy Luna</b> en Concierto, con el elenco encabezado por Karol Sevilla, ofrecer una puesta en escena impactante y un gran despliegue musical con canciones originales de la serie. <br><br>La msica de Soy Luna es un xito: sus dos lbumes,<b> Soy Luna</b> y <b>Msica en T,</b> a la fecha llevan ms de 29 millones de reproducciones en Spotify y 205 millones de reproducciones en VEVO.\r\n<br>