dos dcadas ha sabido constituirse como un pilar del rock en espaol. El 14 de marzo los argentinos se presentarn en Armando Music Hall en un show mezcla de glamour y clase.<br><br>Ya a inicios de los 90 Babasnicos se enfrentaba a una aventura que los llevara por mares de gneros y sonidos nunca antes explorados.<br><br>Bogot y los Babasnicos son viejos conocidos, pues la capital de Colombia ha servido como plaza de coqueteo y descubrimiento para los msicos argentinos. Numerosas presentaciones han generado un romance entre sus fieles seguidores y los prodigiosos artistas. Vuelven una vez ms cargados de clase y experiencia, pero siempre con esa juventud que los caracteriza, &nbsp;en lo que ser una noche nostlgica y memorable.','../eventimg/1382531690babasonicos_1170x450.jpg','Armando Music Hall',2,'Bogot ','','','SUEO ESTEREO S.A.S.','    Edad mnima de ingreso 18 aos\r\n',1,199,57,1,'PUB',2,'2017-02-03 23:04:59','','',0,0,'2017-2-3 22:50:05'),(528,1,'Silvestre Dangond ','Gente Valiente World Tour de Silvestre llega a Ccuta','../eventimg/277567538silve.jpg','Plaza De Banderas',2,'Ccuta ','','','D&G Eventos S.A.S.','Edad Mnima: 18 Aos\r\n\r\nPreventa 1 (PV1) hasta el 04 de Marzo\r\nPreventa 2 (PV2) hasta el 06 de Mayo\r\nPreventa 3 (PV3) hasta el 20 de Mayo\r\n\r\n',1,322,57,1,'PUB',2,'2017-02-05 19:55:59','','',0,0,'2017-2-5 19:23:26'),(529,1,'La historia ilustrada del sexo ','Tras su arrollador xito a nivel nacional, el teatro ASTOR PLAZA se complace en ofrecer dos nicas funciones especiales de esta divertidsima comedia que catapult a la querida Flavia Dos Santos como actrz de teatro al lado del talentoso Fernando Solrzano. <br><br>La reconocida sexloga brasilera y El flaco nos hacen un repaso por la sexualidad de nuestros antepasados hasta la modernidad. El propsito? contarnos la historia de la humanidad en un solo acto: el acto sexual. <br><br>&nbsp;Acompaados de dos bailarines y un elenco que abarca desde el pitecntropos erectus, pasando por los filsofos griegos, hasta el hombre moderno, nos cuentan LA HISTORIA ILUSTRADA DEL SEXO y nos ensean cmo cada logro y cada avance alcanzados por el hombre de cualquier poca, han tenido como motor y punto de partida: las posiciones sexuales. \r\n\r\nLA HISTORIA ILUSTRADA DEL SEXO nos har entender en una hora y veinte minutos por qu, desde el principio de los tiempos, el sexo ha sido el poder detrs, delante, encima y debajo del trono. \r\n\r\nPreprate para conocer informacin que de manera muy divertida, podr contribuir a mejorar tu vida en pareja.','../eventimg/1450542091La-historia-ilustrada-del-sexo.jpg','Teatro Astor Plaza',2,'Bogot','','','Astot Plaza Sala de Eventos LTDA ','Edad mnima de ingreso 16 aos\r\n',2,149,57,1,'PUB',2,'2017-02-05 20:19:55','','',0,0,'2017-2-5 20:09:38'),(530,1,'Carnaval de Verdad ','PORQUE ANGLO ES ANGLO!\r\n<br><br>&nbsp;La gran fiesta en Barranquilla se vive ste ao con<b> El Carnaval de Verdad</b>, evento que contar con la espectacular presentacin del puertorriqueo <b>ANDY MONTAEZ</b>, ex-vocalista del gran combo de Puerto Rico con todos sus exitos y en mano a mano los dominicanos <b>SERGIO VARGAS y BONNY CEPEDA</b> con xitos como \"Cuarto de hotel\", \"Asesina\", \"Por ella\", \"La ventanita\", \"La quiero a morir\", entre otras.<br><br>Por Colombia el vallenato de Los Betos con sus exitos \"Gitana\" y  \"La dama del ajedrez\" y finalmente por la Republica Independiente de Barranquilla el Principe Del Carnaval <b>CHECO ACOSTA</b>.\r\n \r\nEl club Anglo estar preparado con sillas, mesas, parqueadero, vigilancia privada, pista de baile y precios de locura.','../eventimg/1852827356anglo.jpg','Club Anglo - Calle 81 con Carrera 38 ',2,'Barranquilla','','','H & H Eventos SAS','Edad Minima 18 aos\r\n*La localidad VIP cuenta con sillas y mesas NO NUMERADAS*\r\n',1,171,57,1,'PUB',2,'2017-02-05 21:20:10','','',0,0,'2017-2-5 21:12:33'),(531,1,'Lego Fun Fest','Cerca de un milln de ladrillos de <b>LEGO</b> aterrizarn en Bogot en 2017, ofreciendo una experiencia interactiva para toda la familia con juegos, espectculos y actividades de lujo.Los asistentes encontrarn dos piscinas de LEGO, areas de la marca como \"<b>LEGO City</b>\" y \"<b>LEGO Friends\"</b>.Asimismo, y como si fuese el sueo de cualquier colombiano en su infancia, LEGO recrear a escala gigante el mapa del pas. \"Un evento que invita a crear, disear y entretenerse\", seal Viviana Gmez, jefe del proyecto.<br><br>El<b> \"LEGO Fun Fest\" </b>es un espacio de entretenimiento para chicos y grandes. Todos los fans de este juego creativo, que consiste en construir con bloques todo tipo de objetos, podrn participar en diferentes zonas de construccin guiadas.Estas estarn disponibles para todas las edades y los asistentes se divertirn con las mltiples competencias que ponen a prueba la creatividad y la destreza.Asimismo, tomarse fotografas con sus personajes favoritos hechos con fichas de este legendario juguete.','../eventimg/621875915Lego-fun-festjpg_0.jpg','Corferias',2,'Bogota','','','','* Lunes a viernes de 8:00 a.m. a 7:00 p.m.\r\n\r\n* Sbados y domingos de 8:00 a.m. a 1:00 p.m. y de 2:30 p.m. a 7:30 p.m\r\n\r\n* Entradas del evento en Taquillas de Corferias',5,214,57,1,'PUB',2,'2017-02-06 21:14:55','','',0,0,'2017-2-6 20:19:23'),(532,1,'Ana Gabriel - Recopilando Amor - Bogot ','Llega a Bogot la Reina de la Ranchera y la Balada<b> Ana Gabriel&nbsp;</b>con su Tour Recopilando amor - Noche de Gala&nbsp;','../eventimg/10873840ana8a.jpg','Centro de Eventos Autopista Norte',2,'Bogot','','','Eventos Colombia CL','    Edad Mnima: 18 Aos\r\n',1,297,57,1,'PUB',2,'2017-02-06 20:50:09','','https://www.youtube.com/watch?v=js8X0IeJGEY',0,0,'2017-2-6 20:28:55'),(533,1,'Seminario Reforma Tributaria Estructural ','<b>Justificacin</b>: Sancionada con fecha 29 de diciembre de 2016, la ley 1819 contiene la denominada Reforma Tributaria Estructural, cuarta reforma tributaria del actual Gobierno Nacional. La nueva ley ha trado cambios sustanciales en los impuestos nacionales, que van desde modificaciones en el hecho generador de los impuestos, pasando por crear nuevos regmenes tributarios, ampliar el Estatuto Tributario con nuevos libros y penalizar la evasin.\r\n\r\n<br><b><br>Objetivo General: </b>Conocer y estudiar los cambios en los sistemas impositivos y en el tratamiento fiscal a los contribuyentes contenidos en la Reforma Tributaria Estructural, brindando al asistente un panorama claro sobre el nuevo tratamiento fiscal e impositivo.\r\n\r\n<br><br><b>Metodologa: </b>Con el fin de que el asistente comprenda y entienda el contenido del seminario, se realizar la presentacin terica de cada uno de los temas, ejemplos y anlisis de casos prcticos.<br><br><b>Dirigido a: </b>Empresarios, Gerentes, Directores financieros, Contadores Pblicos, Revisores Fiscales, Abogados, Economistas, Especialistas en Tributacin, Funcionarios Pblicos, Asesores Tributarios y en general a todas las personas comprometidas con el tema de la tributacin e impuestos','../eventimg/1728424438seminario.jpg','Hotel Double Tree By Hilton',2,'Bogot ','','','BCP COLOMBIA	','INCLUYE:\r\n- Refrigerio\r\n- Almuerzo\r\n- Material de apoyo\r\n- Certificado de asistencia\r\n- Copia de las presentaciones',6,134,57,1,'PUB',2,'2017-02-06 21:48:08','','',0,0,'2017-2-6 21:44:04'),(534,1,'Fito Paz - Solo Piano ','Fito Pez uno de los ms grandes msicos latinoamericanos de todos los tiempos, regresa a Bogot con su concierto Solo Piano, despus de casi cuatro aos de no ofrecer este recital en formato ntimo y personal, con el que el cantautor lleva en un emotivo viaje de canciones y grandes xitos, a todos los espectadores.<br><br>&nbsp;El autor de \"Mariposa Tecknicolor\", entre muchas otras, actuar solamente acompaado de su piano en el escenario del Teatro Jorge Elicer Gaitn de Bogot los das 11 y 13 de marzo, a partir de las 8 de la noche, en una velada con la que espera eclipsar a sus fanticos, una vez ms.\r\n<br><br>Fito Pez realiza desde hace algunos aos, una gira de conciertos Solo piano, con gran reconocimiento por parte del pblico y la crtica nacional e internacional.\r\nEsta gira lo ha llevado a ciudades como Santiago de Chile, Ro de Janeiro y Porto Alegre Brasil, Madrid, Israel, Londres, Miami, Bogot y Medelln en Colombia y DF Mxico, entre otras plazas, que han tenido el privilegio de deleitarse con sus grandes clsicos en este formato tan ntimo.','../eventimg/832111010fito paez.jpg','Teatro Jorge Elicer Gaitn',2,'Bogot ','','','ARTE Y CULTURA PRODUCCIONES SAS ','    ',1,161,57,1,'PUB',2,'2017-02-07 21:14:11','','',0,0,'2017-2-7 21:12:05'),(535,1,'Toc Toc, una comedia obsesiva y compulsiva','Seis personajes coinciden en la sala de espera de un afamado especialista. Todos sufren diferentes tipos de Trastornos Obsesivos Compulsivos, la ansiedad los traiciona provocando miedo, nerviosismo, inquietud y comportamientos repetitivos El enredo se suscita cuando el reconocido mdico jams se presenta y acaben siendo ellos mismos quienes saquen sus propias conclusiones.','../eventimg/1624690863toc-toc-teatro-libre-chapinero-bogota-2016-facebook.jpg','Teatro Libre de Chapinero',2,'Bogot','','','FUNDACIN TEATRO LIBRE DE BOGOT','    Edad mnima de ingreso 12 aos\r\n',2,180,57,1,'PUB',2,'2017-02-07 22:15:15','','',0,0,'2017-2-7 22:10:38'),(536,1,'La Dama de Negro ','La experiencia teatral de terror ms importante del mundo llega a Casa E<br><br>&nbsp;Arthur Kipps, un hombre de mediana edad, atormentado por escabrosas experiencias vividas aos atrs en un pueblo de Londres tiene la necesidad de contarle a su familia y amigos los recuerdos que le atormentan. Para ello se junta con un joven actor, Jhon Morris, con quien recrear los sucesos que haba callado durante muchos aos.\r\n\r\nUna puesta en escena con 23 aos de representaciones seguidas en Mxico e Inglaterra.<br><br><b>&nbsp;Vas a venir ... o tienes miedo?\r\n</b><br><br>Con la actuacin especial de:<br>- Robinson Daz (Colombia) y Rafael Perrn (Mxico)\r\n<br>- Direccin: Rafael Perrn','../eventimg/984005487damadenegro.jpg','Casa