etratar de manera divertida estas situaciones. Dora (Mara Helena Doering) y Jorge (Juan Pablo Gamboa) estn al borde de acabar con su matrimonio pero gracias a sus amigos Leo (Julio Pachn) y Susana (Adriana campos) y a los divertidos tips, ellos reconsideran la situacin y deciden aplicar esos consejitos que terminan convirtindose en divertidas herramientas de seduccin. Tcnicas para Amar no es solo una maravillosa comedia, es un gracioso retrato sobre las parejas que se dejan arrastrar por la rutina pero que deciden apostarlo todo por su relacin, no se pierdas esta maravillosa oportunidad de aprender alguna de estas tcnicas','../eventimg/2032584179tecnicas-para-amar-2.jpg','Teatro Sala Belartes',2,'Bogot ','','','ARTES Y ESPECTACULOS PRODUCCIONES SAS ','    Edad mnima de ingreso 18 aos\r\n',2,182,57,1,'PUB',2,'2017-02-09 00:44:47','','',0,0,'2017-2-9 00:42:24'),(540,1,'Que desgracia tan infinita!','<b>QUE DESGRACIA TAN INFINITA!<br><br></b>&nbsp;A partir de los cuarenta solo queda morirse de la risa, &nbsp; Qu desgracia tan infinita, una obra para rernos de nosotros mismos.<br><br>Los cuarenta aos son un punto de quiebre en la vida de cualquier ser humano. A los cincuenta, viene el quiebre completo. Ese es el tema central del monlogo de humor <b>Qu desgracia tan infinita</b>, escrita y dirigida por Diego Trujillo, y en donde el comediante es quien le cuenta a los espectadores sus experiencias con la mediana edad. <br><br>&nbsp;La verdad es que todos estamos expuestos a esa dictadura de la edad. A los veinte aos nos remos de ese to o de ese amigo que ha comenzado a comprar tratamientos contra la calvicie. A los 30, puede que aparezca esa primera cana que da el campanazo de alerta. Todo se puede manejar con relativa calma, hasta que en el ponqu del cumpleaos aparece el nmero 40 y empezamos a ver en el horizonte la inminencia del declive. \r\n\r\nEs entonces cuando a los hombres los asedian con advertencias sobre el comportamiento de la prstata. Cuando una pizza a media 