lar en pblico en 60 minutos','../eventimg/827035711web3.0.jpg','Casa de la Cultura La Barquerea',2,'Sabaneta, Antioquia ','','','Alcalda de Sabaneta y The Intern Group Colombia','Direccin: Casa de la Cultura La Barquerea\r\nCalle 68 Sur N 42  40\r\nSabaneta, Antioquia',8,125,57,1,'PUB',2,'2017-02-19 22:40:19','','',0,0,'2017-2-19 22:36:46'),(565,1,'Camilo Cifuentes - Inimitable ','El viernes 17 de marzo para festejar el mes de la mujer en el teatro Jos Consuegra Higgins el ms grande imitador de Amrica latina, KAMILO CIFUENTES a celebrar sus 20 aos de carrera artstica con su show INIMITABLE! Como la gran mayora de los humoristas, Kamilo Cifuentes inici su carrera desde muy temprana edad, imitando lo que a su gusto le llamaba la atencin: familiares, docentes, compaeros de colegio, vecinos y autoridades locales entre otros, desarrollando y perfeccionando su don de imitar, don de cantar, hasta llegar al don de hacer rer y finalmente donde poder mostrarse.\r\n<br>&nbsp;Aos ms tarde, luego de pertenecer durante su etapa universitaria al grupo de teatro de la Facultad de Medicina de la Universidad del Cauca, Anfiteatro, del cual fue fundador, y de unirse a la causa de hacer rer por hobby, termina su carrera de medicina en dicha universidad, ejerciendo su profesin durante 7 aos, pero alternndola con el arte de imitar con humor de forma espordica, pues este talento y gusto nunca se fue de su alma. Fue precisamente ese talento lo que lo llev a conformar su primer grupo de humor, donde interpretaba magistralmente personajes de talla nacional e internacional, talento que fue observado por Crisanto Vargas Vargasvil y Saulo Garca (Integrante de los Marinillos), quienes sin dudarlo lo vincularon al mgico mundo del espectculo. Fue integrante del Manicomio de Vargasvil por cerca de 2 aos, donde interpret personajes famosos como: Helenita Vargas, El Puma, Ricky Martin, entre otros.\r\n<br><br>Ganador en 4 ocasiones consecutivas del programa Sbados Felices en el ao 2.001, en el mismo ao se vincula al canal RCN Televisin, al programa La Banda Francotiradores, programa de humor poltico y de actualidad que estuvo al aire por 6 aos consecutivos realizando imitaciones de diversos personajes nacionales e internacionales, del mismo modo estuvo vinculado con el programa de humor Clonestilo y El Gran Chou por espacio de 1 ao, luego perteneci al elenco del programa Hay Con Quien del canal CITY TV, realizando todas las voces del programa y algunas intervenciones en vivo de personajes, fue humorista en la emisora Candela en el programa de la maana Azuquita pal Caf. Hoy en da se encuentra vinculado como humorista del canal CARACOL TV. Participando como COACHING del Programa YO ME LLAMO,','../eventimg/663617613camilo cifontes.jpg','Teatro Jose Consuegra Higgins',2,'Barranquilla','','','FUNDACIN CULTURA NUEVA','Preventa PV1 hasta el 5 de marzo\r\nPreventa PV2 hasta el 10 de marzo\r\n\r\n',2,157,57,1,'PUB',2,'2017-02-19 22:47:24','','',0,0,'2017-2-19 22:45:05'),(566,1,'Indignados Social Club ','El arribista, el mediocre, el fantico, el autntico falso y el indiferente son algunas de las personalidades que conocemos y odiamos, pero que somos. Con mucho humor Diego Camargo, Catalina Guzmn y Diego Mateus, acompaados por el Maestro de Ceremonias Antonio Morales Riveira intentando no herir susceptibilidades, nos divertirn con este novedoso espectculo. No es una Obra de Teatro, no es un Stand Up Comedy. Es una Stira con mucho humor y sin rodeos.','../eventimg/852864111indignados 680 x 400 300.jpg','Teatro Astor Plaza',2,'Bogot ','','','ASTOR PLAZA SALA DE EVENTOS LTDA ','PREVENTA HASTA EL 2 DE MARZO:\r\n25% de descuento en funciones de Jueves\r\n20% de descuento en funciones de Viernes y Sbado ',2,186,57,1,'PUB',2,'2017-02-19 23:01:31','','',0,0,'2017-2-19 22:59:29'),(567,1,'Mujeres a la Carta','Prximo 25 y 26 de Febrero ven a disfrutar de un da Campestre en Familia <br><br>PLAN PARA ADULTOS: <br>* Incluye: Entrada a la obra de teatro la gran comedia Mujeres a la Cart