cin de este deporte con los ms altos estndares de calidad, equipos certificados y debidamente capacitado el personal a servicio, usamos pliza contra accidentes.<br></span><br><b>Ubicacin del sitio:&nbsp;</b><span>Parador el Kiosko, kilometro 23 via Bogot Choachi,<br></span><span>Este bello lugar se encuentra a tan slo 30 minutos de Bogot. La salida la puede realizar por Monserrate o Guadalupe. Le sugerimos tomar la Avenida Circunvalar en sentido Norte  Sur hasta la Plaza de Mercado Rumichaca en el barrio Egipto. Desde all tome la calle 6, que lo conducir al municipio de Choach en 45 minutos.<br></span><br>1.	Escalada en roca 4 rutas de diferente grado de dificultad<br>2.	Seguro<br>3.	Caminata ecolgica de 20 minutos<br>4.	Fotos del evento<br>5.	Zapatos gatos tallas 35,38,40,43<br>6.	Equipo certificado&nbsp;<br>7. Guas&nbsp;calificados<br><br><br>','../eventimg/2156609escalada.jpg','Parador el Kiosko',2,'Choach','','',' BOGOTA BUNGEE','Esta actividad no es recomendada para mujeres embarazadas, personas con problemas cardacos, con fragilidad sea, osteoporosis o vrtigo.\r\n\r\n',3,166,57,1,'PUB',2,'2017-02-23 18:27:17','','',0,0,'2017-2-23 05:13:17'),(575,1,'Comic Con Colombia 2017','<b>COMIC CON COLOMBIA</b> es una convencin que une a los fanticos con sus gustos e dolos, destacndose entre otros los aficionados a los comics, anime, gamers, cine, manga, literatura fantstica, juegos de rol, cosplayers, TV, etc. <br><br>La convencin Comic Con hace parte de la cultura del entretenimiento y del universo geek de las principales ciudades y metrpolis del mundo, siendo hoy por hoy una tendencia creciente a nivel internacional.\r\n<br><br>En esta oportunidad tendr como invitada a Millie Bobby Brown','../eventimg/446528907Millie-Bobby-Brown-Comic-Con-Colombia.jpg','Plaza Mayor - Pabelln Blanco y Amarillo ',2,'Medelln ','','','ALEJANDRO CABALLERO P','PAQUETE 18 Y 19 MAYO \r\nPreventa 1 - hasta el 20 de marzo (PV1 18 19)\r\nPreventa 2 - hasta el 20 de abril  (PV2 18 19)\r\n\r\nPOR D