ntre la soledad y el amor ajeno.<br><br>La comediante, fiel a su estilo, resalta la categorizacin de los oficios por acento, la cirrosis imaginaria y otras patologas ficticias de la psiquis femenina y masculina, en este tratamiento de crueldad auto recetada, en cpsulas de comedia introspectiva y autocrtica tambin llamado&nbsp;VENGA QUE SI ES PA ESO.<br><br>Si alguna vez se ha sentido solo, envidioso, despistado, con ganas de divorciarse, feo, mal ensamblado, si no cree en la felicidad que chicanean los que lo rodean, si es de los que ensaya peleas y respuestas frente al espejo, si cree que habla mucho o piensa mucho... tranquilo, todo puede ser peor, algo que descubrir con &nbsp;Liss Pereira, en el escenario.<span><br><br></span>','../eventimg/886127536liss-pereira-stand-up-comedy-venga-que-si-es-pa-eso-featured-800x351.jpg','Teatro Astor Plaza',2,'Bogot ','','','Astot Plaza Sala de Eventos LTDA ','Edad mnima de ingreso 14 aos\r\n',2,143,55,1,'PUB',2,'2017-02-26 22:47:38','','',0,0,'2017-2-26 22:39:52'),(585,531,'Conferencia Descubre tu Potencial ilimitado','Ahora le toca al Zulia\r\n\r\nEl prximo Viernes 17 de Marzo el estado Zulia recibir la conferencia \"Descubre Tu Potencial Ilimitado\" que desarrolla el MasterCoach de Vida; Norbey Rodrguez, por diferentes ciudades de Venezuela y Colombia.\r\nLa Conferencia es una herramienta para concienciar a las personas a potenciar su vida, adems de animarles a caminar en su propsito, invitando a la colectividad a ser parte del cambio y esta abierta a todo pblico, cuyo nico requisito es anhelar ser parte del cambio de Cabimas.\r\nEn Diferentes ciudades de Venezuela y Colombia, el conferencista anima a los participantes a hacer cosas diferentes y animndoles a asumir nuevos retos y emprender nuevos desafos de vida para alcanzar el xito.\r\nNorbey Rodrguez es MasterCoach certificado por la Universidad Iberoamericana de Liderazgo (UNILID), adems de poseer estudios de Ingeniera, Comunicacin Social y Teologa, es certificado Coach 