cta para lidiar con los hijos adolescentes. Quiz sea la clave para sobreponerse a los malos negocios del (ex)marido, o simplemente el curso para tolerar el mal gusto de la amante<br></span><br>La segunda con su humor negro los espectadores podrn disfrutar de un espectculo de la cruda y divertida realidad con&nbsp;Alejandra Azcarate&nbsp;. Los celos, la constante bsqueda de pareja, las frustraciones, el matrimonio, los ex, la luna de miel, las suegras, la convivencia el sexo y la infidelidad, son algunos de los temas que Alejandra toca desde una perspectiva femenina ms no feminista, ya polmica, controvertida, rpida, divertida y franca como su protagonista son las caractersticas centrales de este show.','../eventimg/1612312180dosmujeres.jpg','Teatro Jos Consuegra Higgins',2,'Barranquilla','','','CORPORACION ARTISTICA EN ESCENA ','Edad mnima de ingreso 14 aos\r\n\r\nEntradas en tuboleta.com ',2,140,57,1,'PUB',2,'2017-03-05 21:23:46','','',0,0,'2017-3-5 21:18:42'),(603,1,'Todo un Lokillo ','En Todo un Lokillo habr desde una muy peculiar serenata a una quinceaera, pasando por un Tour donde Nairo Quintana es campen, hasta un recorrido por las distintas maneras de trovar en Colombia. Estos y muchos ms cuadros cmicos harn vivir al pblico un show inolvidable en Bogot. \r\n<br><br>LOKILLO combina en este espectculo su capacidad de improvisacin, su humor musical y sus mejores imitaciones. Durante hora y media los asistentes podrn conocer cara a cara a nuestro campen Nairo Quintana, al sexy Maluma, a Pipe Arias, al senador Robledo, entre otros, con el estilo.&nbsp;<br><br>La memoria es la historia de un pas y la trova hace parte de esa cultura que nos hace sentir orgullosos de ser colombianos, por esa razn, el Teatro Astor Plaza los invita a pasar 3.600 segundos con las ocurrencias de LOKILLO, el trovador con ms galardones en el pas.&nbsp;<br>','../eventimg/252459360todo un lokillo.jpg','Teatro Astor Plaza',2,'Bogot ','','',' ASTOR PLAZA SALA DE EVENTOS LTDA ','Edad mnima de in