a edad de 20 aos ya es un fenmeno de las redes sociales en Latinoamrica. Su historia es como la de la cenicienta apenas unos aos atrs Mario era como cualquier chico de su edad, hoy la legin de BAUTISTERS (como se denominan sus seguidores supera ya los 9 millones en Latinoamrica.<br><br>Premios y Reconocimientos:<br>Ganador en los Millenial Awards de MTV como lo mas Hot 2015<br>Ganador MTV Europe Music Awards al Mejor Artista Latinoamericano Norte 2015<br>Ganador en los kids Choice Awards de Nickelodeon como (El Mas Influyente En Redes Sociales)<br>Conductor en los premios Kids Choice Awards de Nickelodeon 2015 y 2016&nbsp;<br>Ganador en los MTV Millenial Awards 2015 como Artista Buzz e Icono Digital del Ao&nbsp;<br>Ganador en los Kids Choice Awards de Nickelodeon como el Favorito en Redes Sociales<br>Ganador en los Kids Choice Awards de Nickelodeon como Artista Favorito Latino 2016<br>','../eventimg/2064872185maxresdefault.jpg','Centro de Eventos Multiparque',2,'Bogot ','','','PRO MUSIC LA S.A.','Edad mnima de ingreso 12 aos \r\n\r\nEntradas en tuboleta.com',1,233,57,1,'PUB',2,'2017-03-09 17:24:18','','',0,0,'2017-3-9 17:19:23'),(613,1,'Duros de Amar  con Fernando Arvalo y Patrick Delmas...','Mara y Simn son una pareja moderna, que despus de disfrutar las mieles del enamoramiento sucumben ante su primera crisis y deciden romper. Sin embargo, rpidamente descubren que son incapaces de vivir el uno sin el otro. Dispuestos a solucionar sus diferencias, deciden acudir a un excntrico coach experto en relaciones de pareja, famoso por sus mtodos efectivos, pero poco cientficos. Mara y Simn se embarcan en una aventura loca, que al final les permitir descubrir que su amor, as sea imperfecto, es lo ms valioso. En Duros de Amar aprenderemos a travs de la comedia, que vale la pena luchar en pareja por vencer las mil trampas que nos trae el amor. <br><br><div>Autores: Melissa Drigeard y Vincent Juillet<br>Traduccin y adaptacin: Patrick Delmas y Fernando Arvalo<br>Direccin: Manuel