utor de msica en los gneros de despecho y nortea, ha logrado convertirse en una verdadera estrella gracias a su talento, carisma y la letra de sus canciones que ha llegado al corazn de sus seguidores. Desde sus 13 aos se dio cuenta que componer era una necesidad para l, un medio especial para expresar sus sentimientos y una realizacin personal.&nbsp;<br><span>Con su cancin \"Maldita Traicin\" sali del anonimato y hoy est posicionado como uno de los cantantes ms importantes de la msica popular en Colombia. El humanismo siempre ha sido el pilar de su trayectoria, igual para su familia. Su gran influencia ha sido su amigo Daro Gmez.<br><br></span>PIPE BUENO, Andrs Felipe Giraldo Bueno, es una de las figuras ms relevantes en este gnero tanto en el mercado nacional como internacional. Inici su carrera a los 16 aos y desde entonces empez a perfilarse como uno de los mejores, gracias a su indudable talento y estilo. Es conocido como \"El nio bonito del despecho\".<br><br><span>Recostada en la cama, No voy a morir, Te parece poco, Si yo fuera Ladrn, Tu viaje me duele, No me digas que no, entre muchas otras canciones, hacen parte del largo repertorio de sus xitos que lo han llevado por escenarios importantes en el mundo y al lado de grandes figuras de la msica vallenata y popular.<br></span><br>Paola Jara, ms conocida como actriz que como cantante, en los ltimos 10 aos ha incursionado en esta msica cantando en sitios y eventos tanto pblicos como privados acompaada de mariachis entre otros grupos musicales de renombre. Con gran aceptacin por parte del pblico de todo el pas se ha dado a conocer como Paola Jara La voz ranchera.<br><br>En su trayectoria ha compartido escenario con artistas de talla internacional como Vicente Fernndez, Alejandro Fernndez y Juan Gabriel; y con artistas nacionales como Johnny Rivera, Giovanny Ayala, Daro Gmez, Marbell, Jorge Celedn, El Charrito Negro, Luis Alberto Posada, Carlos Arturo (El Seor del Bolero), Elenita Vargas, Los Gigantes del Vallenat