tades y ancdotas del mundo del canto lrico y popular en Bogot desde una posicin anecdtica y realista. El mundo del Rock y su permanente resistencia en el colectivo latinoamericano son la inspiracin y el motor central del discurso alrededor del ser o no Freddy Mercury.<br></span><br>Freddie Mercury, fuente de inspiracin de esta pieza fue un cantante, compositor y msico britnico de origen parsi e indio, conocido por haber sido el fundador y vocalista de la banda de rock Queen. Como intrprete, fue reconocido por su poderosa voz y extravagantes puestas en escena. Como compositor, escribi muchos de los xitos de Queen, tales como Bohemian Rhapsody, Killer Queen, Somebody to Love, Don\"t Stop Me Now, Crazy Little Thing Called Love, Innuendo o We Are the Champions. Considerado como uno de los mejores msicos masculino de todos los tiempos.<br>','../eventimg/895730861fredy mercury.jpg','Casa E',2,'Bogot','','','CORPORACION CASA ENSAMBLE ','Edad mnima 18 aos \r\nEntradas en tuboleta.com ',1,145,57,1,'PUB',2,'2017-04-01 09:46:27','','',0,0,'2017-4-1 09:45:17'),(659,1,'Bodas de Oro de Alci Acosta ','50 Aos del Rey del bolero, en una noche llena de recuerdos musicales&nbsp;','../eventimg/1400244239ALCI-ACOSTA.jpg','Discoteca Cabaret',2,'Cartagena ','','','LILIANA PADILLA','Edad mnima 18 aos \r\nEntradas en tuboleta.com\r\nPreventa hasta el 7 del Abril ',1,135,57,1,'PUB',2,'2017-04-03 05:27:43','','',0,0,'2017-4-3 05:21:57'),(660,1,'Que desgracia tan infinita con Diego Trujillo ','Los cuarenta aos son un punto de quiebre en la vida de cualquier ser humano. A los cincuenta, viene el quiebre completo. Ese es el tema central del monlogo de humor Qu desgracia tan infinita, escrito y dirigido por Diego Trujillo, y en donde el comediante es quien le cuenta a los espectadores sus experiencias con la mediana edad. \r\n<br><br>La verdad es que todos estamos expuestos a esa dictadura de la edad. A los veinte aos nos remos de ese to o de ese amigo que ha comenzado a comprar tratamientos contra la calvicie. A los 30, puede que aparezca esa primera cana que da el campanazo de alerta. Todo se puede manejar con relativa calma, hasta que en el ponqu del cumpleaos aparece el nmero 40 y empezamos a ver en el horizonte la inminencia del declive.&nbsp;<br><br>Es entonces cuando a los hombres los asedian con advertencias sobre el comportamiento de la prstata. Cuando una pizza a media noche es el preludio de una noche infernal y de una semana en la que la barriga delata el exceso de caloras. Cada da aparece una nueva seal que anuncia lo inevitable: estamos envejeciendo. Al llegar a los cincuenta, solo se puede exclamar: Qu desgracia tan infinita.<br><br>La obra es en realidad divertidsima. Diego Trujillo tuvo buen cuidado en seleccionar ancdotas y situaciones con las que cualquier espectador se puede identificar fcilmente. Es tanta la empata que ha alcanzado con el pblico, que en ms de una ocasin ha tenido que interrumpir la funcin porque las carcajadas de alguno de los presentes les impiden concentrarse a los dems.&nbsp;<br>','../eventimg/580930775diego-trujillo-que-desgracia-tan-infinita-1.jpg','Auditorio Centro Cultural Old Mutual',2,'Bogot ','','','FUNDACION T DE TEATRO','Edad mnima 16 aos \r\nEntradas en tuboleta.com ',1,139,57,1,'PUB',2,'2017-04-03 05:33:02','','',0,0,'2017-4-3 05:29:44'),(661,1,'Suso el Paspi -  Tirando Caja Parte 2','En Tirando Caja 2 Encajando en el mundo&nbsp;<br><br>Suso el Paspi cuenta una divertida historia de cmo los colombianos tenemos que hacer para tratar de encajar en el mundo donde decir la verdad es pecado. Los asistentes podrn ver ese paso por la vida donde se elige el nombre y se entra a la adolescencia con sus miedos, sus angustias y su sexualidad; adems Suso nos invita a respetar la diferencia, nos ensear a besar y nos contar cmo pierde la virginidad. \r\n<br><br>Se tiene la teora que en el mundo de hoy quien no baila, no encaja y quien no viaja, no goza con todas las cosas que pueden ocurrir en un paseo. Es una obra de grandes sorpresas donde podemos ver al personaje en mltiples facetas, todas muy divertidas y originales. Es una obra para disfrutar en familia.<div><br></div>','../eventimg/1097951703susos.jpg','Teatro Astor Plaza',2,'Bogot ','','','TE CREO S.A.S.','Edad mnima 8 aos \r\nEntradas en tuboleta.com ',2,174,57,1,'PUB',2,'2017-04-03 05:42:25','','',0,0,'2017-4-3 05:36:00'),(662,1,'Gran Noche De Compositores  Valledupar 2017','Gran Noche De Compositores con&nbsp;<br><br><ul><li>Poncho Zuleta y Cocha Molina</li><br><li>Indira De La Cruz y sus clsicos Vallenatos</li><br><li>Gustavo Gutirrez</li><br><li>Fabin Corrales</li><br><li>Romualdo Brito y su banda vallenata</li><br><li>Rita Fernndez</li><br><li>Rafael Manjarrez</li><br><li>Isaac Carrillo</li><br><li>Jorge Valbuena</li><br><li>Reynaldo \"Chuto\" Daz</li><br><li>Adolfo Pacheco</li><br><li>Alberto \"Beto\" Murgas</li></ul>','../eventimg/1129217615Gran-Noche-de-Compositores-Valledupar-2017-BANNER-PRINCIPAL-HORIZONTAL-760X400.jpg','Colegio Colombo Ingls',2,'Valledupar ','','','Fundacin Cultural y Social Romualdo Brito','Edad minma 18 aos \r\nEntradas en ticketshop.com.co\r\nPreventa hasta el 14 de abril ',1,244,57,1,'PUB',2,'2017-04-04 05:17:09','','',0,0,'2017-4-4 05:12:17'),(663,1,'Reluciente Rechinante Aterciopelado','Nuevamente la capital acoger con los brazos abiertos a uno de sus hijos ms emblemticos <b>ATERCIOPELADOS</b>, junto a SUPERLITIO y SALSA-N-GROOVE darn una descarga de buena msica en el Auditorio Mayor CUN (Antiguo DOWNTOWN MAJESTIC). Una gran Fiesta con: Bolero Falaz, El Estuche, Sortilegio, Rompecabezas, Baracunatana, Maligno, El lbum, Florecita Rockera, entre innumerables temas que Andrea y Hctor nos han regalado en todos estos aos de carrera artstica, donde se han hecho acreedores a: 2 Latn Grammy, 2 Premios MTV, 1 MTV Latino, 1 Premios Lo Nuestro, 4 premios Nuestra Tierra, entre muchos otros reconocimientos, que los han posicionado como el grupo de Rock ms importante de Colombia.\r\n<br><br>Con ellos est