a, Ecuador, Per y Panam. Los profesionales locales tendrn la oportunidad de reunirse con clientes y proveedores en un evento dedicado.','../eventimg/1578996307ColombiaGlass.jpg','Hotel Sheraton Bogot Calle 25B No 69C-80',1,'Bogota','','','Colombia Glass','    ',6,30,57,1,'PUB',2,'2017-10-18 18:10:24','','',0,0,'2017-10-18 18:10:14'),(695,1,'Influencer Marketing Summit','Gosocial, Goldfish y Alter, empresas pioneras en mercadeo en redes sociales, se unieron para transmitir conocimientos sobre las mejores prcticas, claves y procesos para hacer una integracin exitosa del marketing y la publicidad con influenciadores. Para lograrlo, organizaron el Influencer Marketing Summit 2017, que se celebrar este jueves 19 de octubre en el Hall 74, centro de eventos de la Universidad Sergio Arboleda, en Bogot (Calle 74 # 14  25).\r\n\r\nEl objetivo principal de este evento es que las agencias de publicidad de Colombia y Lationamrica aprendan a crear contenidos que lleguen a ms clientes y descubran metodologas efectivas para medir el impacto de sus campaas, desarrollando estrategias que calculen el retorno de las inversiones realizadas en sus campaas. ','../eventimg/66541452Influencers.jpg','Universidad Sergio Arboleda - Carrera 15 # 74',1,'Bogota','','','Universidad Sergio Arboleda','    ',6,34,57,1,'PUB',2,'2017-10-18 18:13:28','','',0,0,'2017-10-18 18:13:24'),(696,1,' Scrum Product Owner en Bogota','El Scrum Product Owner  es una inmersin en el rol Dueo de Producto con actividades prcticas enseando cmo construir productos a los que los clientes les encanta usar mtodos Agile.   La clase era absolutamente fabulosa. Fabian estaba muy bien informado. l es uno de los mejores instructores que he conocido en mis 30 aos de carrera.  Arturo Reyes, Sr. Integration Manager\r\n\r\nContenido:\r\nLos principios Lean que establecen las bases para Scrum\r\nValores y principios giles  cmo hacerlos servir de gua\r\nEl marco de Scrum  cmo todas las piezas encajan, y lo que falta\r\nLas funciones de Scrum: Product Owner, ScrumMaster y el equipo de desarrollo\r\nResponsabilidades  y autoridad  del Dueo del Producto\r\nVarias formas impactantes de comunicar la visin de su producto\r\nHerramientas para crear sucintamente el caso comercial de su producto\r\nHerramientas sencillas para construir una Roadmap de Producto efectiva\r\nTcnicas para involucrar a sus interesados de manera significativa\r\nDefinir sus segmentos de clientes\r\nDescubrir caractersticas y organizarlas en un formato manejable\r\nAprendizaje validado: cmo descubrir las caractersticas que los clientes realmente necesitan\r\nUna variedad de modelos para secuenciar (priorizar) las caractersticas y proyectos\r\nAprovechamiento de historias de usuarios para una mejor definicin de caractersticas (requisitos)\r\nPatrones para romper grandes rasgos en pequeas historias de usuario\r\nCmo obtener informacin actualizable, rpida y frecuente sobre los productos\r\nTcnicas de refinamiento de backlog (refinement) para optimizar la efectividad\r\nMtodos de pronstico de productos a largo plazo  la forma Lean-Agile\r\n\r\nLa inversin incluye:\r\nMateriales del curso en forma electrnica.\r\nAlmuerzo y bebidas.\r\n16 PDUs categoria A','../eventimg/729330361Bogota.jpg','BogotaLugano Imperial Suites  762 Calle 70a',1,'Bogota','','','Fabian Schwartz','    ',6,64,57,1,'PUB',2,'2017-11-21 19:10:45','','',0,0,'2017-10-18 18:18:40'),(697,593,'Primera Jornada de Finanzas Personales','Queremos propiciar un escenario de intercambio de experiencias y proyectos de negocio entre inversionistas, empresarios y acadmicos en el mbito de las finanzas personales, especialmente en lo relativo a las opciones en planes de inversin, sucesin y educacin econmica de las empresas familiares.','../eventimg/1736186001profile.jpg','Sede Uniandinos - Calle 92 # 16 - 11',1,'Bogot','https://www.facebook.com/jornadadefinanzaspersonales/','@JFinPersonales','Twelvefaces.co ','    ',8,77,57,1,'PUB',2,'2017-10-30 18:20:50','','',0,0,'2017-10-30 18:20: