INSERT INTO `message` VALUES (2,'6','que mas!!!!','2009-10-29 00:00:00'),(20,'221','LANZAMIENTO LIBRO\r\nPresentacin de la obra Armero, la ciudad donde viv del autor Fernando Cervantes, Teichon de Delia Bolao Ipuana, Sueos o realidad de Jairo Orlando Iabrra, l de Hedrix Gutirrez Ibargen, Los enemigos de Trujillo de Luis felipe Prez, Alma serrana de Pedro Licona, 42k de scar Alfredo Alfonso Roa, El Reinado de Harley y otros cuentos de PEN International. Proyeccin audiovisual.\r\n\r\nDia: domingo 26 de abril de 2015\r\nHora de inicio: 06:01 PM - hora fin 07:30 PM\r\nCategoria: Programacin editorial para todos\r\nLugar: Manuel Meja Vallejo ','2015-04-26 00:00:00'),(19,'','ejr','2015-04-12 00:00:00'),(18,'','aurtr','2015-04-12 00:00:00'),(17,'187','Por favor el dia del evento recordar que el parqueadero es gratis para los asistentes','2015-03-07 00:00:00'),(16,'187','Tener presente que los menores de edad deber ir con un adulto.','2015-03-07 00:00:00'),(15,'187','Mensaje informativo a todos los asistentes','2015-03-07 00:00:00'),(21,'221','OBJETIVO DEL EVENTO: Impulsar el desarrollo del sector editorial y grfico, as como la produccin intelectual y cultural, el fomento de la lectura y la promocin del libro.\r\n','2015-04-26 00:00:00'),(22,'222','Viernes 1 de mayo la funcin es a las 6:00 pm','2015-04-26 00:00:00'),(23,'223','Representaron al continente en el International Beatles Week Festival que se lleva a cabo en Liverpool, Inglaterra. Gracias a su excelente participacin fueron invitados al festival Abbey Road On The River en Louisville, KY en Estados Unidos donde tocaron sus 3 tributos y fueron considerados uno de los grupos revelacin por espectadores y organizadores, razn por la cual estn invitados este ao como uno de los espectculos centrales del festival y adems estarn acompaados por una leyenda del rock: Phil Kenzie, saxofonista que grabo con Los Beatles el lbum Let It Be.','2015-04-26 00:00:00'),(37,'664','Testing Asistentes 3','2017-10-11 16:44:48'),(38,'664','Testing Seguidores 3','2017-10-11 16:45:00'),(39,'664','Testing Assitentes 4','2017-10-11 16:52:39'),(40,'664','Testing Seguidores 4','2017-10-11 16:53:03'),(41,'664','Testing Ambos 1','2017-10-11 16:53:36'),(42,'664','Prueba seguidores 5','2017-10-11 17:18:38'),(43,'664','Test seguiodres sin imagen','2017-10-11 17:22:07'),(44,'664','Follow seguidres','2017-10-11 17:34:13'),(45,'664','Test morales gmail','2017-10-11 17:37:51'),(46,'664','fadsfadsgfdsg','2017-10-11 17:41:35'),(47,'664','Ahora si???','2017-10-11 17:44:41'),(48,'664','Ahora si?? Asistentes','2017-10-11 17:44:57'),(49,'664','testting to everybody','2017-10-11 22:07:13');
